[["Eres Mi Todo", "Generaciones", "Proclamar\u00e9 Tu Amor 2", "-", "", 70013], ["Cristo No Est\u00e1 Muerto", "Varios", "Juan Carlos Alvarado", "-", "", 80011], ["Sin Reservas", "Marco Barrientos", "Sin Reservas", "-", "", 80015], ["Cu\u00e1n Hermoso", "Danilo Montero", "Tu Amor", "-", "", 80016], ["Ayer Te Vi", "Jes\u00fas Adri\u00e1n Romero", "Ayer Te Vi...Fue M\u00e1s Claro Que La Luna", "-", "", 1050014], ["Digno De Gloria", "Coalo Zamorano", "Cosas Poderosas", "-", "Gloria a Dios en lo alto\r\ngloria al alt\u00edsimo que venci\u00f3\r\neres todopoderoso\r\nel cordero inmolado\r\ndigno de adoraci\u00f3n.\r\nAdmirable defensor\r\nquien nos cuida por amor\r\nmajestuoso redentor\r\ndigno de gloria y digno de honra\r\nconfesamos sin temor\r\ntorre fuerte es nuestro Dios\r\ndeclararemos eres grande\r\ndigno de gloria y digno de honra.\r\n\r\n\r\nPuente:\r\nDigno, digno de gloria y honor\r\neres digno,\r\nno existe\r\nnadie m\u00e1s grande\r\neres digno, digno de gloria y honor\r\neres digno,\r\ndigno de gloria y\r\ndigno de honra.\r\nFuerte, fuerte en batalla oh Dios!\r\neres fuerte!\r\nno existe nadie m\u00e1s fuerte,\r\nEres fuerte, fuerte en batalla oh Dios!\r\neres fuerte!\r\ny digno de gloria y\r\ndigno de honra.", 2090011], ["Jes\u00fas", "Jes\u00fas Adri\u00e1n Romero", "El Brillo De Mis Ojos", "-", "Cuando brilla el sol,\r\ncuando sopla el viento,\r\nquiero estar presente\r\nquiero darte mi atenci\u00f3n.\r\n\r\nY al anochecer,\r\nhasta en el silencio,\r\nquiero estar atento\r\ny escuchar as\u00ed T\u00fa voz.\r\n\r\nQuiero que en mi viaje\r\nseas T\u00fa el camino,\r\nseas el destino\r\ny el paisaje alrededor.\r\n\r\nJes\u00fas,\r\neres todo para mi\r\nno falta nada.\r\nTu presencia es mi morada.\r\n\r\nJes\u00fas,\r\npuedo disfrutar en Ti,\r\ncada momento.\r\nJes\u00fas, mi complemento.\r\n\r\nQuiero despertar,\r\nver un mundo nuevo\r\ny cada momento\r\nla jornada disfrutar.\r\n\r\nQuiero caminar,\r\nperder el aliento.\r\nViendo la belleza\r\nde las cosas que me das.\r\n\r\nQuiero que en mi viaje\r\nseas T\u00fa el camino,\r\nseas el destino\r\ny el paisaje alrededor.\r\n\r\nJes\u00fas,\r\neres todo para mi\r\nno falta nada.\r\nTu presencia es mi morada.\r\n\r\nJes\u00fas,\r\npuedo disfrutar en Ti,\r\ncada momento.\r\nJes\u00fas, mi complemento.\r\n\r\nQuiero en Ti confiar\r\ny en tus caminos siempre andar.\r\nPoniendo siempre la mirada\r\nen Ti Jes\u00fas cada ma\u00f1ana,\r\npara jam\u00e1s volver atr\u00e1s, Jes\u00fas.\r\n\r\nEres todo para m\u00ed\r\nno falta nada.\r\nTu presencia es mi morada.\r\n\r\nJes\u00fas,\r\npuedo disfrutar en Ti\r\ncada momento.\r\nJes\u00fas, mi complemento\r\n\r\nEres todo para m\u00ed.\r\nJes\u00fas, mi complemento.\r\n", 3080006], ["Gozo En Tu Presencia", "Marco Barrientos", "Gozo En Tu Presencia", "-", "", 3090009], ["Tu Amor", "Danilo Montero", "Tu Amor", "-", "", 4040020], ["A Ti", "Danilo Montero", "Tu Amor", "-", "", 4040021], ["Vine a Alabarte", "Varios", "Aline Barros", "-", "", 4050015], ["Todo Es Tuyo", "Danilo Montero", "Tu Amor", "-", "", 4050019], ["Razones pa vivir", "Jes\u00fas Adri\u00e1n Romero", "Ayer Te Vi...Fue M\u00e1s Claro Que La Luna", "-", "", 5070016], ["Venimos A Adorarte", "Coalo Zamorano", "Cosas Poderosas", "-", "", 6100009], ["Gracias", "Marcos Witt", "Venci\u00f3", "-", "Me has tomado en tus brazos\r\nY me has dado Salvaci\u00f3n\r\nDe tu amor has derramado\r\nEn mi coraz\u00f3n\r\n\r\nNo sabr\u00e9 agradecerte\r\nLo que has hecho tu por m\u00ed\r\nS\u00f3lo puedo darte ahora\r\nMi canci\u00f3n\r\n\r\n//Gracias, Gracias Se\u00f1or\r\n  Gracias mi Se\u00f1or Jes\u00fas//\r\n\r\nEn la cruz diste tu vida\r\nEntregaste todo ah\u00ed\r\nVida eterna regalaste\r\nAl morir\r\n\r\nPor tu sangre tengo entrada\r\nAnte el trono celestial\r\nPuedo entrar confiadamente\r\nAnte t\u00ed", 6100010], ["Te Vengo A Bendecir", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "-", "", 6140014], ["Mi Vida Eres T\u00fa", "Coalo Zamorano", "Cosas Poderosas", "-", "", 7120009], ["Palabras De Vida Eterna", "Varios", "El Volver\u00e1", "-", "", 7140014], ["T\u00fa Eres El Rey", "Marcos Witt", "Te Exaltamos", "-", "", 7150015], ["Tu Has Sido Fiel", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "-", "Me asombra\r\ntu amor y tu fidelidad.\r\nQue a pesar de m\u00ed,\r\nme puedas amar.\r\n\r\nSiempre has sido fiel,\r\ny a mi lado est\u00e1s,\r\ntus ojos de amor \r\nven mi caminar.\r\n\r\nTal vez el sol\r\nma\u00f1ana no aparezca\r\npero puedo confiar\r\nen que T\u00fa all\u00ed estar\u00e1s.\r\n\r\nY del firmamento,\r\nse borren las estrellas\r\npero a tu palabra,\r\nfiel T\u00fa seguir\u00e1s.\r\n\r\n// T\u00fa has sido fiel,\r\nT\u00fa has sido fiel,\r\nT\u00fa has sido fiel,\r\nsiempre has sido fiel //", 7150017], ["Quiero Entender", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "-", "", 8070009], ["Puedes Creer", "Varios", "Claudio Freidzon", "-", "", 8080007], ["Abba Padre", "Jes\u00fas Adri\u00e1n Romero", "Con Manos Vac\u00edas", "-", "", 8080009], ["Rey De Reyes", "Marco Barrientos", "Amanece", "-", "Rey de reyes, te adoramos,\r\ntu grandeza, proclamamos. \r\n\r\nRey de reyes, soberano\r\ntu victoria, celebramos.\r\n\r\nEres Jes\u00fas el que dio vida\r\na nuestro coraz\u00f3n, \r\neres Jes\u00fas digno de recibir \r\ntoda la adoraci\u00f3n.\r\n\r\nRey de reyes, te exaltamos,\r\npoderoso en majestad\r\neres el camino y la verdad.\r\n\r\nNo, nadie jam\u00e1s se podr\u00e1 igualar\r\na tu poder\u00edo y tu majestad \r\neres principio y eres final \r\ny para siempre tu reinaras.\r\n", 5087288098816000], ["Confiar\u00e9 S\u00f3lo En Ti", "Generaciones", "Proclamar\u00e9 Tu Amor 2", "-", "Tu misericordia\r\ninfinita como el cielo.\r\nTu fidelidad\r\ntoca las estrellas.\r\n\r\nTu gloria brilla\r\nsobre la tierra.\r\nTe veo en tu infinito\r\ny grande amor.\r\n\r\n//Confiar\u00e9 s\u00f3lo en Ti//\r\nEs por eso que\r\nte alabo mi Rey\r\n\r\n//Confiar\u00e9 s\u00f3lo en Ti//\r\nPorque he visto\r\nlos prodigios en mi ser,\r\nes por eso que te alabo mi Rey.\r\n\r\nYo veo tu poder y majestad.\r\nYo veo tu belleza y bondad.\r\nYo veo tu misericordia Dios.\r\nPuedo sentir tu amor en m\u00ed.\r\nTu amor en m\u00ed.", 5632984900173824], ["Rey De Toda Naci\u00f3n", "Marco Barrientos", "Viento M\u00e1s Fuego", "-", "Rey de toda naci\u00f3n,\r\nCoronado en majestad\r\nDe tu reino no abra fin\r\nY tuya es la potestad.\r\n\r\nHoy me postro ante ti\r\nTe adoro una vez m\u00e1s\r\nPor tu sangre carmes\u00ed\r\nSe que me aceptar\u00e1s.\r\n\r\nTe dar\u00e9\r\nToda gloria oh Rey\r\nTe exaltar\u00e9\r\nPor siempre.", 5668906396024832], ["Dulce Jes\u00fas", "Marco Barrientos", "\u00cdngrid Rosario", "-", "Como te puedo ocultar\r\nsi tu presencia en m\u00ed\r\nme hace brincar,\r\nme hace re\u00edr, me hace so\u00f1ar,\r\ntu presencia en m\u00ed.\r\n\r\nComo te puedo negar\r\nsi tu presencia vino a\r\ntransformar,\r\nen gozo el llanto y me llen\u00f3,\r\ntu presencia en m\u00ed.\r\n\r\nEs en tu presencia\r\ndonde encuentro,\r\nfortaleza y consuelo,\r\npaz en mi desvelo.\r\n\r\nSiempre T\u00fa a m\u00ed lado\r\ncuando m\u00e1s\r\ndesesperado estaba,\r\nme alcanzaba.\r\n\r\nJes\u00fas, dulce Jes\u00fas", 5682238511382528], ["Dulce Jes\u00fas", "Marco Barrientos", "Gozo En Tu Presencia", "-", "Como te puedo ocultar\r\nsi tu presencia en m\u00ed\r\nme hace brincar,\r\nme hace re\u00edr,\r\nme hace so\u00f1ar,\r\ntu presencia en m\u00ed.\r\n\r\nComo te puedo negar\r\nsi tu presencia vino a\r\ntransformar,\r\nen gozo el llanto y me llen\u00f3\r\ntu presencia en m\u00ed.\r\n\r\nEs en tu presencia\r\ndonde encuentro\r\nfortaleza y consuelo,\r\npaz en mi desierto.\r\n\r\nSiempre T\u00fa a mi lado\r\ncuando m\u00e1s desesperado estaba,\r\ntu presencia me alcanzaba,\r\nJes\u00fas, Dulce Jes\u00fas.", 5766901712027648], ["Al Que Est\u00e1 Sentado", "Varios", "Palabra En Acci\u00f3n", "2015/05/02", "Al que est\u00e1 sentado en el trono\r\ny al cordero.\r\n\r\n//Sea la gloria y honor,\r\nalabanza y poder\r\npara siempre.//\r\n\r\n", 4160001], ["Tu Mirada", "Marcos Witt", "Venci\u00f3", "2015/07/05", "Tus ojos revelan que yo\r\nnada puedo esconder.\r\nQue no soy nada sin ti,\r\nOh fiel Se\u00f1or.\r\n\r\nTodo lo sabes de m\u00ed,\r\ncuando miras el coraz\u00f3n.\r\nTodo lo puedes ver\r\nmuy dentro de m\u00ed.\r\n\r\nLleva mi vida\r\na una sola verdad.\r\nQue cuando me miras\r\nnada puedo ocultar.\r\n\r\nS\u00e9 que es tu fidelidad\r\nque lleva mi vida m\u00e1s all\u00e1\r\nde lo que puedo imaginar.\r\n\r\nS\u00e9 que no puedo negar\r\nque tu mirada puesta en m\u00ed\r\nme llena de tu paz.\r\n\r\n", 2090016], ["Mi Universo", "Jes\u00fas Adri\u00e1n Romero", "El Aire De Tu Casa", "2015/07/19", "Que seas mi universo\r\nNo quiero darte solo un rato de mi tiempo\r\nNo quiero separarte un d\u00eda solamente\r\n\r\nQue seas mi universo\r\nNo quiero darte mis palabras como gotas\r\nQuiero un diluvio de alabanzas en mi boca\r\n\r\nQue seas mi universo\r\nQue seas todo lo que siento y lo que pienso\r\nQue seas el primer aliento en la ma\u00f1ana\r\nY la luz en mi ventana\r\n\r\nQue seas mi universo\r\nQue llenes cada uno de mis pensamientos\r\nQue tu presencia y tu poder sean mi alimento\r\nOh Jes\u00fas es mi deseo\r\n\r\nQue seas mi universo\r\nNo quiero darte solo parte de mis a\u00f1os\r\nTe quiero due\u00f1o de mi tiempo y de mi espacio\r\n\r\nQue seas mi universo\r\nNo quiero hacer mi voluntad, quiero agradarte\r\nY cada sue\u00f1o que hay en mi quiero entregarte\r\n\r\nQue seas mi universo\r\nQue seas todo lo que siento y lo que pienso\r\nQue seas el primer aliento en la ma\u00f1ana\r\nY la luz en mi ventana\r\n\r\nQue seas mi universo\r\nQue llenes cada uno de mis pensamientos\r\nQue tu presencia y tu poder sean mi alimento\r\nOh Jes\u00fas es mi deseo\r\n\r\n", 3090007], ["Siempre", "Varios", "Vertical", "2015/07/19", "Siempre algo me habla de tu amor\r\nSiempre algo a mi alrededor\r\nSiempre puedo verlo,\r\nLo puedo sentir\r\nSiempre lo puedo sentir\r\n\r\nSiempre tu me asombras\r\nVeo el mar y veo tu gloria\r\nSiempre me sorprendes \r\nVeo el cielo y son tus obras\r\n\r\nSiempre tu me asombras\r\nHablando contigo otra vez\r\nSiempre me sorprendes\r\nTe veo en cada amanecer.\r\n\r\nCantando te quiero alabar\r\nHasta que te logre agradar\r\nY tu presencia vea descender\r\nVea descender", 5639445604728832], ["\u00bfQui\u00e9n Es C\u00f3mo T\u00fa?", "Marcos Witt", "Te Exaltamos", "2015/08/09", "\u00bfQui\u00e9n es c\u00f3mo T\u00fa?\r\nOh, Dios, eres sin igual,\r\n\u00bfQui\u00e9n es c\u00f3mo T\u00fa?\r\nvestido en Majestad,\r\nMaravilloso, Grande es tu Poder,\r\n\u00bfQui\u00e9n es c\u00f3mo T\u00fa, mi Se\u00f1or?\r\n\r\nTu diestra es poderosa Se\u00f1or,\r\ntu Poder la Victoria gan\u00f3,\r\nDios es Dios fuerte,\r\nsu nombre es el Se\u00f1or\r\ny yo le adorar\u00e9 por siempre.", 5090017], ["De Ti Dependo", "Jes\u00fas Adri\u00e1n Romero", "El Aire De Tu Casa", "2015/08/09", "Me he vuelto dependiente\r\nde tu coraz\u00f3n y de tu amistad.\r\nMe he vuelto dependiente\r\nde tu direcci\u00f3n en mi caminar.\r\n\r\nNo hay nada que me llene\r\ncomo lo haces T\u00fa, \r\neres mi diario pan.\r\n\r\nT\u00fa eres la raz\u00f3n\r\nde cada sue\u00f1o en m\u00ed,\r\neres mi verdad.\r\n\r\nDe Ti depende mi vida \r\nmis sue\u00f1os y mi alegr\u00eda,\r\ncomo la lluvia necesita nubes,\r\ncomo el r\u00edo del mar.", 8070007], ["Altisimo Se\u00f1or", "Torre Fuerte", "Altisimo Se\u00f1or", "2015/08/23", "Fue algo as\u00ed como\r\nlluvia en tierra seca, \r\nun rayo de luz de repente\r\nen mi oscuridad.\r\n\r\nFue algo as\u00ed como estar\r\nen cadena perpetua \r\ny una ma\u00f1ana escuchar \r\nTe doy libertad.\r\n\r\nY siendo un vil pecador \r\nhoy como en su mesa \r\ny s\u00f3lo su gracia le basta\r\na mi coraz\u00f3n.\r\n\r\nAlt\u00edsimo Se\u00f1or, en mi bajeza\r\nme has mirado y me has\r\ntendido la escalera de tu amor, \r\n\r\nTu perd\u00f3n me puso alas, \r\noh, mi Dios.\r\nAlt\u00edsimo se\u00f1or, entre mis sombras,\r\ntu palabra alumbr\u00f3 mi coraz\u00f3n.\r\n\r\nFue algo as\u00ed como estar\r\nen el abismo mas hondo\r\ny unos segundos despu\u00e9s \r\nsobres las nubes volar.\r\n\r\nFue algo as\u00ed como ser \r\nun peregrino cansado \r\nque toca la puerta y le dice \r\nTe doy un lugar. \r\n\r\nY siendo un vil de lo peor \r\nHoy como en su mesa \r\nY solo su gracia \r\nLe basta a mi coraz\u00f3n", 5757715179634688], ["S\u00f3lo T\u00fa", "Marco Barrientos", "Mu\u00e9strame Tu Gloria", "2015/08/30", "Exaltado, sobre Cielos, Tierra y Mar, \r\nAdmirable, Dios de Gloria y Majestad, \r\nPoderoso, No hay nadie como T\u00fa. \r\n\r\nTorre Fuerte, mi Escudo y Protecci\u00f3n \r\nInvencible, qui\u00e9n es c\u00f3mo T\u00fa Se\u00f1or, \r\nPoderoso, No hay nadie como T\u00fa. \r\n\r\nS\u00f3lo T\u00fa, me sacias de verdad, \r\nMe das tu Santidad, \r\nInigualable eres.\r\n\r\nS\u00f3lo en Ti, est\u00e1 la Salvaci\u00f3n, \r\ny toda Bendici\u00f3n, \r\nEres eterno Dios de Amor.", 1070008], ["Cosas Poderosas", "Coalo Zamorano", "Cosas Poderosas", "2015/09/13", "Cosas poderosas suceden\r\ncuando alabamos al Rey.\r\n\r\nEl sordo oye, el ciego ve,\r\ncadenas rotas con su poder,\r\nalcemos junto nuestra voz\r\ny exaltemos a nuestro Rey.\r\n\r\nAdoremos al Rey.", 1050015], ["Roca Eterna", "Marcos Witt", "Te Exaltamos", "2015/09/27", "Roca eterna verdadero y fiel,\r\nT\u00fa prometes cumplir con tu Palabra,\r\nRoca eterna eres justo y fiel,\r\nmi confianza siempre en Ti pondr\u00e9.\r\n\r\nMi refugio contra la tormenta,\r\nla torre de mi protecci\u00f3n,\r\nfortaleza en dificultades,\r\nmi escondedero eres T\u00fa.\r\n\r\nSanas todas mis enfermedades,\r\nconsuelas todo mi dolor,\r\neres fuerza al sentirme d\u00e9bil,\r\nmi ayuda en necesidad.", 6100006], ["Cuenta Conmigo", "Jes\u00fas Adri\u00e1n Romero", "Ayer Te Vi...Fue M\u00e1s Claro Que La Luna", "2015/10/04", "Desde que salga el sol,\r\nhasta que vuelva la luna,\r\nde donde ahora estoy\r\nhasta el \u00faltimo rinc\u00f3n del mundo.\r\n\r\nNo importa la ocasi\u00f3n,\r\nsi T\u00fa me necesitas,\r\ndispuesto estoy a ir\r\ny a obedecer.\r\n\r\nCuenta conmigo para ir,\r\naunque no vuelva a regresar,\r\ncuenta conmigo para ir,\r\nhasta no poder respirar.\r\n\r\nA donde me quieras llevar,\r\nsiempre en las filas me hallar\u00e1s,\r\nconmigo T\u00fa puedes contar\r\nen cualquier lugar.\r\n\r\nSi tarde has de llamar,\r\neso ya no me incomoda,\r\nmis planes son de Ti,\r\nmis poemas, mi canci\u00f3n, mis horas.\r\n\r\nNo importa la ocasi\u00f3n,\r\nsi T\u00fa me necesitas,\r\ndispuesto estoy a ir\r\ny a obedecer.", 5080012], ["Celebra Victorioso", "Varios", "Juan Carlos Alvarado", "2015/10/31", "Celebra victorioso\r\nel triunfo de Cristo\r\nte ha hecho m\u00e1s que Vencedor.\r\n\r\nMayor es el que est\u00e1 en ti\r\nque el que est\u00e1 en el mundo\r\nme ha hecho m\u00e1s que vencedor.\r\n\r\n\u00a1Todo lo puedo en Cristo\r\nque me fortalece!\r\n\u00a1M\u00e1s que vencedor!\r\n\r\n\u00a1Si Dios est\u00e1 conmigo\r\nquien contra m\u00ed!\r\n\u00a1M\u00e1s que vencedor!\r\n\r\nSoy M\u00e1s que vencedor en Cristo\r\n\u00a1M\u00e1s que vencedor!\r\n", 4040013], ["Dir\u00e9 a la Monta\u00f1a", "Varios", "Don Moen", "2015/11/08", "Dir\u00e9 a la monta\u00f1a Delante de m\u00ed\r\nQu\u00edtate y en el mar \u00e9chate.\r\nCreo yo que las cosas, que as\u00ed declar\u00e9\r\n//pasar\u00e1n si yo creo en Dios//\r\n\r\nCaminar\u00e9 ante el se\u00f1or\r\nAunque no pueda ver.\r\nEsto es solo temporal\r\n\u00c9l fiel por siempre es.\r\n\r\nDir\u00e9 a la monta\u00f1a Delante de m\u00ed\r\nQu\u00edtate y en el mar \u00e9chate.\r\nCreo yo que las cosas, que as\u00ed declar\u00e9\r\n//pasar\u00e1n si yo creo en Dios//\r\n\r\nSostendr\u00e9 lo que dir\u00e9\r\nNo cambiar\u00e9 al hacer.\r\nDios prometi\u00f3 y \u00c9l nos dio\r\n\u00c9l fiel por siempre es", 5747976207073280], ["Santificado Tu Nombre Es", "Varios", "Juan Carlos Alvarado", "2015/12/06", "Santo, Santo,\r\nT\u00fa eres digno,\r\nel cantarte es un honor.\r\n\r\nRey de gloria,\r\nDios Grandioso,\r\nTu nombre Santo es.\r\n\r\nLas Naciones,\r\ny el universo,\r\nfueron hechos por tu voz.\r\n\r\nEn la tierra,\r\nsea tu voluntad,\r\ncomo en el cielo es,\r\ncomo en el cielo es.\r\n\r\nSantificado,\r\ntu nombre es.\r\nSantificado es.\r\nSantificado,\r\ntu nombre es.\r\n\r\nSe\u00f1or y Majestad,\r\ndivina autoridad,\r\ntu nombre santo es.\r\n\r\n", 3090008], ["Gloria", "Marcos Witt", "Dios Es Bueno", "2015/12/13", "Al que en todo tiene\r\nel primer lugar.\r\nAl que es, el que era\r\ny que ser\u00e1.\r\n\r\nAl camino, la vida\r\ny la verdad,\r\nal pr\u00edncipe de paz.\r\n\r\nAl que sobre su trono ahora est\u00e1,\r\ny vestido en poder regresar\u00e1.\r\nAl motivo de nuestra libertad.\r\nAl que resucit\u00f3.\r\n\r\nGloria\r\nGloria\r\n\r\nLa plenitud de la vida\r\nhabita en \u00c9l.\r\nTodo existe por \u00c9l\r\ny para \u00c9l.\r\n\r\nNuestro salvador\r\nverdadero y fiel,\r\nincomparable es.\r\n\r\nAl sustento\r\nde todo lo que hay.\r\nPrimog\u00e9nito\r\nde toda creaci\u00f3n.\r\nA la imagen del invisible dios,\r\nal consolador.\r\n\r\nGloria,\r\ndamos gloria.\r\nToda autoridad,\r\ntoda majestad,\r\nsean al Rey.\r\n\r\nY por medio de Jes\u00fas,\r\nDios reconcili\u00f3\r\nconsigo al mundo.\r\n\r\nConstruyendo\r\nel camino hacia \u00c9l\r\ny la sangre de su cruz\r\nvino a ser la paz,\r\nque ahora se extiende\r\nentre el cielo y la humanidad.\r\n\r\n", 4040016], ["Poema de Salvaci\u00f3n", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2015/12/13", "Cristo moriste\r\nen una cruz,\r\nresucitaste con poder.\r\n\r\nPerdona mis pecados hoy,\r\nse mi Se\u00f1or y Salvador.\r\n\r\nC\u00e1mbiame y hazme otra vez\r\ny ay\u00fadame a serte fiel.", 5667039158992896], ["S\u00f3lo Cristo", "Hillsong United", "Otros", "2015/12/20", "Mi vida rindo a tus pies,\r\nte necesito s\u00f3lo a Ti.\r\nTe busco siempre\r\ny siempre est\u00e1s aqu\u00ed.\r\n\r\nEn problemas te busco a Ti,\r\npues eres todo para m\u00ed.\r\nMe rindo por completo\r\nhoy a Ti.\r\n\r\nS\u00f3lo Cristo,\r\neres la raz\u00f3n por la que vivo.\r\n\r\nEn todas partes T\u00fa est\u00e1s,\r\nen todo tiempo y lugar.\r\nTu gracia abunda\r\ntan profunda en m\u00ed.\r\n\r\nNunca, nunca cambiar\u00e1s,\r\nayer y hoy eres igual,\r\neternamente y siempre reinar\u00e1s.\r\n\r\nS\u00f3lo Cristo,\r\neres la raz\u00f3n por la que vivo.\r\n\r\nEres camino, vida y verdad\r\nvivo por f\u00e9 no por vista,\r\npor Ti, yo vivo para Ti.", 5100001], ["Tuya la Gloria Es ", "Marcos Witt", "Te Exaltamos", "2016/01/03", "Tuyo es el poder\r\nJes\u00fas, \r\ntuya la gloria es. \r\n\r\nTuyo es el dominio\r\nSe\u00f1or, \r\ntuya la gloria es. \r\n\r\nQue toda la tierra\r\nte alabe Se\u00f1or, \r\ntuya la gloria es. \r\n\r\nQue todos los pueblos\r\nproclamen tu honor, \r\ntuya la gloria es. \r\n\r\nDesde la eternidad, \r\nT\u00fa gobiernas con autoridad, \r\nnuestra voz se levantar\u00e1,\r\npara siempre proclamar.\r\n", 6236447401050112], ["Solo a Ti", "Marco Barrientos", "Venga tu Reino", "2016/01/03", "Poderoso,\r\nSanto Dios,\r\nreinas en majestad\r\nglorioso Rey.\r\n\r\nPoderoso,\r\nSanto Dios,\r\nreinas en majestad\r\nglorioso Rey.\r\n\r\nQuiero adorar,\r\nquiero adorarte.\r\nQuiero adorar,\r\nquiero adorarte.\r\n\r\nSolo a Ti Jes\u00fas,\r\nsolo a Ti mi Dios.\r\nSolo a Ti Jes\u00fas,\r\nsolo a Ti mi Dios.\r\n\r\nPoderoso,\r\nSanto Dios,\r\nreinas en majestad\r\nglorioso Rey.\r\n\r\nPoderoso,\r\nSanto Dios,\r\nreinas en majestad\r\nglorioso Rey.\r\n\r\nQuiero adorar,\r\nquiero adorarte.\r\nQuiero adorar,\r\nquiero adorarte.\r\n\r\nSolo a Ti Jes\u00fas,\r\nsolo a Ti mi Dios. \r\nSolo a Ti Jes\u00fas,\r\nsolo a Ti mi Dios.\r\n", 6252104570109952], ["Revoluci\u00f3n", "Hillsong United", "Unidos Permanecemos", "2016/01/17", "Generaci\u00f3n de salvaci\u00f3n, vamos. \r\nAvivamiento vamos a ver, \r\nnada nos podr\u00e1 parar. \r\nNos levantaremos para proclamar.\r\n\r\nQue Jes\u00fas es el Se\u00f1or,\r\ncomo \u00c9l no hay otro, vamos a gritar,\r\nque el mundo pueda ver.\r\n\r\nGeneraci\u00f3n de salvaci\u00f3n, vivo por Ti. \r\nAvivamiento vamos a ver, \r\nnada nos podr\u00e1 parar. \r\nNos levantaremos para proclamar.\r\n\r\nQue Jes\u00fas es el Se\u00f1or,\r\ncomo \u00c9l no hay otro, vamos a gritar,\r\nque el mundo pueda ver.\r\n\r\nEsta es la generaci\u00f3n, \r\nvivimos por tu nombre, oh Dios. \r\nEsta es la revoluci\u00f3n, \r\nel mundo vamos a cambiar. \r\n\r\n//Que el mundo pueda ver, \r\nque el mundo pueda ver,\r\nque vivimos por Ti con todo nuestro ser.// \r\nQue el mundo pueda ver, \r\nque el mundo pueda ver. \r\n\r\nQue Jes\u00fas es el Se\u00f1or,\r\ncomo \u00c9l no hay otro, vamos a gritar,\r\nque el mundo pueda ver.\r\n\r\n//Que el mundo pueda ver, \r\nque el mundo pueda ver, \r\nque el mundo pueda ver, \r\nesta es la revoluci\u00f3n.//", 5663998322147328], ["Exaltad Al Rey", "Marco Barrientos", "Mu\u00e9strame Tu Gloria", "2016/01/31", "Exaltad al Rey de Gloria,\r\nal que vive,\r\nreina y pronto volver\u00e1.\r\n\r\nToda lengua y todo pueblo,\r\na sus pies adorar\u00e1n.\r\n\r\nPoderoso en majestad,\r\nreinas sobre toda autoridad.\r\nCielo y tierra pasar\u00e1n,\r\nTu dominio es por la eternidad.\r\n\r\nToda lengua confesar\u00e1,\r\nJesucristo es el Se\u00f1or.\r\n\r\nAdmirable, consolador,\r\neres T\u00fa el gran Yo Soy.\r\n\r\nSobre todo gobernar\u00e1s,\r\ntodopoderoso Dios.\r\n\r\nGrande y fuerte, Hijo de Dios,\r\nJesucristo, el Vencedor.", 70009], ["Gloria, Reino y Poder", "Jes\u00fas Adri\u00e1n Romero", "Unplugged", "2016/01/31", "Toda riqueza y honor,\r\nfortaleza y loor,\r\nsean dadas al Cordero.\r\n\r\nSabidur\u00eda y poder,\r\nalabanzas traer,\r\nal que en todo es el primero.\r\n\r\nPues nos ha redimido\r\ncon su sangre,\r\nsomos su pueblo,\r\nsomos su naci\u00f3n.\r\n\r\nDe toda lengua y de todo linaje,\r\nnos ha escogido para Dios.\r\n\r\nGloria, reino y poder, \r\nsean para \u00c9l eternamente.\r\n\r\nGloria, reino y poder, \r\neternamente y para siempre.\r\n", 5070015], ["Digno De Honor", "Marco Barrientos", "Gozo En Tu Presencia", "2016/02/07", "Una alabanza,\r\nun clamor,\r\nla creaci\u00f3n\r\nalza su voz.\r\n\r\nEs como un ri\u00f3 de adoraci\u00f3n,\r\nque fluye de nuestro coraz\u00f3n.\r\n\r\nSanto,\r\neres Santo.\r\nTodopoderoso,\r\ndigno de honor.\r\n\r\nDigno, eres digno.\r\nTodos los pueblos cantan,\r\nque T\u00fa eres Se\u00f1or.\r\n", 8070008], ["Escucharte hablar", "Marcos Witt", "Enciende Una Luz", "2016/02/21", "Quiero escuchar\r\ntu dulce voz,\r\nrompiendo el silencio en mi ser .\r\n\r\nS\u00e9 que me har\u00eda estremecer \r\nme har\u00eda llorar o re\u00edr \r\ny caer\u00eda rendido ante Ti. \r\n\r\nY no podr\u00eda estar ante Ti \r\nescuch\u00e1ndote hablar \r\nsin llorar como un ni\u00f1o.\r\n\r\nY pasar\u00eda el tiempo as\u00ed \r\nsin querer nada m\u00e1s \r\nnada m\u00e1s que escucharte hablar.\r\n", 5704393160654848], ["\u00bfQui\u00e9n es como tu?", "Marco Barrientos", "Venga tu Reino", "2016/03/06", "Dios de los ej\u00e9rcitos,\r\npoderoso en batalla,\r\n\u00bfQui\u00e9n es como tu Se\u00f1or?,\r\nEl Gran Yo Soy.\r\n\r\nGrande y temible Rey,\r\ntu dominio no se acabar\u00e1.\r\nCon tu brazo de poder,\r\ngobernar\u00e1s.\r\n\r\nEres el Gran Yo Soy,\r\neres mi protector,\r\neres mi fuerza,\r\nmi escudo y mi salvaci\u00f3n.\r\n\r\nY yo no temer\u00e9, \r\nen Ti yo confiar\u00e9,\r\ny me levantar\u00e9,\r\ncon tu fuerza y poder.\r\n\r\nEres el Todopoderoso,\r\ntemible en batalla\r\ny tu justicia es para siempre,\r\npor todos los siglos.", 2260002], ["Agnus Dei", "Marco Barrientos", "Mu\u00e9strame Tu Gloria", "2016/03/20", "//Aleluya, aleluya,\r\nreinas, T\u00fa, poderoso Dios//\r\nAleluya\r\n\r\nSanto, Santo,\r\nel Se\u00f1or Dios, poderoso,\r\n//digno eres t\u00fa//\r\nAm\u00e9n", 6140011], ["Resucit\u00f3", "Marcos Witt", "Adoremos", "2016/03/27", "Algunos pensaron\r\nque todo hab\u00eda acabado,\r\na las redes a pescar,\r\nel cuerpo del maestro \r\nen una cueva fue a parar.\r\n\r\nUn monte y tres cruces,\r\nde testigos quedaron,\r\nlas mujeres con sus l\u00e1grimas\r\nla tierra enjugaron.\r\n\r\nTres d\u00edas pasaron\r\ny mujeres llegaron\r\npara ungir a su Se\u00f1or,\r\nla piedra movida,\r\nla tumba vac\u00eda\r\ny un \u00e1ngel descendi\u00f3.\r\n\r\nLes dijo ya no teman,\r\ns\u00e9 que quieren ver a Jes\u00fas\r\n\u00bfPor qu\u00e9, por qu\u00e9\r\nbusc\u00e1is en los muertos \r\na qui\u00e9n vive hoy?\r\n\r\n//Resucit\u00f3, resucit\u00f3,\r\nNo est\u00e1 en una cruz clavado\r\nni en una tumba sepultado//\r\n\r\n\u00c9l ha vencido a la muerte\r\nel maestro vive hoy, vive hoy.\r\n\r\nLos once amigos estaban reunidos\r\nsin saber que hacer,\r\nera conocida la palabra o\u00edda,\r\nde que Cristo iba volver.\r\n\r\nSin embargo no entendieron\r\nla promesa se olvid\u00f3,\r\nla palabra no era carne \r\nen su coraz\u00f3n\r\n\r\nHablando de todas las cosas pasadas\r\nles llegaron a proclamar\r\nel Rey est\u00e1 vivo \u00bfcomo es posible?\r\nllenos de incredulidad\r\n\r\nJes\u00fas lleg\u00f3 donde ellos,\r\ndiciendo mi paz os doy,\r\nmirad mis manos mirad mis pies \r\nyo mismo soy.", 5683127032741888], ["Como B\u00fafalo", "Jes\u00fas Adri\u00e1n Romero", "Cerca De Ti", "2016/04/03", "    Nada ni nadie me podr\u00e1 vencer\r\n    Estoy seguro prevalecer\u00e9\r\n    Porque la fortaleza y salvaci\u00f3n \r\n    Est\u00e1n en el Se\u00f1or.\r\n\r\n    Yo s\u00f3lo tengo que confiar en \u00e9l\r\n    Y descansar en su promesa fiel\r\n    De que \u00e9l aumentar\u00e1 mis fuerzas \r\n    Como b\u00fafalo.\r\n\r\n    Mi fortaleza eres T\u00fa cuando camino \r\n    aqu\u00ed en la lucha en la guerra siempre est\u00e1s aqu\u00ed\r\n    Y aunque el diablo no quiera eso entender \r\n    tendr\u00e9 que repetirlo una y otra vez.\r\n\r\n    Camina siempre de su mano \r\n    el te dio la libertad \r\n    en el cielo, en la tierra \r\n    el te dio la potestad \r\n\r\n    \u00c9l te ci\u00f1e de poder \r\n    y te abraza con su amor \r\n    tu enemigo fue vencido \r\n    no tengas ya m\u00e1s temor \r\n\r\n    Oye esta promesa \r\n    no la dejes ir \r\n    llevalo en tu mano \r\n    y en tu diario vivir \r\n    escucha lo que te digo \r\n    tu fortaleza es \u00c9l \r\n    vive como bufalo confiado en \u00c9l \r\n\r\n    Camina siempre de su mano \r\n    \u00c9l te dio la libertad \r\n    en el cielo, en la tierra \r\n    \u00c9l te dio la potestad \r\n\r\n    \u00c9l te ci\u00f1e de poder \r\n    y te abraza con su amor \r\n    tu enemigo fue vencido \r\n    no tengas ya m\u00e1s temor\r\n    Como b\u00fafalo, como b\u00fafalo\r\n    Arrollar\u00e9 al enemigo\r\n    Si se enfrenta conmigo\r\n    Tengo fuerzas del Se\u00f1or.\r\n\r\n    Como b\u00fafalo, como b\u00fafalo\r\n    Estar\u00e9 siempre confiado\r\n    No ser\u00e9 avergonzado\r\n    Tengo fuerzas del Se\u00f1or\r\n    Como b\u00fafalo.", 2090014], ["Te Dar\u00e9 Lo Mejor", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2016/04/17", "Traemos hoy ante tu altar\r\nnuestras coronas.\r\nQueremos darte lo mejor\r\nde nuestras vidas.\r\n\r\nTe entregar\u00e9 m\u00ed amor entero\r\nlos sue\u00f1os que logre alcanzar.\r\n\r\nTe dar\u00e9 lo mejor de mi vida,\r\nte dar\u00e9 lo mejor cada d\u00eda.\r\nSer\u00e1 mucho m\u00e1s que una canci\u00f3n,\r\nmi obediencia es mi mejor adoraci\u00f3n.\r\n\r\nDaremos solo las primicias\r\npues T\u00fa mereces lo mejor.\r\n\r\n/// Te dar\u00e9 lo mejor de m\u00ed /// \r\nTe   dar\u00e9 lo mejor.", 7030006], ["S\u00f3lo T\u00fa", "Coalo Zamorano", "Cosas Poderosas", "2016/05/01", "Solo T\u00fa,  solo T\u00fa \r\npara m\u00ed, eres todo mi Jes\u00fas, \r\nsolo T\u00fa, solo T\u00fa,\r\npara m\u00ed, eres todo Dios. \r\n\r\nMi vida, y mi prioridad,\r\n\u00bfQui\u00e9n se compara a Ti?, \r\ngrande es tu gloria,\r\nmajestuoso Rey. \r\nMi Dios, mi paz, \r\nsiempre ser\u00e1s, solo T\u00fa. ", 7150013], ["Dulce Jes\u00fas", "Marco Barrientos", "Gozo En Tu Presencia", "2016/05/01", "Como te puedo ocultar\r\nsi tu presencia en m\u00ed\r\nme hace brincar,\r\nme hace re\u00edr,\r\nme hace so\u00f1ar,\r\ntu presencia en m\u00ed.\r\n\r\nComo te puedo negar\r\nsi tu presencia vino a\r\ntransformar,\r\nen gozo el llanto y me llen\u00f3\r\ntu presencia en m\u00ed.\r\n\r\nEs en tu presencia\r\ndonde encuentro\r\nfortaleza y consuelo,\r\npaz en mi desierto.\r\n\r\nSiempre T\u00fa a mi lado\r\ncuando m\u00e1s desesperado estaba,\r\ntu presencia me alcanzaba,\r\nJes\u00fas, Dulce Jes\u00fas.", 5088548537499648], ["Santo, Santo, Santo", "Marcos Witt", "\u00a1Alabadle!", "2016/05/15", "Santo,Santo,Santo\r\nSe\u00f1or omnipotente\r\nSimpre el labio m\u00edo\r\nloores te dar\u00e1\r\n\r\nSanto,Santo,Santo\r\nTe adoro reverente\r\nDios en tres personas\r\nBendita Trinidad\r\n\r\nSanto,Santo,Santo\r\nLa gloria de tu nombre vemos en tus obras\r\nen cielo,tierra y mar\r\n\r\nSanto,Santo,Santo\r\nte adoro todo hombre\r\nDios en tres personas Bendita Trinidad", 5082529006616576], ["M\u00e1s el Dios de toda Gracia", "Marcos Witt", "\u00a1Alabadle!", "2016/05/15", "M\u00e1s el Dios\r\nde toda gracia \r\nque nos llam\u00f3\r\na su Gloria eterna,\r\nos perfeccione y afirme,\r\nfortalezca y establezca. \r\n\r\nA \u00c9l sea la Gloria,\r\na \u00c9l sea el imperio, \r\npor los siglos\r\nde los siglos,\r\nAm\u00e9n.\r\n\r\n!Am\u00e9n, am\u00e9n, am\u00e9n, am\u00e9n!", 5169960582119424], ["Tuyo Es El Reino", "Marcos Witt", "Te Exaltamos", "2016/06/05", "Tuyo es el reino,\r\ntuyo el poder.\r\nTuya la gloria,\r\nahora y siempre.\r\n\r\nTuyo es el reino,\r\ntuyo el poder.\r\nTuya la gloria,\r\npor siempre am\u00e9n.\r\n\r\nY nunca terminar\u00e1\r\nla grandeza de su reino.\r\nY la paz ser\u00e1,\r\nya nunca se acabar\u00e1.\r\n\r\nY todo el poder\r\ncaer\u00e1 sobre sus hombros.\r\nY nunca terminar\u00e1,\r\ny nunca terminar\u00e1.\r\nPor siempre ser\u00e1\r\nla grandeza de su reino.\r\n\r\n// Tuyo es el reino //\r\n\r\nTuyo es el reino, tuyo el poder.\r\nTuya la gloria, por siempre am\u00e9n.", 6280001], ["Mi D\u00eda", "Jes\u00fas Adri\u00e1n Romero", "Ayer Te Vi...Fue M\u00e1s Claro Que La Luna", "2016/06/12", "Un nuevo d\u00eda empez\u00f3\r\ny T\u00fa a mi lado est\u00e1s,\r\nadonde iremos hoy\r\nque me platicar\u00e1s.\r\n\r\nAyer se fue veloz\r\ny no hay ma\u00f1ana a\u00fan,\r\nte entrego mi atenci\u00f3n\r\nsolo me importas T\u00fa.\r\n\r\nQuiero darte \r\nmi d\u00eda,\r\nque mi vivir\r\nsea una melod\u00eda\r\npara Ti.\r\n\r\nQuiero ser \r\ntu alegr\u00eda\r\ny caminar juntos todo el d\u00eda \r\ny re\u00edr.\r\n\r\nTe doy mi devoci\u00f3n\r\nmis horas bajo el sol,\r\nno hay planes para hoy\r\nmi agenda se perdi\u00f3.\r\n\r\nMis pasos seguir\u00e1n \r\ntus pasos al andar.\r\nDeleite me dar\u00e1\r\nhacer tu voluntad.\r\n\r\nQuiero darte \r\nmi d\u00eda,\r\nque mi vivir\r\nsea una melod\u00eda\r\npara Ti.\r\n\r\nQuiero ser \r\ntu alegr\u00eda\r\ny caminar juntos todo el d\u00eda \r\ny re\u00edr.\r\n\r\nUn nuevo d\u00eda empez\u00f3\r\ny tu a mi lado est\u00e1s.\r\n ", 1050016], ["Tan S\u00f3lo He Venido", "Varios", "Juan Luis Guerra", "2016/06/18", "No he venido a pedirte \r\ncomo suelo, Se\u00f1or,\r\nsi antes de yo clamarte \r\nconoces mi petici\u00f3n.\r\n\r\nSolo quiero escucharte, \r\npon el tema, Se\u00f1or,\r\ncaminar por el parque \r\ny dedicarte una canci\u00f3n.\r\n\r\nTan solo he venido \r\na estar contigo, \r\na ser tu amigo, \r\na compartir con mi Dios.\r\n\r\nA adorarte y darte gracias, \r\npor siempre gracias \r\npor lo que has hecho, Se\u00f1or, \r\nconmigo.\r\n\r\nCu\u00e9ntame de tus obras \r\n\u00bfQu\u00e9 hay de nuevo, Se\u00f1or? \r\nY de paso pregunto \r\n\u00bfC\u00f3mo es la piel del sol? \r\n\r\nY yo solo quiero abrazarte \r\nbendecirte, mi Dios, \r\ncaminar por las calles \r\ny abrirte mi coraz\u00f3n.\r\n", 2090015], ["Mira Lo Que Hizo Dios", "Varios", "Es Hora De Adorarle", "2016/06/19", "Mira lo que hizo Dios,\r\nmira lo que hizo Dios.\r\n\r\nSan\u00f3 mi cuerpo,\r\ntoc\u00f3 mi mente,\r\nme salv\u00f3,\r\njusto a tiempo\r\n\r\ny yo le alabar\u00e9\r\nes \u00e9l mismo de ayer,\r\nle alabaremos\r\nmira lo que hizo Dios. ", 5100018], ["Victoria", "Varios", "Es Hora De Adorarle", "2016/06/19", "\r\nVictoria, la victoria m\u00eda es\r\nvictoria, la victoria m\u00eda es\r\ny si mantengo mi paz\r\n\u00e9l pelea la batalla,\r\nvictoria, la victoria m\u00eda es.\r\n\r\nPodemos subir all\u00e1 y tomar la tierra\r\nposeer de la monta\u00f1a hasta el mar\r\ny aunque esta tierra sea de gigantes\r\nnuestro Dios la victoria nos dar\u00e1.\r\n\r\nSol detente en Gaba\u00f3n\r\ny t\u00fa luna en Ajal\u00f3n,\r\nel sol se par\u00f3 cuando Josu\u00e9 or\u00f3\r\nporque Josu\u00e9 obedeci\u00f3.\r\n\r\nY si mantengo mi paz\r\nEl pelea la batalla\r\nvictoria, la victoria m\u00eda es.", 8060012], ["Directo Al Coraz\u00f3n", "Danilo Montero", "S\u00edgueme", "2016/07/24", "Fue as\u00ed como ver llover\r\nen un desierto.\r\nIgual al esclavo que\r\nhallo por fin su libertad.\r\n\r\nMe sorprend\u00ed\r\nal ver que T\u00fa llegaste a m\u00ed.\r\n\r\nDirecto al coraz\u00f3n\r\nal \u00faltimo rinc\u00f3n.\r\nEntraste con T\u00fa Amor.\r\n\r\nDirecto al coraz\u00f3n\r\nte hiciste mi pasi\u00f3n.\r\nLlenaste todo en m\u00ed.\r\n\r\nAs\u00ed como un ciego que\r\nla luz descubre.\r\nAs\u00ed como un ave que\r\nhallo sus alas y volo.\r\n\r\nMe sorprend\u00ed,\r\nal ver que T\u00fa llegaste a M\u00ed.\r\n\r\nEres mi fe, mi bendici\u00f3n,\r\nde Ti me enamore.\r\nEres mi Amor, eres mi luz\r\nde Ti me enamore.\r\n\r\nEres mi Dios, mi inspiraci\u00f3n\r\ny mi canci\u00f3n.", 3100013], ["Libertad", "Jes\u00fas Adri\u00e1n Romero", "Con Manos Vac\u00edas", "2016/07/24", "Me has dado libertad\r\nSal\u00ed de mi prisi\u00f3n\r\nTu gran poder en m\u00ed rompi\u00f3\r\nLas cadenas de mi gran opresi\u00f3n\r\n\r\nMe has dedo salvaci\u00f3n\r\nCautivo ya no soy\r\nNo vivo mas condenaci\u00f3n\r\nHe sido libre por tu gran amor\r\n\r\nLibertad T\u00fa me has dado\r\nLibertad de mis cadenas\r\nLibertad no soy esclavo\r\nSoy tan libre puedo casi volar\r\n\r\nLibre soy en Jes\u00fas\r\nLibre soy por su cruz\r\nHe visto en la luz\r\nPor qu\u00e9 no vienes t\u00fa", 6120012], ["Cantamos Al Rey", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2016/07/31", "Hoy te damos nuestra adoraci\u00f3n.\r\nDemostramos nuestra gratitud.\r\nCon alegr\u00eda en el coraz\u00f3n      \r\nte cantamos a Ti.\r\n\r\nTe entregamos hoy nuestro\r\namor con melod\u00edas de celebraci\u00f3n.\r\nCada respiro expresa libertad     \r\npara cantarte a Ti.\r\n\r\nCantamos al Rey,\r\ncantamos al Rey\r\nporque digno eres T\u00fa\r\nde recibir la gloria\r\ntoda la alabanza y honor oh Dios.\r\n\r\nCantamos al Rey, \r\ncantamos al Rey\r\nno hay nada que se compare    \r\na tu grandeza\r\ny a tu gran realeza, Jes\u00fas.\r\n\r\n", 8080013], ["Es Tiempo", "Hillsong United", "Unidos Permanecemos", "2016/08/02", "Amor inexplicable,\r\ntu vida diste en la cruz,\r\ntuyo soy por siempre.\r\n\r\nEn tu misericordia,\r\nme diste vida, diste amor,\r\nTu gran amor.\r\n\r\nEs tiempo de decidir por quien vivo", 7160007], ["Bueno Es Dios", "Varios", "Don Moen", "2016/08/14", "Bueno es Dios,\r\nsiempre fiel,\r\npuso un canto nuevo\r\nen mi coraz\u00f3n.\r\n\r\nBueno es Dios,\r\nsiempre fiel,\r\nen la oscuridad\r\nbrillar\u00e1 su amor.\r\nBueno es Dios, bueno es Dios,\r\nsiempre fiel.\r\n\r\nSi tu vas por el valle\r\ny hay sobras alrededor,\r\ndi adi\u00f3s al temor\r\npues seguro en \u00c9l est\u00e1s.\r\n\r\nPrometi\u00f3 nunca dejarte,\r\nni abandonarte\r\ny \u00c9l no mentir\u00e1.\r\n\r\nY a\u00fan sin merecerlo\r\nsu sangre derram\u00f3 por m\u00ed.\r\nMe llen\u00f3 de su presencia \r\ny ahora puedo compartir,\r\nque su amor nunca termina.\r\nY su favor siempre me dar\u00e1.\r\n\r\nYo puedo entender\r\ntus planes para m\u00ed.\r\nMi due\u00f1o eres T\u00fa\r\ny por la fe veo claramente que.", 2090012], ["Cantar\u00e9 De Tu Amor", "Danilo Montero", "Cantar\u00e9 De Tu Amor", "2016/08/28", "Por mucho tiempo busqu\u00e9\r\nuna raz\u00f3n de vivir,\r\nen medio de mil preguntas\r\ntu amor me respondi\u00f3.\r\n\r\nAhora veo la luz\r\ny ya no tengo temor,\r\ntu reino vino a mi vida\r\ny ahora vivo para Ti.\r\n\r\nCantar\u00e9 de tu amor\r\nrendir\u00e9 mi coraz\u00f3n ante Ti.\r\nT\u00fa ser\u00e1s mi pasi\u00f3n\r\ny mis pasos se guiar\u00e1n por tu voz.\r\n\r\nMi Jes\u00fas y mi Rey,\r\nde tu gran amor cantar\u00e9.", 2220002], ["\u00c9l Es El Rey", "Danilo Montero", "Eres Todopoderoso", "2016/08/28", "\u00c9l es el rey infinito en poder,\r\n\u00c9l es el rey de los cielos.\r\n\r\nSer\u00e9 para \u00e9l siervo fiel,\r\npues mi vida\r\ncompr\u00f3 con su amor.\r\n\r\n\u00c9l es el rey lo confiesa mi ser,\r\n\u00c9l es el rey de los siglos.\r\nMi vida la rindo a sus pies,\r\n\u00c9l es rey sobre mi coraz\u00f3n.\r\n\r\n\u00c9l es el rey,\r\n\u00e9l es el rey, \u00e9l es el rey de mi vida.\r\n\r\n\u00c9l es el rey,\r\n\u00e9l es el rey reina con autoridad.\r\n\r\nSu reino eterno es,\r\nsu trono el cielo es.\r\n\u00c9l es el rey\r\nque viene a su pueblo a llevar.", 6130009], ["Cree Todo Es Posible", "Marco Barrientos", "Cree Todo Es Posible", "2016/09/04", "Cree, todo es posible\r\nsi puedes creer,\r\ncree, todo es posible\r\npon tu fe en \u00c9l.\r\n\r\nCree, todo es posible\r\nsi puedes creer,\r\ncree, todo es posible.\r\n\r\nNunca falla\r\nnunca te dejar\u00e1.\r\nNunca cambia\r\na tu lado estar\u00e1.\r\n\r\nNunca falla\r\nnunca te olvidar\u00e1.\r\nMi Dios es fiel.\r\n\r\nCreo en tu amor ,\r\ncreo en tu perd\u00f3n,\r\ncreo en el poder \r\nde tu cruz Jes\u00fas.\r\nMi salvador mi sanador\r\nCreo en ti", 7140009], [" Mi Roca ", "Hillsong United", "Mi Roca", "2016/09/04", "Mi esperanza est\u00e1 en Jes\u00fas\r\nen su justicia y en la cruz\r\nde nadie m\u00e1s depender\u00e9.\r\n\r\nSolo en su nombre confiar\u00e9.\r\n\r\nEn Jes\u00fas fuerte soy\r\nsolo \u00e9l mi roca es,\r\nsobre la tempestad\r\n\u00e9l es Rey.\r\n\r\nCuando no puedo ver su faz\r\ns\u00e9 que su gracia es siempre igual,\r\na la tormenta vencer\u00e9,\r\nmi ancla firme est\u00e1 en \u00e9l,\r\nmi ancla firme est\u00e1 en \u00e9l.\r\n\r\nEn Jes\u00fas fuerte soy\r\nsolo \u00e9l mi roca es,\r\nsobre la tempestad\r\n\u00e9l es Rey.\r\n\r\nSolo \u00e9l ...\r\n\r\nUn d\u00eda \u00e9l regresar\u00e1 \r\nen su presencia voy a estar\r\nsin mancha ante \u00e9l vendr\u00e9\r\njustificado por la fe.", 5764577597849600], ["Yo Conf\u00edo", "Danilo Montero", "S\u00edgueme", "2016/09/11", "He aprendido a verte en los detalles,\r\ny en cada milagro que T\u00fa haces.\r\nTu facilidad con lo imposible,\r\nha erradicado mi temor.\r\n\r\nYo conf\u00edo solo en ti Jes\u00fas,\r\nmi esperanza eres T\u00fa.\r\nHoy descanso en tu fidelidad,\r\ny no habr\u00e1 nadie que separe nuestro amor.\r\n\r\nDesde el principio demostraste,\r\nque a los tuyos nunca abandonaste.\r\nY en tu palabra nos dejaste,\r\nlas promesas que no fallar\u00e1n.\r\n\r\nJes\u00fas, Jes\u00fas, nombre sobre todo nombre.\r\n", 1070007], ["Aqu\u00ed Estoy", "Jes\u00fas Adri\u00e1n Romero", "El Aire De Tu Casa", "2016/09/18", "No quiero perder,\r\nlas cosas que me quedan por hacer,\r\nlas cosas que me quedan por vivir en Ti.\r\n\r\nNo quiero olvidar,\r\nlas cosas que planeaste para m\u00ed,\r\nlos sue\u00f1os que me diste lograr\u00e9 por Ti.\r\n\r\nNo tienes que buscar a nadie m\u00e1s  \r\nyo quiero ir,\r\naqu\u00ed est\u00e1 mi tiempo,\r\naqu\u00ed est\u00e1n mis horas,\r\naqu\u00ed estoy yo.\r\n\r\nMi vida es para ti,\r\nen ti la quiero yo invertir,\r\naqu\u00ed est\u00e1n mis manos,\r\naqu\u00ed est\u00e1 mi voz\r\naqu\u00ed estoy yo.\r\n\r\nListo quiero estar,\r\nlos dones que me diste voy a usar,\r\nlos a\u00f1os que me has dado vivir\u00e9,\r\npor Ti.\r\n\r\nVoy a conquistar\r\nla tierra que me diste sin dudar\r\nhar\u00e9 lo que me pidas, vivir\u00e9 por Ti.", 5100013], ["Free", "Hillsong", "Hope", "2016/09/18", "Me creer\u00edas si digo,\r\nque t\u00fa y yo podemos\r\nel mundo cambiar, \r\nsi vivimos por \u00c9l.\r\n\r\nMe creer\u00edas si digo,\r\nque todos tus sue\u00f1os\r\nse pueden cumplir en \u00c9l.\r\n\r\nMe creer\u00edas si digo,\r\nque puedes vivir una vida feliz en \u00c9l.\r\n\r\nContigo puedo volar\r\nsobre la tempestad\r\ny aunque el mundo se derrumbe,\r\nse qu\u00e9 conmigo est\u00e1s.\r\n\r\nPorque creo s\u00f3lo en Ti\r\neres todo para m\u00ed.\r\nCristo, por ti yo soy, \u00a1Libre!\r\n\r\nMe creer\u00edas si digo,\r\nque Dios puede\r\nhacer un milagro por Ti.\r\n\r\nMe creer\u00edas si digo,\r\nque no hay porque\r\ndarle lugar al temor, \r\nsi caminas por fe.\r\n\r\nMe creer\u00edas si digo,\r\nque todo es posible si puedes creer en \u00c9l.\r\n\r\nAtr\u00e9vete a vivir con Dios\r\ny nunca te arrepentir\u00e1s.\r\nDale tu coraz\u00f3n a Dios\r\nA Dios.", 6100007], ["Cada D\u00eda", "Jes\u00fas Adri\u00e1n Romero", "El Aire De Tu Casa", "2016/09/25", "Mi coraz\u00f3n confiado est\u00e1\r\npor que yo te conozco.\r\nY en medio de la tempestad \r\nnunca estoy sola.\r\n\r\nY puedo tu silueta ver \r\nen medio de la niebla,\r\nTu gracia es suficiente en m\u00ed\r\nsi el mundo tiembla.\r\n\r\nCada d\u00eda \r\ndespierto y tu misericordia\r\nest\u00e1 conmigo,\r\npuedo descansar \r\nT\u00fa eres el mismo.\r\n\r\nCada d\u00eda \r\nme ense\u00f1as a confiar en ti \r\ncon tu palabra.\r\nMi fe se aumenta \r\nm\u00e1s cada ma\u00f1ana.\r\nCada d\u00eda.", 2110013], ["Creo En Jesucristo", "Hillsong Kids", "Super Strong God", "2016/10/16", "Puede que suene muy loco,\r\nel creer en lo que no ves.\r\nPuede que suene muy loco,\r\nque mi Dios es mi amigo.\r\n\r\nPuede que suene muy loco,\r\nque un Rey su vida me dio.\r\nPuede que suene muy loco,\r\npero es m\u00e1s extra\u00f1o.\r\n\r\nVas a ver muchas cosas por fe.\r\n//Salta y grita//\r\nNo importa lo que digan.\r\n//Salta y grita//\r\n\r\nVoy a gritarlo ya,\r\ncreo en Jesucristo .", 5644309118320640], ["\u00bfQui\u00e9n Como El Se\u00f1or?", "Coalo Zamorano", "Cosas Poderosas", "2016/10/23", "\u00bfQui\u00e9n como el Se\u00f1or?\r\nNo hay nadie\r\n\u00bfQui\u00e9n como el Se\u00f1or?\r\nNo no no no no hay nadie\r\n\r\nSi Dios es por nosotros\r\n\u00bfQui\u00e9n contra nosotros?\r\n\u00c9l cumple sus promesas.\r\nNo hay nadie como \u00c9l\r\n\r\n\u00bfQu\u00e9 hay que nos separe\r\ndel amor de Cristo?\r\n\u00c9l cumple sus promesas\r\nNo hay nadie como \u00c9l\r\nNadie como \u00c9l\r\nNo....\r\n\r\nNo hay nadie\r\nen todo el mundo igual\r\n\r\n\u00bfQui\u00e9n lo comparar\u00e1?\r\n\u00bfQui\u00e9n lo har\u00e1?\r\n\u00bfQui\u00e9n se atrever\u00e1?\r\nPues como \u00c9l no hay nadie\r\n\r\n\u00bfQui\u00e9n como el Se\u00f1or?", 2080001], ["Qui\u00e9n Como T\u00fa", "Varios", "Homenaje A Jes\u00fas", "2016/10/23", "\u00bfQui\u00e9n como T\u00fa Jes\u00fas\r\nque me enamore?\r\n\u00bfQui\u00e9n como T\u00fa Se\u00f1or\r\nque me transforme?\r\nAmor eterno y completo\r\nT\u00fa siempre me das.\r\n\r\n\u00bfQui\u00e9n como T\u00fa Jes\u00fas\r\nque me perdone?\r\n\u00bfQui\u00e9n como T\u00fa Se\u00f1or\r\nque me renueve?\r\nPalabras de Vida Eterna\r\nsiempre me hablar\u00e1s.\r\n\r\nEres mi gu\u00eda,\r\nT\u00fa eres mi vida,\r\neres mi amor,\r\nmi pasi\u00f3n, mi alegr\u00eda.\r\n\r\nEres mi due\u00f1o,\r\nmi Padre Eterno,\r\ntodo mi amor y mi ser\r\nte ofrezco Jes\u00fas.", 7120007], ["Inmenso Amor", "Varios", "Aline Barros", "2016/11/06", "Soy perdonado,\r\npor que fuiste rechazado. \r\nSoy aceptado y tu condenado.\r\n\r\nTodo por tu amor,\r\nal morir en el madero \r\npor que lo diste todo por m\u00ed.\r\n\r\nInmenso amor por m\u00ed de ti,\r\nt\u00fa mi rey moriste por m\u00ed.\r\nInmenso amor s\u00e9 que es verdad \r\nfuiste se\u00f1or por mi a la cruz \r\ny estoy aqu\u00ed por ti Jes\u00fas. \r\n\r\nCristo t\u00fa eres mi rey.", 3080008], ["Bienaventurado", "Jes\u00fas Adri\u00e1n Romero", "Unplugged", "2016/11/06", "Cuando te quieran llevar por el camino del mal,\r\nno convengas, no, no, no.\r\nSus argumentos tendr\u00e1n para quererte desviar\r\nmas no cedas.\r\n\r\nBienaventurado como \u00e1rbol plantado ser\u00e1s,\r\ncuando te quieran llevar por el camino del mal,\r\nno convengas no, no, no.\r\nSus argumentos tendr\u00e1n para quererte desviar\r\nmas no cedas.\r\n\r\nBienaventurado, como \u00e1rbol plantado ser\u00e1s\r\nvivir\u00e1s como \u00e1rbol junto al agua,\r\nque da su fruto a tiempo y su hoja no cae.\r\n\r\nCrecer\u00e1s plantado en la presencia de Dios\r\ny todo lo que emprendas prosperar\u00e1,\r\nfructificar\u00e1\r\ny tu deleite hallaras en su palabra de amor.\r\n\r\nMeditando sus mandamientos,\r\nser\u00e1 en tu camino una luz alumbrando,\r\nbienaventurado como \u00e1rbol plantado seras.\r\n\r\nVivir\u00e1s como \u00e1rbol junto al agua\r\nQue da su fruto a tiempo y su hoja no cae.\r\nCrecer\u00e1s plantado en la presencia de Dios\r\ny todo lo que emprendas\r\nfructificar\u00e1.", 4040015], ["Lev\u00e1ntate Y S\u00e1lvame", "Marcos Witt", "Sana Nuestra Tierra", "2016/11/06", "Aunque un ej\u00e9rcito\r\nacampe contra m\u00ed no temer\u00e9.\r\nAunque haya guerra hoy\r\nalrededor de m\u00ed, en ti confiar\u00e9.\r\n\r\nNo temer\u00e9 a diez mil gentes\r\nque hagan sitio contra m\u00ed.\r\nAunque la Tierra se estremezca\r\nmi salvaci\u00f3n est\u00e1 en ti.\r\n\r\n//Porque t\u00fa eres mi escudo,\r\nt\u00fa mi fortaleza,\r\nt\u00fa eres mi gloria,\r\nquien levanta mi cabeza//\r\n\r\nAunque afligido est\u00e9,\r\nt\u00fa pensar\u00e1s en m\u00ed, no temer\u00e9.\r\nAunque mi coraz\u00f3n,\r\nestremecido est\u00e9, en ti confiar\u00e9.\r\n\r\nNo temer\u00e9 a ning\u00fan hombre\r\nque se junte contra m\u00ed.\r\nT\u00fa eres mi Dios mi fortaleza\r\nmi salvaci\u00f3n est\u00e1 en ti.\r\n\r\n///Con tu poder\r\nme salvaste\r\nCon tu poder\r\nme sanaste///", 7140010], ["Celebrar\u00e9 Tu Amor", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2016/11/06", "Incomparable,\r\ninigualable es tu amor \r\ny me rodea.\r\n\r\nT\u00fa me abrazaste,\r\nme sonre\u00edste se\u00f1or,\r\nen mi pecado.\r\n\r\nTu amor me alimenta,\r\ntu amor me sustenta.\r\n\r\nCelebrar\u00e9 tu amor todos los d\u00edas,\r\ncelebrar\u00e9 tu gran misericordia,\r\ncelebrar\u00e9 tu gracia inmerecida, \r\ncelebrar\u00e9 tu amor.\r\n\r\nInmensurable,\r\ninagotable es tu amor\r\ny nunca cambia.\r\n\r\nEst\u00e1s conmigo,\r\ny no me puedo escapar,\r\naunque lo intente.\r\n\r\nTu amor es eterno, \r\ntu amor es perfecto.\r\n\r\nCelebrar\u00e9 tu amor \r\ny tu misericordia,\r\noh Dios oh oh.", 5702797177651200], ["Perdonados", "Varios", "Homenaje A Jes\u00fas", "2016/11/13", "No olvidaremos,\r\nanunciaremos \r\nlas maravillas \r\nque has hecho en nuestras vidas.\r\n\r\nProclamaremos a las naciones, \r\ndeclararemos tu soberano amor.\r\n\r\nPerdonados de todo mal,\r\njustificados nos diste de tu paz.\r\nPerdonados no hay m\u00e1s condenaci\u00f3n \r\nJesucristo t\u00fa nos diste salvaci\u00f3n.\r\n\r\nRecordaremos, \r\npublicaremos \r\nlas misericordias\r\nque hiciste en nuestras vidas.\r\n\r\nLo cantaremos a las multitudes,\r\nles gritaremos que no hay otro como t\u00fa.", 70011], ["Mi Libertador", "Varios", "Daniel Calveti", "2016/11/13", "Cantamos con gozo a ti,\r\nDios de mi justicia.\r\nEn la aflicci\u00f3n a ti clamo,\r\ny con nueva canci\u00f3n llenas mi vida.\r\n\r\nGrande eres tu se\u00f1or,\r\ny tu misericordia es para siempre.\r\n\r\nEres mi libertador,\r\nescudo y protecci\u00f3n.\r\nEres la torre de mi salvaci\u00f3n,\r\nme libras de mi aflicci\u00f3n.\r\n\r\nEres mi sust\u00e9ntador, \r\nseguro camino hoy.\r\nEres mi padre lleno de amor,\r\nen ti no tengo temor.\r\n\r\nAleluya, aleluya.", 3080002], ["Demos Gracias", "Varios", "Lakewood", "2016/11/20", "Al creador de la tierra y el mar,\r\nal infinito sobrenatural\r\ny su perd\u00f3n es para siempre.\r\n\r\nAl que gobierna con autoridad,\r\ncon brazo fuerte, justicia y verdad\r\ny nos ha dado la libertad.\r\n\r\nGracias sean a Dios,\r\ngracias sean al rey,\r\nporque \u00e9l es bueno,\r\ndemos gracias al rey.\r\n\r\nIncomparable, incalculable\r\nes el amor de Dios,\r\ntodas sus bondades\r\nsiempre nos rodear\u00e1n.\r\n", 7170009], ["Te Dar\u00e9 Alabanza Y Honor", "Varios", "El Volver\u00e1", "2016/11/27", "Tu sangre me redimi\u00f3 \r\npara darme la luz y la paz,\r\ntu vida se derram\u00f3\r\npor mi maldad se entreg\u00f3.\r\n\r\nTu amor incondicional\r\nme abraz\u00f3 con dolor y pasi\u00f3n,\r\nmi vida te ofrecer\u00e9,\r\nmi canto levantar\u00e9.\r\n\r\nAlabanza y honor, poder y gloria\r\nal Cordero de Dios al Le\u00f3n de Jud\u00e1,\r\nal \u00fanico digno de honra,\r\nJesucristo mi rey y se\u00f1or.\r\n\r\nAnciano de d\u00edas, te quiero exaltar,\r\npor siempre, te quiero adorar.", 4050018], ["Libre Soy", "Varios", "Clamemos A Jes\u00fas", "2016/11/27", "Tengo un coraz\u00f3n\r\nnuevo por Jes\u00fas,\r\ntengo alegr\u00eda\r\nque no cambiar\u00eda.\r\n\r\nMe quit\u00f3 el dolor,\r\nsoy libre por su amor,\r\ntengo la gracia\r\nque no merec\u00eda.\r\n\r\nMe sac\u00f3 de mi prisi\u00f3n,\r\nmis cadenas \u00e9l rompi\u00f3\r\ny las cosas han quedado atr\u00e1s.\r\n\r\nMe ha hecho libre\r\npor amor y compasi\u00f3n,\r\nel juicio ya fue pagado\r\npor su amor.\r\n\r\nLas cadenas que me ataban\r\n\u00e9l rompi\u00f3.\r\nLibre soy, libre soy.\r\n\r\nHe sido justificado,\r\nsu sangre me ha lavado,\r\nhe sido justificado\r\nel precio ya fue pagado.\r\n", 6100011], ["Mi Redentor vive", "Hillsong United", "Otros", "2016/11/27", "Yo s\u00e9 que \u00e9l me rescat\u00f3\r\nsu sangre me perdon\u00f3,\r\ncreo en ti,\r\ncreo en ti.\r\n\r\nMi verg\u00fcenza me la quit\u00f3,\r\nmi dolor \u00e9l se lo llev\u00f3,\r\ncreo en ti,\r\ncreo en ti.\r\n\r\nCelebraremos,\r\nporque a la muerte venci\u00f3.\r\n\r\nMi redentor vive.\r\n\r\nTu quitaste mi culpa\r\ncon tu poder\r\ny ahora estoy danzando a ti\r\ncon libertad se\u00f1or.", 5716279616864256], ["Cu\u00e1n Grande es \u00c9l", "Varios", "Vertical", "2016/11/27", "Se\u00f1or mi Dios\r\nal contemplar los cielos,\r\nel firmamento y las estrellas mil.\r\n\r\nAl o\u00edr tu voz\r\nen los potentes truenos\r\ny ver brillar el sol en su zenit.\r\n\r\nMi coraz\u00f3n entona la canci\u00f3n,\r\ncu\u00e1n grande es \u00e9l,\r\ncu\u00e1n grande es \u00e9l.\r\n\r\nCuando recuerdo\r\nel amor divino,\r\nque desde el cielo al salvador envi\u00f3.\r\n\r\nAquel Jes\u00fas\r\nque por salvarnos vino\r\ny en una cruz sufri\u00f3 por mi muri\u00f3.", 5719887657828352], ["Mi Cristo Vive", "Varios", "Es Hora De Adorarle", "2016/12/04", "Mi alma Cristo rescat\u00f3,\r\nmi pecado \u00e9l cubri\u00f3,\r\nmi dolor \u00e9l lo san\u00f3,\r\nlevantar\u00e9 banderas\r\nla muerte conquist\u00f3.\r\n\r\nMi Cristo vive en mi coraz\u00f3n,\r\nMi Cristo vive, la muerte \u00e9l venci\u00f3\r\ny libre soy porque,\r\n\r\nMi Cristo vive, \u00e9l es mi salvaci\u00f3n,\r\nmi Cristo vive, autoridad me dio.\r\nLibre soy porque\r\nmi Cristo vive.", 90013], ["Mi Pan, Mi Luz", "Marcos Witt", "Dios De Pactos", "2016/12/11", "Al estar en tu santo lugar \r\nme asombra que me pueda acercar, \r\npara ver tu gloria y tu belleza \r\ny adorarte en intimidad. \r\n\r\nEn confianza yo me puedo acercar, \r\nde tu mesa puedo participar, \r\ntodo lo que puedo hacer es postrarme \r\ny con mis labios proclamar.\r\n\r\nMi pan, mi luz, mi oraci\u00f3n, \r\neres t\u00fa, Jes\u00fas. \r\n\r\nMi Dios, mi amor y mi canci\u00f3n, \r\neres t\u00fa, Jes\u00fas, solo t\u00fa. \r\n\r\nMe cuidas, me abrazas, \r\nme cantas, me amas. ", 2090017], ["T\u00fa Cordero De Dios", "Marcos Witt", "Preparad El Camino", "2016/12/11", "T\u00fa, que justo me haces,\r\nque llevas mis cargas\r\ny permaneces fiel.\r\n\r\nT\u00fa, que cubres mi vida\r\nde amor y justicia.\r\nOh, cordero fiel.\r\n\r\nT\u00fa, cordero de Dios\r\nllevaste en ti todo mi dolor.\r\n\r\nT\u00fa, rasgaste al morir\r\nel velo que ayer\r\nme separ\u00f3 de ti.\r\n", 4040019], ["Jes\u00fas Es El Se\u00f1or", "Jes\u00fas Adri\u00e1n Romero", "Cerca De Ti", "2016/12/11", "Jes\u00fas, Se\u00f1or de la creaci\u00f3n,\r\nsiendo en forma de Dios,\r\nse despoj\u00f3 de si mismo.\r\n\r\nTom\u00f3 la semejanza de hombre\r\ny siendo puro y sin mancha\r\nentre nosotros vivi\u00f3.\r\n\r\nY a si mismo se humill\u00f3,\r\ntomando forma de siervo.\r\nHasta su vida entregar\r\ny en una cruz terminar.\r\n\r\nMas Dios,\r\na lo sumo lo exalt\u00f3\r\ny su nombre engrandeci\u00f3.\r\n\r\nPara que ante\r\nsu autoridad,\r\ntoda rodilla se doble\r\ny toda lengua confiese\r\nque Jes\u00fas es el Se\u00f1or.\r\n\r\nEl Se\u00f1or", 7140011], ["Gloria a Adonai", "Paul Wilbur", "Lev\u00e1ntate Jerusal\u00e9m", "2016/12/24", "\u00bfQui\u00e9n como \u00c9l?\r\nCordero y le\u00f3n,\r\nque en el trono est\u00e1.\r\n\r\nLas monta\u00f1as y el oc\u00e9ano,\r\nclaman al Se\u00f1or.\r\n\r\nAlaba a Adonai,\r\ndesde el amanecer,\r\nhasta el atardecer.\r\n\r\nAlaba a Adonai\r\ny que toda su creaci\u00f3n,\r\ncada pueblo y naci\u00f3n,\r\ncante a \u00c9l.\r\n", 5230004], ["Con Brazo Fuerte", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2016/12/24", "Con brazo fuerte y poderoso, oh Dios,\r\nnos liberaste del pecado.\r\n\r\nY el enemigo que nos persigui\u00f3,\r\nbajo la mar fue sepultado.\r\n\r\nDe d\u00eda y de noche\r\nen nuestro caminar,\r\nTu mano siempre nos ha guiado.\r\n\r\nHaremos fiesta para celebrar\r\na nuestro Dios que sea exaltado.\r\n\r\nAleluya,\r\nreconocemos Tu grandeza.\r\nAleluya,\r\nhacemos fiesta en Tu presencia.\r\n", 7160010], ["Eres Mi Amigo Fiel", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2016/12/24", "Quien soy yo\r\npara que en mi T\u00fa pienses\r\ny que escuches, mi clamor.\r\n\r\nY es verdad lo que T\u00fa hoy me dices,\r\nque me amas, me asombras.\r\n\r\n///Eres mi amigo fiel///\r\nTu amigo soy.\r\n\r\nMajestuoso,\r\nPoderoso.\r\nTu amigo soy.", 5714315743068160], ["Tu Palabra", "Varios", "Juan Carlos Alvarado", "2017/01/29", "Cuan dulces son a mi ser tu palabra\r\nmas que la miel en mi boca sedienta,\r\nde tus mandamientos he adquirido riquezas,\r\nal seguir tu ley siento tu presencia.\r\n\r\nPues lumbrera es a mis pies tu palabra\r\nmi gu\u00eda y mi sost\u00e9n en mi camino.\r\n\r\nTu siervo soy sigo tus preceptos,\r\nav\u00edvame dame entendimiento,\r\nens\u00e9\u00f1ame a guardar tu palabra\r\nas\u00ed siempre t\u00fa mi delicia ser\u00e1s.", 8060008], ["Saltando", "Danilo Montero", "S\u00edgueme", "2017/01/29", "Vivo solo por Ti, oh Jes\u00fas,\r\nvivo solo por Ti.\r\nSoy un canto de amor para Ti,\r\nsoy un canto de amor.\r\n\r\nTu inmensidad me inspira a gritar\r\ny tu perd\u00f3n me dio la libertad para celebrar.\r\n\r\nVivo solo por Ti, oh Jes\u00fas,\r\nvivo solo por Ti.\r\n\r\nEl lamento quitaste de m\u00ed\r\ny me has hecho bailar.\r\n\r\nCantando, cantando, cantando por Ti.\r\nDanzando, danzando, danzando por Ti.\r\nSaltando, saltando, saltando por Ti.\r\n\r\nLibre para celebrar.\r\nLibre para adorar.", 5679128418189312], ["Vuelvo A Ti", "Danilo Montero", "Devoci\u00f3n", "2017/02/05", "Vengo a ti se\u00f1or,\r\nal calor de tu amor,\r\na tu mesa y a tu pan vengo hoy.\r\n\r\nVengo al primer amor,\r\na seguir tu voz,\r\na doblar mi voluntad, vengo hoy.\r\n\r\nTe seguir\u00e9 eres mi vida,\r\ntienes mi amor y mi devoci\u00f3n.\r\n\r\nCada segundo de mis d\u00edas,\r\nme entregar\u00e9 a tu coraz\u00f3n.\r\n\r\nVengo a ti se\u00f1or,\r\nal calor de tu amor,\r\na tu mesa y a tu pan vengo hoy.\r\n\r\nVengo al primer amor,\r\na seguir tu voz,\r\na doblar mi voluntad, vengo hoy.\r\n\r\nTe seguir\u00e9 eres mi vida,\r\ntienes mi amor y mi devoci\u00f3n.\r\n\r\nCada segundo de mis d\u00edas,\r\nme entregar\u00e9 a tu coraz\u00f3n.", 5635093192245248], ["La Canci\u00f3n Feliz", "Varios", "Don Moen", "2017/02/26", "Oh cantar\u00eda sin parar,\r\npor lo que hiciste en m\u00ed,\r\noh danzar\u00eda siempre Dios,\r\npor tu grande amor.\r\n\r\nArde mi coraz\u00f3n,\r\npara poder decir,\r\n\u00e9l me ha salvado y\r\nborraste mi pasado.\r\n\r\nSe\u00f1or quiero gritar,\r\nhacia todo lugar,\r\nque si t\u00fa est\u00e1s por m\u00ed, \r\nqui\u00e9n es contra m\u00ed.\r\n\r\nEstamos cantando,\r\nsomos felices.\r\nEstamos danzando,\r\npues somos libres.\r\n\r\nSi te pudi\u00e9ramos mirar,\r\ncontemplar tu sonre\u00edr\r\ny a tus \u00e1ngeles danzar\r\nporque el gozo est\u00e1 aqu\u00ed.", 70016], ["Grandes Son Tus Maravillas", "Marcos Witt", "Grandes Son Tus Maravillas", "2017/02/26", "Te alabar\u00e9 oh Se\u00f1or,\r\ninvocar\u00e9 tu Santo Nombre.\r\n\r\nSiempre dar\u00e9 a conocer\r\nen los pueblos tus obras.\r\n\r\nGrandes son,\r\ngrandes son,\r\ngrandes son tus maravillas.", 6110012], ["T\u00fa Eres Dios", "Varios", "Marcos Vidal", "2017/02/26", "Desde el fondo del mar,\r\ndel m\u00e1s alto lugar,\r\ndel m\u00e1s hondo abismo,\r\nte alabar\u00e9.\r\n\r\nDesde mi coraz\u00f3n,\r\nfuerte o d\u00e9bil est\u00e9,\r\ncada instante de mi vida \r\ncon gozo yo dir\u00e9 \r\n\r\nQue t\u00fa eres la roca eterna,\r\nSe\u00f1or sobre cielo y tierra,\r\nt\u00fa eres Dios.\r\n\r\nQue toda criatura ador\u00e9,\r\nque toda naci\u00f3n se postre \r\na ti, Se\u00f1or,\r\nt\u00fa eres Dios.", 7170010], ["La Canci\u00f3n del Desierto", "Hillsong United", "Con Todo", "2017/02/26", "Mi oraci\u00f3n en el desierto,\r\ncuando todo en mi seco est\u00e1,\r\nmi oraci\u00f3n en la necesidad,\r\nmi Dios todo lo suplir\u00e1.\r\n\r\nMi oraci\u00f3n en el fuego,\r\nen debilidad o en dolor,\r\ncuando en tormentas, probada es mi fe,\r\nen ti siempre confiar\u00e9.\r\n\r\nTe alabar\u00e9, te alabar\u00e9,\r\ncontra m\u00ed nada prevalecer\u00e1,\r\nme gozar\u00e9, declarar\u00e9,\r\nDios es mi triunfo y \u00e9l est\u00e1 aqu\u00ed.\r\n\r\nMi oraci\u00f3n en la batalla,\r\ncuando el triunfo no puedo ver,\r\nsoy coheredero y conquistador,\r\nen Cristo permanecer\u00e9.\r\n\r\nTe alabar\u00e9, te alabar\u00e9,\r\ncontra m\u00ed nada prevalecer\u00e1,\r\nme gozar\u00e9, declarar\u00e9,\r\nDios es mi triunfo y \u00e9l est\u00e1 aqu\u00ed.\r\n\r\nEn todo lugar,\r\nen todo tiempo,\r\nt\u00fa eres Dios,\r\ntengo un motivo al cantar,\r\nes mi deseo adorarte.\r\n\r\nMi oraci\u00f3n en la cosecha,\r\nabundan tu gracia y favor,\r\nsoy lleno para ser vaciado otra vez,\r\nlo que recib\u00ed sembrar\u00e9.", 5098030885765120], ["Transformados", "Marco Barrientos", "Transformados", "2017/03/04", "Transformados por el fuego de tu amor.\r\npor el brillo de tu rostro,\r\npor la pasi\u00f3n, de tu coraz\u00f3n, Jes\u00fas.\r\n\r\nSomos transformados,\r\nadmirable Dios,\r\nveo en tu palabra\r\nque tu amor vive en m\u00ed.\r\n\r\nTransformados por el precio de la cruz,\r\npor lo inmenso de tu amor,\r\nno podemos vivir un segundo sin ti, Jes\u00fas.\r\n\r\nSomos transformados,\r\nadmirable Dios,\r\ndanos tus palabras,\r\nllenanos m\u00e1s de Ti.\r\n\r\nNunca pasar\u00e1, nunca pasar\u00e1,\r\ntu amor por m\u00ed, tu amor por m\u00ed.\r\n\r\nlaralaralaralaralarala\r\n", 7330002], ["M\u00e1s Fuerte Que Nunca", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2017/03/12", "Por ti, los cojos danzan\r\nPor ti, los mudos cantan\r\nLos sordos ya escuchan\r\nSu voz a ti levantan\r\n\r\nM\u00e1s fuerte que nunca\r\nte damos adoraci\u00f3n.\r\n\r\n\r\n\r\nLos redimidos cantan,\r\nlos perdonados danzan,\r\nesclavos ya son libres,\r\nsu voz a ti levantan.", 5070001], ["Te Rendimos Adoraci\u00f3n", "Marco Barrientos", "Cree Todo Es Posible", "2017/04/02", "Santo Dios,\r\nDigno, te rendimos adoraci\u00f3n.\r\n\r\nSanto Dios,\r\ndigno cordero de Dios,\r\nsanto Dios,\r\ndigno, te rendimos adoraci\u00f3n.\r\n\r\nA ti sea la gloria por los siglos,\r\nhoy postrados a tus pies,\r\nderramamos nuestro perfume,\r\npara ti, rey de reyes.", 2110008], ["T\u00f3malo", "Hillsong United", "Unidos Permanecemos", "2017/04/02", "De todo lugar\r\nlos perdidos vendr\u00e1n,\r\nen libertad\r\na ti clamar\u00e1n.\r\n\r\nLlevaste la cruz,\r\nmoriste, vivo est\u00e1s\r\nmi Dios,\r\na ti mi vida te dar\u00e9.\r\n\r\nJes\u00fas por ti yo vivir\u00e9 \r\nde ti nunca me avergonzar\u00e9,\r\nte doy todo lo que soy,\r\ntoma, t\u00f3malo,\r\ntoma, t\u00f3malo.\r\n\r\nEnviaste a Jes\u00fas \r\npor mi salvaci\u00f3n,\r\npor la eternidad\r\nen ti tengo perd\u00f3n.\r\n\r\nBusque la verdad\r\ny te encontre a ti\r\nmi Dios\r\na ti mi vida te dar\u00e9.\r\n\r\nEres el que vista\r\nal ciego da,\r\nbrillas en la oscuridad,\r\nla  salvaci\u00f3n del mundo\r\nen tus manos\r\nest\u00e1.\r\n\r\nToma, t\u00f3malo,\r\ntoma, t\u00f3malo,\r\ntoma, t\u00f3malo.", 3080005], ["Tu Voluntad", "Hillsong Kids", "Tell The World", "2017/04/02", "Haz en m\u00ed tu voluntad,\r\nmi vida rindo a tus pies,\r\nque todo lo que soy\r\nsea para ti.\r\n\r\nSi digo que vivir\u00e9\r\npara gloria de mi rey,\r\nsi digo que vivir\u00e9 por ti,\r\npor lo que has hecho en m\u00ed.\r\n\r\nSi oro con fervor\r\nque sea tu voluntad,\r\nentonces vivir\u00e9 lo que yo dir\u00e9,\r\nas\u00ed orar\u00e9.\r\n\r\nHaz en m\u00ed tu voluntad,\r\nmi vida rindo a tus pies,\r\nque todo lo que soy\r\nsea para ti.\r\n\r\nMas all\u00e1 de mi cantar \r\nvine a mi rey honrar\r\nsi vives en m\u00ed,\r\npuedo vivir por ti.", 5645914630782976], ["Cantar\u00e9", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2017/04/09", "//Cantar\u00e9 de tu amor,\r\nasombrado miro hoy,\r\nlo que has hecho en m\u00ed\r\nlibre puedo vivir,\r\ncon mi voz canto a ti\r\ny te doy honor//\r\n\r\nBueno eres t\u00fa yo cantar\u00e9,\r\ntu misericordia\r\nes para siempre.\r\n\r\nBueno eres t\u00fa\r\ny cantar\u00e9 adoraci\u00f3n.\r\n\r\nDigno eres t\u00fa de recibir,\r\ndominio y poder,\r\nhonra y majestad.\r\n\r\nBueno eres t\u00fa\r\ny cantar\u00e9 de tu amor.\r\n\r\n//Cantar\u00e9 de tu gracia,\r\ncantar\u00e9 de tu amor,\r\ncantar\u00e9 de tu gran bondad\r\ny te dar\u00e9 honor.\r\n\r\nCantar\u00e9 alabanzas\r\ny cantar\u00e9 de perd\u00f3n\r\ncantar\u00e9 de tu santidad\r\ncon c\u00e1nticos de amor//", 2110011], ["Por Tu Llaga", "Marcos Witt", "Preparad El Camino", "2017/04/16", "Toda enfermedad\r\nt\u00fa llevaste al morir\r\ny por m\u00ed sufriste\r\nen silencio mi dolor.\r\n\r\nPor mi rebeli\u00f3n\r\nazotado y herido\r\ny por darme paz,\r\nrecibiste mi castigo.\r\n\r\nPor tu llaga sano soy,\r\nsoy fruto de tu aflicci\u00f3n,\r\noh Mes\u00edas salvador,\r\nhoy te rindo adoraci\u00f3n.\r\n\r\nPusiste tu vida\r\nen expiaci\u00f3n por la m\u00eda,\r\nJesucristo mi rey\r\nglorioso Mes\u00edas\r\n\r\nVar\u00f3n de dolores\r\nfuiste desechado,\r\nen todo quebranto\r\nexperimentado.\r\n\r\nComo un cordero\r\nal matadero llevado\r\ny con tu sangre\r\nlimpiaste mi pecado.", 2080013], ["Venci\u00f3", "Marcos Witt", "Venci\u00f3", "2017/04/16", "Venci\u00f3 Cristo venci\u00f3,\r\nvenci\u00f3 al diablo en la cruz,\r\nvenci\u00f3 Cristo venci\u00f3,\r\nvenci\u00f3 a toda potestad.\r\n\r\n\u00c9l es Jes\u00fas hijo de Dios\r\ny en \u00e9l nadie se puede perder,\r\n\u00e9l dijo que \u00e9l es la luz,\r\nes el camino, la vida y la verdad.\r\n\r\n\u00c9l nos salv\u00f3 con su poder muriendo por toda la humanidad,\r\nresucit\u00f3 y \u00e9l vive hoy venci\u00f3 al diablo y toda potestad. ", 3100010], ["Al Rey", "Marcos Witt", "Dios De Pactos", "2017/04/16", "Al rey hossana, al rey aleluya.\r\n\r\nMe ha ense\u00f1ado su grandeza,\r\nme ha mostrado su belleza,\r\nme visti\u00f3 de su realeza,\r\nde su salvaci\u00f3n yo cantar\u00e9.\r\n\r\nHa cambiado mi tristeza, \r\nha ungido mi cabeza,\r\nme cubri\u00f3 de su belleza,\r\nde su redenci\u00f3n yo cantar\u00e9.\r\n\r\nYo me asombro me maravillo \r\ny derramo mi canto en honor a \u00e9l,\r\nno hay nadie m\u00e1s glorioso \r\ntan hermoso como mi rey.", 8070006], ["Damos Honor A Ti", "Varios", "Homenaje A Jes\u00fas", "2017/04/25", "Damos honor a ti,\r\ndamos honor a ti,\r\ncreador de vida eres t\u00fa.\r\n\r\nDamos honor a ti,\r\ndamos honor a ti,\r\nporque no hay otro Dios\r\ncomo t\u00fa.\r\n\r\nRey de reyes admirable\r\neres el principio y fin\r\nsoberano y sublime\r\neres nuestro salvador. ", 5100015], ["Eres Fiel", "Coalo Zamorano", "Cosas Poderosas", "2017/04/25", "Se\u00f1or eres fiel\r\ny tu misericordia eterna.\r\n\r\nGente de toda,\r\nlengua y naci\u00f3n, \r\nde generaci\u00f3n a generaci\u00f3n.\r\n\r\nTe adoramos hoy,\r\naleluya, aleluya.\r\nTe adoramos hoy,\r\neres Se\u00f1or,\r\neres fiel.\r\n\r\nEres fiel, siempre fiel,\r\nsiempre fiel, eres fiel, \r\neres fiel, siempre fiel,\r\nsiempre fiel, eres fiel.\r\n", 6120011], ["Revelaci\u00f3n", "Danilo Montero", "Devoci\u00f3n", "2017/04/30", "Digno es el Cordero Santo,\r\nsanto, santo es \u00e9l\r\nlevantamos nuestra alabanza,\r\nal que en el trono est\u00e1.\r\n\r\nSanto, santo, santo,\r\nDios todopoderoso,\r\nquien fue, quien es\r\ny quien vendr\u00e1.\r\n\r\nLa creaci\u00f3n hoy canta\r\ny damos gloria a \u00e9l\r\nt\u00fa eres digno,\r\npor siempre y siempre.", 190001], ["Aleluya A Nuestro Dios", "Marcos Witt", "Sana Nuestra Tierra", "2017/04/30", "Aleluya, aleluya,\r\naleluya a nuestro Dios.\r\n\r\nTodos sus siervos,\r\nlos que le temen,\r\nlos peque\u00f1os y grandes,\r\nalabad a nuestro Dios.\r\n\r\n\u00c9l es Dios Santo,\r\njusto en sus juicios,\r\nes fiel y verdadero,\r\nalabad a nuestro Dios.\r\n\r\nAleluya, aleluya,\r\naleluya a nuestro Dios.\r\n\r\nD\u00e9mosle gloria,\r\nd\u00e9mosle honra,\r\nla hora ha llegado,\r\nal Cordero exaltad.\r\n\r\nSu trono es firme,\r\nsiempre eterno,\r\ncetro de justicia,\r\nes el cetro del Gran Rey.\r\n\r\nAleluya, aleluya,\r\naleluya a nuestro Dios.\r\n\r\nGran multitud\r\nestruendo de muchas aguas.\r\nlevanten su voz\r\nden voces de j\u00fabilo al Rey.\r\n\r\nDel norte al sur\r\ndeclaren por siempre su gloria,\r\n\u00c9l es nuestro Dios\r\nTodopoderoso Gran Rey.\r\n\r\nAleluya, aleluya,\r\naleluya a nuestro Dios.\r\n", 2080012], ["Eres T\u00fa", "Danilo Montero", "Tu Amor", "2017/04/30", "Jes\u00fas, t\u00fa eres el amigo que me ama.\r\nJes\u00fas, t\u00fa eres la esperanza de mi vida.\r\n\r\nEres, eres eres t\u00fa,\r\neres, eres t\u00fa.\r\n\r\nJes\u00fas, t\u00fa eres el camino y la vida.\r\nJes\u00fas, t\u00fa eres salvaci\u00f3n y alegr\u00eda.\r\n\r\nT\u00fa eres Rey \r\neres Se\u00f1or \r\ny en una cruz fuiste a vencer.\r\n\r\nEngrandecido eres Dios\r\nte levantaste con poder.", 7170011], ["Sobrenatural", "Marcos Witt", "Sobrenatural", "2017/04/30", "Dios de mi vida eres Dios,\r\nde los cielos eres Dios,\r\nde los mares eres Dios,\r\nsobrenatural.\r\n\r\nDe la tierra eres Dios,\r\nmi sustento eres Dios,\r\nsiempre eterno eres Dios,\r\nsobrenatural.\r\n\r\nSobrenatural,\r\neres Dios sin igual,\r\ndue\u00f1o del cielo y mar,\r\nsobrenatural.\r\n\r\nSobrenatural,\r\nhabitas la eternidad,\r\neres es el manantial,\r\nsobrenatural.", 5682747733442560], ["Every Day", "Hillsong United", "Otros", "2017/05/07", "\u00bfQu\u00e9 decir, Se\u00f1or?\r\nT\u00fa me das vida y no s\u00e9\r\nc\u00f3mo explicar \r\nlo que significas.\r\n\r\nMe salvaste, Dios,\r\ntodo lo que soy te doy, \r\nque cada d\u00eda pueda\r\ntu nombre hacer brillar.\r\n\r\nCada d\u00eda en\r\ntu palabra quiero andar,\r\ndeseo Dios poder\r\nconocerte m\u00e1s y m\u00e1s.\r\n\r\nQue t\u00fa me gu\u00edes\r\nen cada paso que yo doy\r\nque cada d\u00eda pueda\r\nser de luz al mundo.\r\n\r\nVivir\u00e9\r\ncada d\u00eda por ti,\r\nte seguir\u00e9,\r\ncada d\u00eda a ti,\r\nandar\u00e9\r\ncontigo, mi Se\u00f1or.\r\n\r\n////Yo s\u00f3lo vivo para ti////\r\nSe\u00f1or.", 80005], ["Vivo Est\u00e1s", "Varios", "Hillsong Young", "2017/05/07", "Roto estaba mi coraz\u00f3n,\r\npero tu mano me rescat\u00f3,\r\ndel polvo yo volv\u00ed a nacer\r\nla salvaci\u00f3n en ti encontr\u00e9.\r\n\r\nTu amor no puedo expresar,\r\nte seguir\u00e9 por la eternidad.\r\nEn tu gracia caminar\u00e9,\r\nen libertad siempre vivir\u00e9.\r\n\r\nEn ti, en ti, en ti, soy libre,\r\ns\u00e9 exaltado, s\u00e9 exaltado.\r\nTu amor, tu amor, tu amor no se acaba,\r\noh oh oh.\r\n\r\nT\u00fa vivo est\u00e1s en m\u00ed,\r\nno hay nadie en tu lugar,\r\nte necesito Dios,\r\neres mi libertad.\r\n\r\nAl pasar por la oscuridad,\r\nsu luz siempre me guiar\u00e1.\r\nMis cadenas Jes\u00fas rompi\u00f3,\r\ncon su mano me rescat\u00f3.\r\n\r\nEste mundo terminar\u00e1,\r\nte seguir\u00e9 hasta el final.\r\nHaz en m\u00ed Dios tu voluntad\r\nvenga tu reino a este lugar.\r\n", 6110003], ["Quietud (Still)", "Hillsong", "Hope", "2017/05/07", "Morar\u00e9,\r\nen tus alas Dios,\r\nbajo de tus manos de poder.\r\n\r\nSi los mares se alzan contra m\u00ed,\r\nvolar\u00e9 sobre la tempestad\r\npadre eres rey sobre el mar,\r\nquieto estar\u00e9, s\u00e9 que eres Dios.\r\n\r\nReposa en ti\r\nmi alma Se\u00f1or,\r\ndescansar\u00e9\r\nen confianza y quietud.", 5734439678115840], ["Abre Mis Ojos", "Marco Barrientos", "Mu\u00e9strame Tu Gloria", "2017/05/21", "Abro mis ojos, oh Cristo,\r\nabro mis ojos, Se\u00f1or,\r\n//Yo puedo verte//\r\n\r\nY contemplar tu majestad\r\ny el resplandor de tu gloria.\r\n\r\nDerramaste amor y poder\r\nsobre tu pueblo,\r\nPadre Santo.\r\n\r\nSanto, santo, santo\r\nyo puedo verte.", 5071437253574656], ["Correr\u00e9", "Hillsong United", "Con Todo", "2017/05/21", "Eres Dios sin principio, \r\ncreador infinito.\r\n\r\nT\u00fa nos viste aqu\u00ed,\r\ncuando llamaste a la tierra\r\ny el mundo a la existencia.\r\n\r\nEres Dios de victoria,\r\nla historia\r\nes tu historia.\r\n\r\nT\u00fa quien fuiste y es,\r\ny quien por siempre ser\u00e1,\r\nvivir\u00e9 por tu gloria.\r\n\r\nY correr\u00e9,\r\narde fuego en mi coraz\u00f3n,\r\nnada puede apagar tu amor,\r\nmi Dios, la gloria te dar\u00e9,\r\nJes\u00fas.\r\n\r\nEres Dios, somos libres,\r\nen nosotros t\u00fa vives.\r\n\r\nT\u00fa nos viste aqu\u00ed,\r\nantes de resucitar\r\ny entregarnos tu promesa.\r\n\r\nY correr\u00e9,\r\narde fuego en mi coraz\u00f3n,\r\nnada puede apagar tu amor,\r\nmi Dios, la gloria te dar\u00e9.\r\n\r\nY correr\u00e9,\r\ncon mi vida te alabar\u00e9\r\ny tu nombre famoso har\u00e9,\r\nmi Dios, la gloria te dar\u00e9,\r\nJes\u00fas.\r\n", 5666823336886272], ["Vive En Mi", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2017/05/21", "Diga el d\u00e9bil, fuerte soy en \u00e9l,\r\ndiga el pobre, rico soy en \u00e9l,\r\ndiga el triste, alegre estoy\r\nporque Cristo vive en m\u00ed.\r\n\r\n//Vive en m\u00ed, \r\n\u00e9l vive en m\u00ed// \r\n\u00c9l vive en m\u00ed \r\n\r\nDiga el enfermo, sano soy en \u00e9l \r\ndiga el atado, libre soy en \u00e9l,\r\ndiga el triste, alegre estoy\r\nporque Cristo vive en m\u00ed. \r\n\r\n//Vive en m\u00ed \r\n\u00e9l vive en m\u00ed// \r\n\u00c9l vive en m\u00ed. \r\n\r\n////Yo soy feliz, \r\n\u00e9l vive en m\u00ed//// \r\n\r\nDiga el triste, alegre estoy,\r\nporque Cristo vive en m\u00ed. \r\n\r\n///Vive en m\u00ed \r\n\u00e9l vive en m\u00ed/// ", 5723348596162560], ["Awesome God", "Hillsong United", "Look To You", "2017/05/28", "Jehov\u00e1, Todopoderoso Rey,\r\nsolo t\u00fa reinas con poder, \r\nte doy mi adoraci\u00f3n,\r\nasombroso Dios.\r\n\r\nT\u00fa eres grande, cuan grande eres Se\u00f1or\r\nni los cielos alcanzan para contener tu gloria ni tu bondad.\r\n\r\nNi tu poder, ni tu amor, tu santidad Se\u00f1or,\r\nt\u00fa vives en m\u00ed no puedo callar\r\ntu nombre hoy quiero adorar.", 1070006], ["Amado Salvador", "Marco Barrientos", "Cree Todo Es Posible", "2017/05/28", "En tu santuario, mi Se\u00f1or,\r\nquiero ofrecer mi coraz\u00f3n.\r\nReconocer tu gran amor,\r\ntu perd\u00f3n.\r\n\r\nTu sacrificio provey\u00f3\r\nel camino a tu coraz\u00f3n\r\ncon gratitud y adoraci\u00f3n\r\ncantar\u00e9.\r\n\r\nTu amor, amor que me dio la libertad,\r\ntu sangre me dio la vida.\r\nTu amor, camino, verdad y vida\r\neres t\u00fa.\r\n\r\nMe alegrar\u00e9 y me gozar\u00e9\r\nen ti Jes\u00fas mi redentor,\r\namado salvador\r\neres t\u00fa.", 5080009], ["Toda La Gloria", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2017/06/11", "//Toda la gloria y la honra es para ti,\r\nmi vida doy como una ofrenda, me entrego a ti// \r\n //Postrado en adoraci\u00f3n, ante ti, Salvador//\r\n\r\nAdorarte a ti, Jes\u00fas\r\nes todo lo que quiero hacer.\r\nMi pasi\u00f3n eres t\u00fa, Oh Rey.\r\n\r\nToda la gloria es para ti.\r\nEres digno solo t\u00fa.\r\nSolo t\u00fa Se\u00f1or.\r\nRey de reyes majestuoso.\r\nEres digno oh Rey.", 3100014], ["Digno Eres Se\u00f1or", "Marco Barrientos", "Mu\u00e9strame Tu Gloria", "2017/06/11", "Gracias por la cruz, Dios,\r\npor el precio t\u00fa pagar,\r\nmi pecado y dolor, \r\ntu amor quit\u00f3,\r\ndando gracia eternal.\r\n\r\nGracias por tu amor, Dios,\r\npor las manos que her\u00ed,\r\npues tu r\u00edo me limpi\u00f3 \r\ny siento al fin \r\ntu perd\u00f3n y salvaci\u00f3n.\r\n\r\nDigno eres, Se\u00f1or, \r\nen tu trono est\u00e1s,\r\ncoronado con poder,\r\nreinas con majestad.\r\n\r\nCristo, Hijo de Dios, \r\nexaltado rey,\r\nmoriste en la cruz en mi lugar,\r\ndigno eres, Se\u00f1or.", 5100017], ["T\u00fa Eres Digno De Gloria", "Varios", "Gerry M\u00e1rquez", "2017/06/11", "Hoy te alabamos Se\u00f1or\r\ny declaramos\r\nque t\u00fa eres nuestro Dios.\r\n\r\nEres el Dios de amor\r\nya no somos esclavos del temor.\r\n\r\nHoy te adoramos Se\u00f1or\r\ny te cantamos\r\ncon nuestro coraz\u00f3n. \r\n\r\nTe damos todo el honor\r\nsobre el cielo y la tierra\r\nt\u00fa eres Se\u00f1or.\r\n\r\nT\u00fa eres digno de gloria\r\nsobre toda la tierra,\r\nt\u00fa eres Dios.\r\n\r\nEres digno de recibir\r\ntoda adoraci\u00f3n,\r\ntodo el honor sea a ti.\r\n\r\nEres digno,\r\neres santo,\r\neres rey\r\nde toda creaci\u00f3n.", 7170007], ["Desesperado", "Danilo Montero", "Tu Amor", "2017/06/11", "Desesperado estoy\r\nbuscando tu verdad,\r\nte necesito m\u00e1s.\r\n\r\nQuiero decirte\r\ncuanto te amo mi Se\u00f1or,\r\nte adoro m\u00e1s y m\u00e1s.\r\n\r\nY en tu verdad caminar\u00e9,\r\ny a tus brazos correr\u00e9.\r\n\r\nBajo tus alas estar\u00e9,\r\ntu mano tomar\u00e9,\r\nme quedar\u00e9 muy junto a ti,\r\nno me importa lo que pueda suceder.\r\n", 8080008], ["Me Haces Feliz", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2017/07/02", "Has puesto una canci\u00f3n en mi coraz\u00f3n,\r\nquitaste el lamento y\r\nalegr\u00eda tengo hoy, s\u00ed.\r\n\r\nGozo me diste, por mi dolor,\r\nhoy lo declaro por tu amor.\r\n\r\nMe haces feliz,\r\nme haces feliz,\r\nme haces feliz,\r\nyo me alegrar\u00e9 por siempre en ti.\r\n\r\nMis manos hoy levanto a ti,\r\ntu gozo en m\u00ed\r\nme hace decir\r\nme haces feliz.\r\n\r\nHoy voy a celebrar\r\ncon mi canci\u00f3n \r\nque T\u00fa eres digno de loor,\r\nme haces feliz.", 8060014], ["Ll\u00e9vame", "Varios", "Es Hora De Adorarle", "2017/07/02", "Te entrego mi vida,\r\nte entrego mi ser,\r\nmi coraz\u00f3n te doy,\ntodo lo que quieras tener. \r\n\r\nToma mis sue\u00f1os,\nmis planes tambi\u00e9n,\r\nyo s\u00e9 que me llevar\u00e1s\nm\u00e1s all\u00e1 de mi so\u00f1ar.\r\n\r\nLl\u00e9vame a ese lugar\ndonde lo de alrededor no importa \nes donde necesito estar.\r\n\r\nLl\u00e9vame a ese lugar\nm\u00e1s all\u00e1 de lo que yo podr\u00eda\nen mi vida imaginar, ll\u00e9vame.\r\n\r\nMi confianza est\u00e1 en ti, Se\u00f1or, \r\npara completar la obra que iniciaste,\r\nno me quiero ir de tu voluntad, Dios, \r\nporque all\u00ed encuentro paz, vida y bendici\u00f3n.", 8080011], ["Mi Padre Me Ama", "Varios", "Juan Luis Guerra", "2017/07/02", "Mi Padre me ama tanto que\r\nsu hijo dio por m\u00ed,\r\npor siempre las gracias le dar\u00e9.\r\n\r\nMe ha dado su esp\u00edritu y verdad\r\nbendito, mi Se\u00f1or,\r\na su lado nada temer\u00e9, y cantar\u00e9.\r\n\r\nMi Padre me ama tanto,\r\nsu amor es eterno y santo,\r\ntan grande que no puedo entender,\r\nno puedo entenderlo.\r\n\r\nMe viste de ropa fina\r\nme anhela y me dio su vida,\r\ngloria, aleluya, Padre fiel.\r\n\r\nMi Padre me ama tanto que\r\nsoy su heredero,\r\nme ha dado su nombre y su poder.\r\n\r\nMe viste de gloria y de bondad,\r\nbendito mi Se\u00f1or,\r\nmi Dios por siempre salvar\u00e9\r\ny cantar\u00e9.\r\n\r\nOh, gracias siempre.\r\n\r\nSu amor nunca cambia,\r\nnunca cambia,\r\nsu amor es benigno y tierno,\r\nque todo lo puede y es eterno,\r\ngloria, Am\u00e9n.", 5702480826466304], ["Poderoso", "Hillsong United", "Con Todo", "2017/07/09", "Su amor me alcanz\u00f3\r\nen la cruz por m\u00ed muri\u00f3.\r\nMi pecado \u00e9l llev\u00f3\r\ncon poder resucit\u00f3.\r\n\r\nSigues siendo siempre fiel,\r\nmi refugio mi sost\u00e9n.\r\nJesucristo es la verdad,\r\nque me dio la libertad.\r\n\r\n\u00a1Poderoso! \u00a1Poderoso!\r\nMe libraste, me salvaste.\r\nEst\u00e1 escrito\r\nhaz vencido\r\nCristo t\u00fa eres Se\u00f1or.\r\n\r\nSin principio,\r\nsin final.\r\nEsperanza sin igual.\r\nEl perdido encontr\u00f3\r\nen Jes\u00fas la salvaci\u00f3n.\r\n\r\n\u00a1Poderoso! \u00a1Poderoso!\r\nMe libraste, me salvaste.\r\nEst\u00e1 escrito\r\nhaz vencido\r\nCristo t\u00fa eres Se\u00f1or.\r\n\r\nQue tu nombre sea exaltado,\r\nsea exaltado,\r\nsea exaltado.", 3220001], ["De Gloria en Gloria", "Marco Barrientos", "Amanece", "2017/07/09", "Yo, puedo ver \r\ntu luz brillando en m\u00ed,\r\na trav\u00e9s de m\u00ed.\r\n\r\nTu voluntad,\r\nque todos puedan ver,\r\nque todos oigan que.\r\n\r\n// T\u00fa eres vida, la esperanza \r\nperfecta gracia que \r\nme ha rescatado // \r\n\r\n// Ya no vivo yo, Cristo vive en m\u00ed, \r\ntodo puedo hacer, en tus manos // \r\n\r\nDe gloria en gloria,\r\nte veo, Dios.\r\nDe gloria en gloria,\r\ntransformado soy\r\npor tu esp\u00edritu.\r\n\r\n/// De gloria en gloria,\r\nte veo, oh Dios ///\r\n", 5697982787747840], ["T\u00fa Eres El Gozo", "Marcos Witt", "Alegr\u00eda", "2017/07/16", "T\u00fa eres el gozo,\r\nt\u00fa eres mi paz,\r\nt\u00fa eres la fuente inagotable\r\nde alegr\u00eda.\r\n\r\nT\u00fa eres refugio,\r\nen la tempestad,\r\nt\u00fa eres la fuerza que sostiene\r\ntoda mi vida.\r\n\r\nY hoy declaramos,\r\nque toda la tierra ser\u00e1 llena de tu gloria.\r\n\r\nSe\u00f1or de se\u00f1ores,\r\nque abres los mares\r\nde toda la creaci\u00f3n,\r\neres Dios.\r\n\r\nTu nombre exaltamos\r\ny hoy te adoramos,\r\nnos salvaste con tu amor.\r\n\r\nHas limpiado nuestro coraz\u00f3n,\r\nnos has dado tu perd\u00f3n,\r\ny por eso hoy venimos a rendir,\r\ntoda nuestra adoraci\u00f3n.", 90014], ["De Tal Manera", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2017/07/16", "De tal manera me am\u00f3,\r\nque su vida no escatim\u00f3,\r\nhasta el final \u00e9l se entreg\u00f3,   \r\ny a la muerte fue porque me am\u00f3.  \r\n \r\nDe tal manera me am\u00f3,\r\nque no hay forma en que podr\u00e9 pagar,\r\nel precio de su grande amor,\r\npero toda mi alma quiero dar.\r\n\r\nPor su amor yo vivir\u00e9,\r\nde su amor yo cantar\u00e9,\r\ncon mi Jes\u00fas caminar\u00e9,\r\nporque \u00e9l me amo a mi.\r\n\r\nPor su amor yo vivir\u00e9,\r\nde su amor yo cantar\u00e9,\r\ncon mi Jes\u00fas caminar\u00e9,\r\nporque \u00e9l muri\u00f3 por mi...  le seguir\u00e9.", 8060011], ["Bendito Jes\u00fas", "Danilo Montero", "Devoci\u00f3n", "2017/07/16", "Por ti es mi clamor\r\ny sin ning\u00fan temor\r\nen ti puedo confiar,\r\nbendito Jes\u00fas.\r\n\r\nHoy puedo escuchar,\r\ntu voz de sanidad\r\nrestaurando mi ser,\r\nbendito Jes\u00fas.\r\n\r\nMi deseo eres t\u00fa,\r\nmi momento de amor,\r\nla alegr\u00eda de vivir,\r\nbendito Jes\u00fas.\r\n\r\nEres mi fuente de amor,\r\neres aire y eres sol.\r\nEl latir del coraz\u00f3n,\r\nbendito Jes\u00fas.\r\n\r\nBendito amor de mi Se\u00f1or.\r\n\r\nTu gracia y favor\r\nconmigo puedo ver\r\nllenando hoy mi ser,\r\nbendito Jes\u00fas.\r\n\r\nY hoy mi voluntad,\r\nse rinde a tu verdad\r\ntu amor y tu bondad,\r\nbendito Jes\u00fas.", 4799981630259200], ["La Casa De Dios", "Danilo Montero", "Cantar\u00e9 De Tu Amor", "2017/07/23", "Mejor es un d\u00eda en la casa de Dios,\r\nque mil a\u00f1os lejos de \u00e9l.\r\nPrefiero un rinc\u00f3n en la casa de Dios,\r\nque todo el palacio de un rey.\r\n\r\nVen conmigo a la casa de Dios,\r\ncelebraremos juntos su amor,\r\nharemos fiesta en honor\r\nde aquel que nos am\u00f3.\r\n\r\nEstando aqu\u00ed en la casa de Dios.\r\nalegraremos su coraz\u00f3n.\r\nLe brindaremos ofrendas\r\nde obediencia y amor.\r\n\u00a1En la casa de Dios!\r\n\r\nArde mi alma, arde de amor,\r\npor aquel que me dio la vida,\r\npor eso le anhela mi coraz\u00f3n,\r\nanhela de su compa\u00f1\u00eda.", 80012], ["Bueno Es Alabar", "Danilo Montero", "Admirable", "2017/07/23", "Bueno es alabar\r\noh Se\u00f1or,\r\n\u00a1Tu nombre!\r\n\r\nDarte gloria,\r\nhonra y honor,\r\n\u00a1Por siempre!\r\n\r\nBueno es alabarte Jes\u00fas\r\ny gozarme en tu poder.\r\n\r\nPorque grande\r\neres t\u00fa,\r\ngrandes son tus obras.\r\n\r\nPorque grande\r\neres t\u00fa,\r\ngrande es tu amor,\r\ngrande son tus obras.", 6060001], ["Hoy Te Rindo Mi Ser", "Generaciones", "Proclamar\u00e9 Tu Amor", "2017/07/23", "Este es mi deseo,\r\nhonrarte a ti,\r\ncon todo mi ser,\r\nte adorar\u00e9.\r\n\r\nCon todas mis fuerzas\r\nte alabar\u00e9,\r\nmi adoraci\u00f3n\r\neres t\u00fa.\r\n\r\nHoy te rindo mi ser\r\nte doy mi coraz\u00f3n,\r\nyo vivo para ti.\r\n\r\nEn cada palpitar,\r\nmientras haya aliento en m\u00ed\r\nDios has tu obra en m\u00ed.\r\n\r\nTe entrego mi ser\r\ny mi coraz\u00f3n,\r\ns\u00f3lo a ti Se\u00f1or.", 7110001], ["Mi Herencia", "Jes\u00fas Adri\u00e1n Romero", "El Aire De Tu Casa", "2017/07/23", "Eres t\u00fa mi herencia, mi porci\u00f3n, \r\nlo que hab\u00eda anhelado, lo mejor. \r\nEres t\u00fa la parte que escog\u00ed, \r\nel mejor regalo que recib\u00ed.\r\n\r\nEres t\u00fa mi complemento, \r\nmi mejor momento. eres t\u00fa.\r\n\r\nEres el mejor amigo que pude tener, \r\nen mi oscuridad vi tu amanecer,\r\nvolv\u00ed a nacer. \r\nEs mejor estar un d\u00eda junto a tu altar \r\nque toda una vida sin tu amistad\r\ny en otro lugar.\r\n\r\nEres como el viento, como el sol, \r\nhas llenado todo lo que soy. \r\nEres paz en medio del dolor, \r\neres melod\u00eda al coraz\u00f3n.\r\n\r\nEres sombra en el desierto, \r\nagua y alimento eres t\u00fa.", 8080010], ["Yo S\u00e9 Qui\u00e9n Soy Yo", "Danilo Montero", "Devoci\u00f3n", "2017/07/25", "Extraviado, me encontraste,\r\nciego estaba, y ahora puedo ver,\r\npor tu canci\u00f3n yo cantar\u00e9.\r\n\r\nQuebrantado, me sanaste,\r\nmuerto estaba y ahora vivo en ti\r\ntu identidad has puesto en m\u00ed.\r\n\r\nYo s\u00e9 quien soy yo,\r\nyo s\u00e9 quien soy yo,\r\nyo s\u00e9 quien soy yo,\r\ntuyo soy, tuyo soy.\r\n\r\nT\u00fa eres mi Dios, Cristo eres mi Dios.\r\neres mi Dios, Cristo eres mi Dios.\r\n\r\nSoy perdonado, tu amigo soy,\r\nsoy aceptado, yo s\u00e9 quien soy yo.\r\n\r\nTengo confianza, seguro estoy \r\nque soy amado, yo s\u00e9 quien soy yo.\r\n\r\nVolv\u00ed a vivir, ya libre soy,\r\nte pertenezco a ti y t\u00fa eres mi Dios. \r\n\r\nYo s\u00e9 quien soy yo,\r\nyo s\u00e9 quien soy yo,\r\nyo s\u00e9 quien soy yo,\r\ntuyo soy, tuyo soy// \r\nTuyo soy,\r\ntuyo soy.\r\n\r\n", 2080011], ["Eres Mi Adoraci\u00f3n", "Marco Barrientos", "Gozo En Tu Presencia", "2017/07/25", "Eres sin igual,\r\nno te puedo comparar. \r\nEres tan real,\r\njunto a ti yo quiero estar.\r\n\r\nEs mejor un d\u00eda en tu presencia, oh, Dios,\r\nque mil sin disfrutar de tu amor. \r\n\r\nEres t\u00fa, \r\nsolo t\u00fa, \r\nmi adoraci\u00f3n y mi pasi\u00f3n,\r\neres tu Jes\u00fas. \r\n\r\nEres tu Jes\u00fas, eres mi pasi\u00f3n.\r\nEres tu Jes\u00fas, mi adoraci\u00f3n.", 5090018], ["Soy Perdonado", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2017/07/25", "//Tu amor es suficiente,\r\ndiste todo, todo diste,\r\ncon tus manos, me formaste,\r\nmis pecados perdonaste//\r\n\r\nSi caigo, yo caigo a tus pies\r\ny me dices.\r\n\r\nSoy perdonado,\r\nhoy tengo otra oportunidad,\r\nno hay condenaci\u00f3n\r\ntu gracia cubri\u00f3 y borro mi maldad.\r\n\r\nNo hay nada como tu amor,\r\ncomo tu amor por m\u00ed.\r\n\r\nCon tu gracia,\r\ndulce gracia,\r\nnos acercas,\r\nnos aceptas.\r\n\r\nT\u00fa nos buscas\r\nnos encuentras\r\ny diriges\r\nnuestras sendas.\r\n\r\nSi caigo, yo caigo a tus pies\r\ny me dices.\r\n\r\n//Dios de mi salvaci\u00f3n//\r\nNada me podr\u00e1 separar de tu amor.", 5640686850277376], ["El Mismo Poder", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2017/07/30", "Cristo Cristo, redentor,\r\nno hay m\u00e1s grande amor,\r\nque el que me diste a m\u00ed.\r\n\r\nAleluya, me perdonas,\r\nnunca m\u00e1s atado estar\u00e9.\r\n\r\nPorque el mismo poder,\r\nque a Cristo vida dio,\r\nvive ahora en m\u00ed.\r\n\r\nY ese mismo poder,\r\nque a la muerte derrot\u00f3,\r\nvive ahora en m\u00ed.\r\n\r\nY yo completo estoy,\r\npues me rescat\u00f3,\r\n\u00e9l me rescat\u00f3,\r\nsi hoy yo lo gritar\u00e9.\r\n\r\nLas cadenas se van,\r\ntengo hoy libertad,\r\nsi hoy yo lo gritar\u00e9.\r\n\r\nPorque el mismo poder,\r\nque a Cristo vida dio,\r\nvive ahora en m\u00ed.\r\n\r\nY ese mismo poder,\r\nque a la muerte derrot\u00f3,\r\nVive ahora en m\u00ed.\r\n\r\nY yo completo estoy,\r\npues me rescat\u00f3,\r\n\u00c9l me rescat\u00f3,\r\nHoy lo gritar\u00e9.", 5655869022797824], ["Salvation Is Here", "Hillsong United", "Look To You", "2017/07/30", "Dios est\u00e1 sobre todo el mundo\r\nsobre toda esperanza y temor.\r\nNo importa lo que\r\nel mundo intente hacer\r\n\u00a1Todo va a estar bien!\r\n\r\nSe oye en esta generaci\u00f3n\r\nel canto de nuestra libertad.\r\nTodo el mundo te podr\u00e1 conocer\r\n\u00a1Todo va a estar bien!\r\n\r\nPorque s\u00e9 que mi d\u00eda salv\u00f3,\r\ny s\u00e9 que su palabra cumpli\u00f3,\r\ny s\u00e9 que Dios una salida har\u00e1,\r\nla salvaci\u00f3n est\u00e1 aqu\u00ed.\r\n\r\n//La salvaci\u00f3n est\u00e1 aqu\u00ed//\r\ny hoy vive en m\u00ed.\r\n//La salvaci\u00f3n est\u00e1 aqu\u00ed//\r\ny me hizo libre al fin.\r\n\r\n//La salvaci\u00f3n est\u00e1 aqu\u00ed//\r\ny hoy vive en m\u00ed.\r\n//La salvaci\u00f3n est\u00e1 aqu\u00ed//\r\nporque t\u00fa vivo est\u00e1s\r\ny vives en m\u00ed.\r\n\r\nPorque s\u00e9 que mi d\u00eda salv\u00f3,\r\ny s\u00e9 que su Palabra cumpli\u00f3,\r\ny s\u00e9 que Dios una salida har\u00e1,\r\nla salvaci\u00f3n est\u00e1 aqu\u00ed.", 5659313586569216], ["Fue En La Cruz", "Danilo Montero", "Cantar\u00e9 De Tu Amor", "2017/08/06", " Si fue en la cruz \r\nque yo encontr\u00e9\r\nla paz y gozo que llena\r\nla gracia que lo cambi\u00f3 todo\r\nsi yo encontr\u00e9 en Jes\u00fas.\r\n\r\nSi fue en la cruz que pude ver\r\nla condici\u00f3n de mi alma,\r\nlo lejos que me hallaba\r\nde su perfecto amor.\r\n\r\nSi fue en la cruz que el salvador\r\nme dio su amor y vida para siempre.\r\nSi fue en la cruz que cancel\u00f3\r\ntodo deber que condenaba mi ser.\r\n\r\n Si fue en la cruz donde al fin\r\n se abri\u00f3 la puerta del cielo\r\n y al padre pude llegar\r\n en real adoraci\u00f3n.\r\n\r\n Si fue en la cruz que pude ver\r\n la condici\u00f3n de mi alma,\r\n lo lejos que me hallaba\r\n de su perfecto amor.", 2090018], ["El Se\u00f1or Es Mi Pastor", "Danilo Montero", "Eres Todopoderoso", "2017/08/06", "El Se\u00f1or es mi pastor nada me faltar\u00e1.\r\nEl Se\u00f1or es mi pastor en pastos delicados\r\n\u00e9l me har\u00e1 descansar.\r\n\r\nJunto a aguas de reposo me pastorear\u00e1\r\nconfortar\u00e1 mi alma,\r\nme guiar\u00e1 por sendas de justicia por amor de su nombre.\r\n\r\nEl Se\u00f1or es mi pastor nada me faltar\u00e1.", 3080007], ["Quiero Proclamar", "Danilo Montero", "S\u00edgueme", "2017/08/06", "Quiero proclamar \r\nque t\u00fa eres mi gozo.\r\n\r\nMi felicidad,\r\nmi mejor sonrisa.\r\n\r\nQue hoy estoy completo,\r\npues llegaste t\u00fa.\r\n\r\nMi Se\u00f1or,\r\nmi fuerza,\r\nmi gu\u00eda.\r\n\r\nMi Se\u00f1or,\r\nmi padre,\r\nel due\u00f1o de mi amor.\r\n\r\nQuiero proclamar \r\nque t\u00fa eres mi gozo.\r\n\r\nMi felicidad,\r\nmi mejor sonrisa.\r\n\r\nQue hoy estoy completo,\r\npues t\u00fa eres \r\nDios.\r\n\r\nMi Se\u00f1or,\r\nmi fuerza,\r\nmi gu\u00eda.\r\n\r\nMi Se\u00f1or,\r\nmi padre,\r\nel due\u00f1o de mi amor.\r\n\r\nQue hoy estoy completo,\r\npues llegaste t\u00fa.\r\n\r\nQue hoy estoy completo ,\r\npues t\u00fa eres.\r\n\r\nMi Se\u00f1or,\r\nmi fuerza,\r\nmi gu\u00eda.\r\n\r\nMi Se\u00f1or,\r\nmi padre\r\nel due\u00f1o de mi amor.\r\n", 3100011], ["No me soltar\u00e1s", "Rojo", "Sencillos", "2017/08/06", "Aunque yo est\u00e9 \r\nen el valle de la muerte y dolor \r\ntu amor me quita todo temor.\r\n\r\nY si llego a estar\r\nen el centro de la tempestad, \r\nno dudar\u00e9, porque est\u00e1s aqu\u00ed. \r\n\r\nY no temer\u00e9 del mal \r\npues mi Dios conmigo est\u00e1 \r\ny si Dios conmigo est\u00e1 \r\n\u00bfDe qui\u00e9n temer\u00e9? \r\n\r\nNo, no me soltar\u00e1s \r\nen la calma o la tormenta.\r\nNo,no me soltar\u00e1s \r\nen lo alto, en lo bajo.\r\nNo,no me soltar\u00e1s \r\nDios nunca me dejar\u00e1s. \r\n\r\nPuedo ver la luz \r\nque se acerca \r\nal que busca de ti , \r\ngloriosa luz cual otra no hay.\r\n\r\nY terminar\u00e1n los problemas\r\ny mientras llega el fin \r\nviviremos conoci\u00e9ndote a ti.\r\n\r\nPuedo ver la luz \r\nque se acerca \r\nal que busca de ti\r\ny terminar\u00e1n los problemas.\r\n\r\nMientras llega el fin \r\nvoy a alabarte, \r\nvoy a alabarte solo a ti.", 5130696796405760], ["Oh, Gracias, Encontr\u00e9 La Vida", "Marcos Witt", "Dios De Pactos", "2017/08/13", "Oh, gracias,\r\noh, t\u00fa eres mi alegr\u00eda.\r\nOh, gracias,\r\noh, encontr\u00e9 la vida\r\nen ti.\r\n\r\nNo tengo nada\r\nen mis manos\r\nque entregarte \r\nmi ofrenda es solamente gratitud.\r\n\r\nNo tengo dinero ni manera\r\npara pagarte \r\nla vida en abundancia que \r\nme has dado en plenitud.\r\n\r\nAl entrar aqu\u00ed\r\ncon agradecimiento,\r\nes tu sangre\r\nque me ha dado este \r\nlugar.\r\n\r\nTu amor sobre pasa\r\nentendimiento \r\ny expresar mi gratitud \r\nnunca lo podr\u00e9 callar.\r\n\r\nNadie me ha protegido,\r\nnadie me ha sostenido,\r\nnadie me ha cuidado como t\u00fa.\r\n\r\nEs por eso que me rindo,\r\nes por eso que me entrego,\r\nes por eso que mi vida\r\npertenece a ti.", 4050017], ["S\u00f3lo En Ti", "Marcos Witt", "Alegr\u00eda", "2017/08/13", "Me gozar\u00e9 en mi Se\u00f1or\r\ncon toda el alma,\r\nme alegrar\u00e9 en su amor\r\ny en su esperanza\r\ny cantar\u00e9 al que\r\nes mi luz y salvaci\u00f3n.\r\n\r\nSolo en ti vencer\u00e9,\r\nla monta\u00f1a subir\u00e9,\r\nsolo en ti danzar\u00e9,\r\ncon tu gozo vivir\u00e9.\r\n\r\nEres la vida de mi coraz\u00f3n,\r\nt\u00fa eres el centro\r\nde mi adoraci\u00f3n.\r\n\r\nSolo en ti vencer\u00e9,\r\nla monta\u00f1a subir\u00e9,\r\nsolo en ti danzar\u00e9,\r\ncon tu gozo vivir\u00e9.\r\n\r\nJes\u00fas", 5080014], ["Mi Confianza Est\u00e1 En Ti", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2017/08/13", "T\u00fa conoces cada deseo,\r\nt\u00fa me formaste eres mi due\u00f1o,\r\nsolo t\u00fa.\r\n\r\nNada me falta nada yo anhelo,\r\nsolo tu amor es lo que yo quiero,\r\nsolo t\u00fa.\r\n\r\nMi confianza est\u00e1 en ti,\r\nrodeado estoy por ti\r\nt\u00fa eres mi escudo.\r\n\r\nMi esperanza est\u00e1 en ti,\r\nmi futuro mi existir,\r\nen ti yo vivo seguro.\r\n\r\n//Oooh, oooh, t\u00fa eres mi escudo\r\nOooh, oooh, en ti yo vivo seguro.//", 5090015], ["Con Humildad", "Coalo Zamorano", "Cosas Poderosas", "2017/08/20", "Con humildad y sencillez\r\na ti Se\u00f1or me acercar\u00e9,\r\nes por tu amor, que soy feliz\r\npara decir con todo mi coraz\u00f3n.\r\n\r\nTe amo a ti,\r\ny no hay m\u00e1s que decir,\r\nmi vida es la prueba de mi amor\r\npor ti.\r\n\r\nTe amo a ti,\r\ny no hay m\u00e1s que decir\r\nmi vida es la prueba de mi amor\r\npor ti.\r\n", 5090016], ["Tengo La Gloria", "Varios", "El Volver\u00e1", "2017/08/27", "Tengo la gloria, la gloria de Cristo\r\ntengo el poder, el poder de su amor\r\nmuerto al pecado, crucificado\r\nsoy justificado en Cristo Jes\u00fas\r\n\r\nYa no soy esclavo al pecado\r\nya no m\u00e1s atado al pasado\r\nya no vivo yo, sino Cristo en m\u00ed\r\nsoy nueva criatura\r\n\r\nEn Jes\u00fas yo soy libertado\r\nvivir\u00e9 bajo su gracia\r\nandar\u00e9 en \u00e9l, solo a \u00e9l servir\u00e9\r\nsoy nueva criatura", 4050021], ["En Secreto", "Generaciones", "Proclamar\u00e9 Tu Amor 2", "2017/08/27", "En secreto en mi soledad \r\nyo te hablo t\u00fa ah\u00ed est\u00e1s,\r\nen secreto, en silencio \r\nte esperar\u00e9, solo a ti \r\nquiero conocerte m\u00e1s \r\n\r\nQuiero conocerte, \r\nquiero escuchar tu voz \r\nquiero conocerte m\u00e1s,\r\nquiero tocarte\r\nquiero tu rostro ver \r\nquiero conocerte m\u00e1s \r\n\r\nY procuro el premio mayor \r\nque me quieras entregar \r\ny prosigo dejo todo peso atr\u00e1s \r\nlejos de m\u00ed,\r\nquiero conocerte m\u00e1s.", 5070014], ["Soy Nueva Criatura", "Jes\u00fas Adri\u00e1n Romero", "Cerca De Ti", "2017/08/27", "Soy nueva criatura\nlo declara la escritura,\r\n\u00e9l me ha perdonado\ncon su sangre me ha lavado,\r\ntodos mis pecados\ncon su sangre son borrados\nlibre soy del pecado\r\n\r\nLibre del pecado y la maldad\r\nsoy libre \u00e9l ha roto mis cadenas\r\nlibre, libre para dar mi vida\nal que me salv\u00f3", 7160011], ["Desde mi Interior", "Hillsong United", "Unidos Permanecemos", "2017/08/27", "A veces te fall\u00e9,\r\nmas t\u00fa fuiste fiel, \r\ntu gracia me levant\u00f3\r\nme basta tu amor.\r\n\r\nDios eterno,\r\ntu luz por siempre brillar\u00e1\r\ny tu gloria,\r\nincomparable sin final.\r\n\r\nDe mi coraz\u00f3n\r\nte doy el control,\r\nconsume mi interior, Dios.\r\n\r\nJusticia y amor,\r\nme abrazan, Se\u00f1or.\r\nTe amo desde mi interior.\r\n\r\nSe\u00f1or, tu voluntad\r\npermanecer\u00e1. \r\nEn ti me quiero perder\r\nen adoraci\u00f3n.\r\n\r\nDios eterno,\r\ntu luz por siempre brillar\u00e1\r\ny tu gloria,\r\nincomparable sin final.\r\n\r\nEl clamor de mi ser\r\nes contigo estar.\r\nDesde mi interior\r\nmi alma clamar\u00e1.", 5719570367119360], ["Me has llamado a conocerte", "Marcos Witt", "Enciende Una Luz", "2017/08/27", "Me has llamado a conocerte, \r\nme has llamado a amarte m\u00e1s, Jes\u00fas.\r\n\r\nMe has llamado a obedecerte \r\ny a vivir en santidad, Jes\u00fas.\r\n\r\n\nNo quieres sacrificios, \r\nholocaustos nada son, Jes\u00fas.\r\n Lo que quieres es mi vida \r\ny tambi\u00e9n mi coraz\u00f3n,\r\nte lo doy, te lo doy.\r\n\r\nHoy mi vida yo te ofrezco\r\ncomo ofrenda ante tus pies.\r\n\r\n\nMi coraz\u00f3n te entrego,\r\nt\u00f3malo mi Rey.\r\n Sin excusas ni reservas,\r\ntodo lo que soy te doy,\r\nT\u00fa eres quien ahora reina en mi coraz\u00f3n.", 5751530024075264], ["Con Voz De Mando", "Jes\u00fas Adri\u00e1n Romero", "Cerca De Ti", "2017/09/03", "Con voz de mando\r\ny con trompeta de Dios,\r\nen los confines\r\nde la tierra se oir\u00e1,\r\nla voz de el Se\u00f1or.\r\n\r\nLos muertos en Cristo\r\nde sus tumbas volver\u00e1n\r\ny los que vivimos\r\nen las nubes nos\r\nlevantar\u00e1, El Se\u00f1or.\r\n\r\nY en una nube\r\nnos encontrar\u00e1.\r\n\r\nY todo ojo\r\nentonces le ver\u00e1.\r\nAl cordero inmolado.\r\nA Jes\u00fas, El deseado.\r\n\r\nLe veremos tal cual es,\r\nen su gloria y su poder.\r\n", 70015], ["Al Estar Ante Ti", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2017/09/03", "Al estar ante Ti,\r\nadorando frente al mar de cristal.\r\nEntre la multitud \r\nen asombro all\u00ed me habr\u00e9 de postrar. \r\n\r\nY mi canto unir\u00e9,\r\na millones proclam\u00e1ndote Rey.\r\nY mi voz oir\u00e1s \r\nentre las multitudes cantar.\r\n\r\nDigno es el Cordero de Dios,\r\nel que fue inmolado en la cruz.\r\nDigno de la honra y el poder \r\nla sabidur\u00eda suya es.\r\n\r\nSalmos 150:1\n1 Aleluya. \r\n    Alabad a Dios en su santuario", 1070009], ["Te Coronamos", "Marco Barrientos", "Mu\u00e9strame Tu Gloria", "2017/09/03", "No hay nadie como t\u00fa, se\u00f1or,\r\nno hay quien pueda hacer\r\nlo que haces t\u00fa.\r\n\r\nJesucristo, eterno salvador,\r\ntodopoderoso, vencedor.\r\n\r\nTe coronamos,\r\neres se\u00f1or Jes\u00fas,\r\nrecibe adoraci\u00f3n.\r\n\r\nTe celebramos,\r\na la muerte t\u00fa venciste,\r\nvives, eterno se\u00f1or.\r\n\r\nEterno se\u00f1or Jes\u00fas.", 4050014], ["Gloria Y Honra", "Varios", "Ron Kenoly", "2017/09/03", "Gloria y honra,\r\ny alabanza\r\nal Anciano de D\u00edas den,\r\n\r\nCada naci\u00f3n,\r\ntoda creaci\u00f3n,\r\np\u00f3strense al eterno Rey.\r\n\r\nCielo y tierra declarar\u00e1n\r\ny ver\u00e1n tu gloria,\r\nen tu trono se postrar\u00e1n,\r\nunidos.\r\n\r\nSeas exaltado oh Dios,\r\ny tu reino nunca pasar\u00e1,\r\noh eterno Dios\r\n\r\nTu Reino oh Dios permanecer\u00e1,\r\nc\u00e1ntenle al eterno Rey,\r\nNada se compara a su majestad,\r\nc\u00e1ntenle al eterno Rey.", 7150014], ["Adorad Al Cordero", "Marco Barrientos", "Amanece", "2017/09/03", "En su gloria y majestad\r\ntoda creaci\u00f3n un d\u00eda lo ver\u00e1.\r\nSu esplendor y santidad\r\ncubrir\u00e1n el cielo y la tierra.\r\n\r\nSe oir\u00e1n \u00e1ngeles cantar,\r\nsonar\u00e1 un coro celestial.\r\n\r\nAdorad al cordero inmolado\r\ntoda humanidad\r\ndelante de \u00e9l, postrados, voces cantar\u00e1n\r\nsanto Dios, santo Dios, santo Dios.\r\n\r\nCielo y tierra pasar\u00e1n,\r\nJesucristo permanecer\u00e1 \r\ncuando \u00e9l venga mostrar\u00e1\r\na todo el mundo que \u00e9l es sin igual.", 5643365030821888], ["Here I Am To Worship", "Hillsong", "Hope", "2017/09/10", "T\u00fa luz del mundo\r\nbajaste a tinieblas\r\ny ciego ya no fui m\u00e1s.\r\n\r\nMi coraz\u00f3n t\u00fa\r\nlo tocaste\r\ny junto a ti quiero estar.\r\n\r\nVengo adorarte,\r\nvengo a postrarme,\r\nvengo a decir \r\nque eres mi Dios.\r\n\r\nCompletamente bueno,\r\ntotalmente digno \r\ntan maravilloso para m\u00ed.\r\n\r\nRey para siempre\r\nen lo alto te exalto\r\ntoda la gloria a ti.\r\n\r\nEn humildad \r\na la tierra viniste\r\ncon tu amor y bondad.\r\n\r\nTanto me am\u00f3,\r\nque sufri\u00f3 y muri\u00f3 \r\npor mi pecado en la cruz.", 2110007], ["Grande Eres T\u00fa", "Varios", "Omar Oropesa", "2017/09/10", "Queremos darte gloria\r\ny alabanza,\r\nlevantamos nuestras manos,\r\nexalt\u00e1ndote Se\u00f1or.\r\n\r\nGrande eres t\u00fa,\r\ngrandes tus milagros son\r\n//No hay otro como t\u00fa//", 6110013], ["Eres Suficiente", "Danilo Montero", "Devoci\u00f3n", "2017/09/10", "Busqu\u00e9 tesoros que no llenaban,\r\nemociones que no se quedaban,\r\nsolo estar contigo\r\nes lo que satisface mi alma.\r\n\r\nVeo en la cruz mi culpa pagada,\r\nes por tu voz que encuentro la calma,\r\nsolo estar contigo\r\nes lo que satisface mi alma.\r\n\r\nEres suficiente para mi vida, \r\ndevoci\u00f3n, pasi\u00f3n y mi alegr\u00eda \r\nsolo t\u00fa, solo t\u00fa,\r\nJes\u00fas.\r\n\r\nSolo t\u00fa,\r\neres mi pasi\u00f3n,\r\neres mi devoci\u00f3n.", 6120013], ["T\u00fa Eres Lo Mejor", "Varios", "Pablo Sierra", "2017/09/10", "Tu amor cambi\u00f3 toda mi vida\r\nme diste el perd\u00f3n,\r\nJes\u00fas, sanaste mis heridas\r\ntu poder me salv\u00f3.\r\n\r\nQuiero entregarme hoy\r\nrendirme entero a ti,\r\nquiero dar lo mejor\r\nen ti yo soy feliz.\r\n\r\nNo hay nadie como t\u00fa,\r\nquien te comparar\u00e1,\r\nt\u00fa reinas por la eternidad,\r\nt\u00fa eres lo mejor.\r\n\r\nAlto y sublime Dios,\r\nsentado en tu trono de luz,\r\nt\u00fa reinas por la eternidad,\r\nt\u00fa eres lo mejor.", 5184131021406208], ["A Ti Sea La Gloria", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2017/09/17", "Al Rey de Reyes,\r\nSe\u00f1or de Se\u00f1ores,\r\nhoy te rendimos adoraci\u00f3n.\r\n\r\nComo una ofrenda,\r\na ti levantamos,\r\nun coraz\u00f3n lleno de pasi\u00f3n.\r\n\r\nPor aquel\r\nque nos salv\u00f3.\r\n\r\nA ti sea la gloria,\r\npor todos los siglos,\r\nte exalten los pueblos\r\ncada naci\u00f3n.\r\n\r\nQue toda la tierra,\r\nproclame tu nombre,\r\nCristo Jes\u00fas eres el Se\u00f1or\r\nAm\u00e9n.\r\n\r\nAl Rey de Reyes,\r\nSe\u00f1or de Se\u00f1ores,\r\nhoy te rendimos adoraci\u00f3n.\r\n\r\nComo una ofrenda,\r\na ti levantamos,\r\nun coraz\u00f3n lleno de pasi\u00f3n.\r\n\r\nPor aquel\r\nque nos salv\u00f3.\r\n\r\nA ti sea la gloria,\r\npor todos los siglos,\r\nte exalten los pueblos\r\ncada naci\u00f3n.\r\n\r\nQue toda la tierra,\r\nproclame tu nombre,\r\nCristo Jes\u00fas eres el Se\u00f1or\r\nAm\u00e9n.\r\n\r\nDios maravilloso,\r\noh, Rey majestuoso,\r\nhoy te ofrezco mi adoraci\u00f3n.\r\n\r\nExalto tu nombre,\r\ndeclaro eres digno,\r\nCordero Inmolado,\r\neres el Se\u00f1or.\r\n\r\nA Ti sea la gloria,\r\npor todos los siglos,\r\nte exalten los pueblos\r\ncada naci\u00f3n.\r\n\r\nQue toda la tierra,\r\nproclame Tu nombre,\r\nCristo Jes\u00fas eres el Se\u00f1or\r\nAm\u00e9n.\r\n\r\n", 2110009], ["Mes\u00edas Mi Salvador", "Marcos Witt", "Preparad El Camino", "2017/09/17", "Mes\u00edas mi salvador \r\neres t\u00fa el Gran YO SOY \r\nla raz\u00f3n de mi vivir.\r\n\r\nBondadoso justificador \r\nderramaste sobre m\u00ed\r\nde tu dulce y tierno amor.\r\n\r\nJes\u00fas \r\nmi Se\u00f1or \r\nrecibe mi adoraci\u00f3n\r\nque fluye de mi coraz\u00f3n \r\n\r\nJes\u00fas\r\nmi Se\u00f1or \r\nde la abundancia de mi ser \r\nte ministro hijo de Dios \r\n", 4040018], ["Aleluya, Jes\u00fas Vivo Est\u00e1", "Varios", "Ron Kenoly", "2017/09/17", "Un domingo en la ma\u00f1ana, Jes\u00fas resucit\u00f3\r\nrompi\u00f3 la maldici\u00f3n en m\u00ed y a la muerte derrot\u00f3\r\nahora un nuevo d\u00eda empieza y un reino que es eterno\r\nAleluya, aleluya\r\n\r\nAleluya, Jes\u00fas vivo est\u00e1\r\nla tumba venci\u00f3 \r\ncon poder resucit\u00f3 \r\n\u00c9l vive para siempre \r\n//Vivo est\u00e1//\r\n\r\n\u00c9l es alfa y omega \r\nprincipio y final\r\nsu trono es para siempre \r\nsuya es toda potestad,\r\n\u00c9l vive para siempre,\r\n//Vivo est\u00e1//\r\n\r\n\u00c9l descendi\u00f3 y del Hades tom\u00f3 el control\r\nal diablo derrot\u00f3 ante todos lo humill\u00f3 \r\nla muerte ya no reina \r\npues la tumba vac\u00eda est\u00e1\r\n//Aleluya//\r\n\r\nDios Poderoso \r\nen majestad est\u00e1\r\na ti sea toda la gloria \r\neres Pr\u00edncipe de Paz\r\ny tu reino es eterno\r\n//Vivo est\u00e1//", 5744863563743232], ["M\u00e1s Que Palabras", "Marcos Witt", "Enciende Una Luz", "2017/09/24", "Quiero expresar mi gratitud \r\na Ti que me has dado todo, \r\nuna oraci\u00f3n no bastar\u00eda \r\nni el tiempo de toda una vida, \r\nporque es m\u00e1s que palabras \r\ny es m\u00e1s que una canci\u00f3n. \r\n\r\nQuiero vivir agradecido \r\nen todo lo que soy, \r\nque haya siempre la pasi\u00f3n \r\nde amarte con mi vida entera,\r\nporque es m\u00e1s que palabras,\r\ny es m\u00e1s que una canci\u00f3n.", 2110010], ["Tu Eres Rey", "Danilo Montero", "Eres T\u00fa", "2017/09/24", "Cu\u00e1n asombrosas, son Dios tus obras \r\nNadie como T\u00fa, nadie como T\u00fa\r\nTe proclamamos, Rey soberano \r\nNadie como T\u00fa, nadie como T\u00fa\r\n\r\nPorque grandes son tus obras,\r\ngrande es tu poder \r\nEl cielo y la tierra y debajo de ella \r\nDeclaran: T\u00fa eres Rey \r\n\r\nT\u00fa eres Rey, T\u00fa eres Rey \r\nT\u00fa eres Rey, T\u00fa eres Rey ", 5100014], ["Jes\u00fas, Eres Mi Buen Pastor", "Marcos Witt", "Enciende Una Luz", "2017/09/24", "Cerca de ti\r\nyo puedo estar,\r\npara escuchar tu voz\r\ny aprender de ti.\r\n\r\nPuedo ser un reflejo\r\nde tu amor,\r\nyo puedo vivir\r\nsolo en tu voluntad.\r\n\r\nJes\u00fas eres mi buen pastor \r\ntu conoces mi camino.\r\nJes\u00fas puedo confiar en ti\r\noh mi Dios me rindo hoy. ", 6140012], ["Dios Es Amor", "Hillsong United", "Otros", "2017/09/24", "Todo ser, todo coraz\u00f3n,\r\ntoda lengua, toda naci\u00f3n,\r\nhalla fuerza en\r\nel amor del Padre.\r\n\r\nTodo el mundo se postrar\u00e1,\r\nsu mirada levantar\u00e1,\r\na Jes\u00fas salvador hoy y siempre.\r\nEsto es amor. \r\n\r\nJes\u00fas vino, \u00e9l muri\u00f3 y resucit\u00f3.\r\nAlab\u00e9mosle, nos dio la salvaci\u00f3n,\r\nno existe m\u00e1s temor.\r\nDios es amor,\r\nDios es amor. \r\n\r\nCada vida que est\u00e1 en dolor,\r\ncada l\u00e1grima y oraci\u00f3n,\r\nhalla fuerza en\r\nel amor del Padre. \r\n\r\nSu alabanza declarar\u00e9,\r\ntoda gloria ofrecer\u00e9\r\na Jes\u00fas Salvador hoy y siempre.\r\nEsto es amor. \r\n\r\nJes\u00fas vino, \u00c9l muri\u00f3 y resucit\u00f3.\r\nAlab\u00e9mosle, nos dio la salvaci\u00f3n,\r\nno existe m\u00e1s temor.\r\nDios es amor,\r\nDios es amor. \r\n\r\nCantar\u00e9 hoy y por siempre,\r\nde su gracia y su perd\u00f3n.\r\nLa creaci\u00f3n hoy y por siempre,\r\ncantar\u00e1 de su amor. \r\n\r\nEsto es amor. \r\n\r\nJes\u00fas vino, \u00c9l muri\u00f3 y resucit\u00f3.\r\nAlab\u00e9mosle, nos dio la salvaci\u00f3n,\r\nno existe m\u00e1s temor.\r\nDios es amor,\r\nDios es amor.\r\n\r\n", 5654153720233984], ["This is living", "Hillsong Young & Free", "Youth Revival", "2017/09/24", "Me despierto con un motivo,\r\ncaminar junto a ti ,\r\nhe decidido vivir\r\nmi vida contigo.\r\n\r\nMe levantas con nuevas fuerza\r\ny me das libertad,\r\nsoy joven por siempre en ti,\r\nt\u00fa eres mi fuente.\r\n\r\nComo el sol brillando \r\nen majestad,\r\nen color transform\u00f3 la oscuridad,\r\nnuevo soy, encontr\u00e9 mi identidad,\r\nvida t\u00fa me das.\r\n\r\nT\u00fa me gu\u00edas en cada paso,\r\nsuficiente es tu amor,\r\nno existe mejor decisi\u00f3n,\r\nque darte mi vida se\u00f1or.\r\n\r\nTu amor me lleva mucho m\u00e1s all\u00e1 \r\nde lo que yo pueda imaginar ,\r\na tu libertad yo puedo entrar,\r\neres todo lo que quiero y m\u00e1s.", 5742115992633344], ["Por Qui\u00e9n Eres T\u00fa", "Coalo Zamorano", "Cosas Poderosas", "2017/10/01", "Por quien eres T\u00fa te doy la gloria\r\nPor quien eres T\u00fa te doy  mi amor\r\nPor quien eres T\u00fa\r\nhoy levantar\u00e9  mi voz\r\n//Y te adorar\u00e9 por quien eres  T\u00fa//\r\n\r\nJehov\u00e1 Jireh, eres qui\u00e9n provee,\r\nJehov\u00e1 Nissi, T\u00fa peleas por m\u00ed,\r\nJehov\u00e1 Shalom, mi Pr\u00edncipe de paz,\r\nY te adorar\u00e9 por quien eres T\u00fa", 3090010], ["No A Nosotros", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2017/10/01", "Es por Ti,\r\nque juntos hoy estamos aqu\u00ed\r\nfue tu amor,\r\nque de la oscuridad nos sac\u00f3.\r\n\r\nA una voz,\r\nvenimos hoy delante de Ti,\r\npara darte el honor.\r\n\r\nNo a nosotros oh Dios,\r\nsino a tu nombre sea dada la Gloria.\r\nNo a nosotros oh Dios,\r\nsino a tu nombre sea dada la Gloria.\r\n\r\nNo a nosotros oh Dios (Oh, no),\r\nsino a tu nombre sea dada la Gloria.\r\n\r\nEres T\u00fa,\r\nmotivo de nuestra adoraci\u00f3n.\r\nLa verdad,\r\nque nuestro coraz\u00f3n liber\u00f3.\r\n\r\nNadie m\u00e1s,\r\nes digno del honor recibir,\r\nte lo damos a Ti.\r\n\r\nSi no ha Tu nombre sea dada la Gloria\r\n//a Tu nombre sea dada la gloria//\r\na Tu nombre sea dada la gloria", 3100012], ["Dios De Pactos", "Marcos Witt", "Dios De Pactos", "2017/10/01", "Dios de pactos,\r\nque guardas tus promesas, \r\nque cumples tu palabra,\r\nque gu\u00edas mi destino.\r\n\r\nDios de pactos,\r\nconf\u00edo en tus promesas,\r\ndescanso en tu palabra,\r\npor tu gracia estoy aqu\u00ed.\r\n\r\nEn la intimidad, \r\nal abrigo de tu gloria\r\npuedo estar, junto a ti.\r\n\r\nAl ver tu santidad,\r\nestoy maravillado\r\nante ti y tu amor. \r\n\r\nNunca m\u00e1s ser\u00e9 igual,\r\npor estar en el Sant\u00edsimo Lugar.\r\n\r\nDios de pactos,\r\nque guardas tus promesas, \r\nque cumples tu palabra,\r\nque gu\u00edas mi destino.\r\n\r\nDios de pactos,\r\nconf\u00edo en tus promesas,\r\ndescanso en tu palabra,\r\npor tu gracia estoy aqu\u00ed.\r\n\r\nTengo redenci\u00f3n,\r\npor la sangre que descansa\r\nen tu altar para m\u00ed.\r\n\r\nPor la gracia y el perd\u00f3n,\r\nahora puedo yo vivir\r\nen comuni\u00f3n y adoraci\u00f3n.\r\n\r\nNunca m\u00e1s ser\u00e9 igual, \r\npor estar en el Sant\u00edsimo Lugar.\r\n", 6140013], ["Preparad El Camino", "Marcos Witt", "Preparad El Camino", "2017/10/01", "Escuchen los collados\r\nel valle y la ciudad\r\nEscuche toda senda\r\nel mensaje de Jehov\u00e1\r\n\r\nLa hora ha llegado\r\nel mensajero alz\u00f3 su voz\r\nProclama en el desierto\r\nla palabra del Se\u00f1or\r\n\r\nPreparad el camino,\r\nha venido el Salvador\r\nEl Mes\u00edas prometido\r\nIsaias lo anunci\u00f3\r\n\r\nPreparad el camino,\r\nla Palabra se cumpli\u00f3\r\nLa luz en las tinieblas\r\ncon Jes\u00fas resplandeci\u00f3\r\n\r\nPreparad el camino,\r\nal ungido del Se\u00f1or\r\nLa sombra de la muerte\r\nno tendr\u00e1 mas el control\r\n\r\nPreparad el camino,\r\nsacrificios ya no habr\u00e1\r\nSu sangre para siempre\r\nlimpiar\u00e1 nuestra maldad\r\n\r\nEnderezad sus sendas\r\ntodo valle rellenad\r\nallanen todo monte\r\nel Se\u00f1or caminar\u00e1\r\n\r\nCaminos de justicia\r\nmostrara con su perd\u00f3n\r\nlos padres y los hijos\r\nvolver\u00e1n su coraz\u00f3n", 6300001], ["Correremos", "Hillsong United", "Mi Roca", "2017/10/01", "Preparados para salir, \r\nviendo lo que \r\nest\u00e1 por venir.\r\n\r\nTu nombre todos\r\nproclamaran,\r\nel d\u00eda\r\npronto  llegar\u00e1,\r\nno vamos a parar.\r\n\r\nMi pasado \r\natr\u00e1s dejar\u00e9,\r\nnada me \r\npodr\u00e1 contener.\r\n\r\nLo que quedar\u00e1\r\nser\u00e1 una pasi\u00f3n,\r\nque arde \r\nen mi coraz\u00f3n,\r\nno vamos a parar.\r\n\r\nCorreremos,\r\npuestos nuestros\r\nojos en ti.\r\n\r\nCorreremos,\r\nas\u00ed como t\u00fa,\r\nnosotros nos vemos.\r\n\r\nCada paso \r\ntomo en fe,\r\npor tu gracia\r\ncaminar\u00e9.\r\n\r\nLa cruz \r\nyo cargar\u00e9,\r\na ti te seguir\u00e9,\r\ntodo por ti \r\nlo dar\u00e9.\r\n\r\nNo vamos\r\na parar.\r\n\r\nCorreremos,\r\npuestos nuestros\r\nojos en ti.\r\n\r\nCorreremos,\r\nas\u00ed como t\u00fa,\r\nnosotros nos vemos.\r\n\r\nSiempre tu \r\nluz nos guiar\u00e1,\r\nqueremos conocerte,\r\nm\u00e1s y m\u00e1s.\r\n\r\nY a los perdidos\r\nacercar,\r\na tu amor.\r\n\r\nCorreremos,\r\npuestos nuestros\r\nojos en ti.\r\n\r\nCorreremos,\r\nas\u00ed como t\u00fa,\r\nnosotros nos vemos.", 8170001], ["Eres Todo Poderoso", "Danilo Montero", "Eres Todopoderoso", "2017/10/08", "La \u00fanica raz\u00f3n de mi adoraci\u00f3n,\r\neres tu mi  Jes\u00fas.\r\nEl \u00fanico motivo para vivir\r\neres tu mi se\u00f1or.\r\n\r\nMi \u00fanica verdad esta en  ti\r\neres mi luz y mi salvaci\u00f3n.\r\nMi \u00fanico amor eres tu se\u00f1or\r\ny por siempre te alabar\u00e9.\r\n\r\nTu eres todo poderoso\r\neres grande y majestuoso.\r\nEres fuerte,  invencible\r\ny no hay nadie como T\u00fa.", 4040017], ["Es Grande", "Danilo Montero", "Fortaleza", "2017/10/08", "Cada ma\u00f1ana \r\nen mi ventana \r\nyo veo tu luz\r\nque ilumina mi ser.\r\n\r\nY cada d\u00eda,\r\ntu misericordia\r\nnueva es.\r\n\r\nY me recuerda\r\nque tu fidelidad, que tu fidelidad,\r\nEs Grande Dios.\r\n\r\nAl ver las estrellas\r\ny las arenas de la mar,\r\nse que T\u00fa sabes\r\ncuantas son.\r\n\r\nCada cabello \r\nen mi cabeza\r\ncontaste Se\u00f1or.\r\n\r\nMe has demostrado,\r\nque tu perfecto amor, que tu perfecto amor,\r\nEs Grande Dios.\r\n\r\nQuiero proclamar\r\ntu gran amor \r\npor la ma\u00f1ana.\r\n \r\n\r\nY por la noche declarar,\r\nque tu fidelidad, que tu fidelidad,\r\nEs Grande Dios.\r\n\r\nNo hay nada como alabarte,\r\nno hay nada como adorarte,\r\nno hay nada como alabarte Dios,\r\nno hay nadie como T\u00fa.\r\n ", 4050020], ["Eres Mi Todo", "Varios", "Daniel Calveti", "2017/10/08", "Como no he de alabarte, Jes\u00fas,\r\nfuiste T\u00fa el que moriste\r\npor m\u00ed en la cruz.\r\nGrande es T\u00fa misericordia, Se\u00f1or.\r\n\r\nCada d\u00eda despierto y ah\u00ed est\u00e1s T\u00fa,\r\nno te veo pero siempre siento T\u00fa amor,\r\nsolo vengo a decirte, mi Jes\u00fas.\r\n\r\nEres mi todo,\r\neres mi amigo,\r\neres el sue\u00f1o por el que vivo.\r\n\r\nEl que mi abraza,\r\nel que me cuida,\r\neres T\u00fa.\r\n", 6140003], ["En Ti", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2017/10/08", "En Ti conf\u00eda mi coraz\u00f3n\r\nEn Ti reposa mi alma\r\nMi ser descansa en Ti\r\ny puedo ser feliz.\r\n\r\nPorque s\u00e9 que est\u00e1s obrando\r\ntu perfecta voluntad\r\nY en mi vida est\u00e1s obrando\r\nTu perfecta voluntad", 5745865499082752], ["Dios Incomparable", "Varios", "Miel San Marcos", "2017/10/08", "Dios de mi coraz\u00f3n,\r\nen ti encontr\u00e9 mi salvaci\u00f3n.\r\n\r\nTu gloria y majestad,\r\nquiero siempre contemplar.\r\n\r\nT\u00fa eres mi adoraci\u00f3n,\r\ny mi eterna canci\u00f3n.\r\n\r\nTodo mi interior,\r\nes cautivado por tu amor.\r\n\r\nEres Dios eterno,\r\nsolo t\u00fa eres bueno.\r\nDios incomparable eres t\u00fa.\r\n\r\nNunca me separar\u00e9\r\nde tu gran amor.\r\nEres mi Se\u00f1or mi Salvador.\r\n\r\nAleluya, aleluya.", 5761253830033408], ["Desde El Cielo", "Danilo Montero", "Devoci\u00f3n", "2017/10/22", "Desde el cielo\r\nhasta una cruz.\r\nDe tu trono\r\na mi coraz\u00f3n.\r\n\r\nSiendo ciego\r\nyo vi tu luz.\r\nSoy tu ciervo\r\ny T\u00fa, mi Se\u00f1or.\r\n\r\nEterno amor, \r\nte entregaste.\r\nMe rindo hoy \r\npara adorarte.\r\n\r\nEterno amor, eterno amor,\r\nte entregaste.\r\nMe rindo hoy, me rindo hoy,\r\npara adorarte.", 7140013], ["Vivo Para Cristo", "Varios", "Juan Carlos Alvarado", "2017/10/22", "Tu mano me sostiene,\r\ntu esp\u00edritu me alienta\r\ny siempre en victoria\r\nT\u00fa me llevar\u00e1s.\r\n\r\nVivo solo para Cristo\r\ny nadie m\u00e1s.\r\nSolo en Jes\u00fas\r\nyo encontr\u00e9 la paz.\r\n\r\n\u00c9l me llena\r\nde su esp\u00edritu\r\nde amor,\r\nsiempre cantar\u00e9\r\nsoy m\u00e1s que vencedor.\r\n", 7150016], ["Oh Se\u00f1or", "Varios", "Marcos Vidal", "2017/10/22", "Oh Se\u00f1or cuan innumerables son tus obras,\r\nhas hecho todas ellas con sabidur\u00eda,\r\naun el sol y los astros cuentan tus verdades,\r\nme gozo al saber que soy tu hijo hoy.\r\n\r\nT\u00fa eres mi Dios, te alabar\u00e9,\r\nT\u00fa me has hecho hijo\r\ntuyo yo te alabar\u00e9.\r\n\r\nT\u00fa eres mi Dios, te alabar\u00e9,\r\nT\u00fa me has hecho una nueva criatura\r\neres mi padre yo te alabar\u00e9\r\n\r\n\r\nNada puede igualar tu grandeza, dependemos\r\nde tu se\u00f1or\u00edo, en ti espera mi vida, mi\r\nraz\u00f3n mi alegr\u00eda eres Tu Oh Se\u00f1or.", 7160009], ["Nuestro Fruto", "Marco Barrientos", "Gozo En Tu Presencia", "2017/10/22", "Volver\u00e1n trayendo sus ofrendas\r\nante el trono celestial\r\nVolver\u00e1n con gozo y alabanza\r\na quien por siempre reinar\u00e1\r\n\r\nLlenos de agradecimiento\r\nhoy venimos a rendirte adoraci\u00f3n\r\n\r\nNuestro fruto ofrecemos\r\ny con gozo lo entregamos hoy\r\nNuestra ofrenda agradable\r\nla rendimos en adoraci\u00f3n", 7160012], ["M\u00e1s Dulce", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2017/10/29", "Cada d\u00eda contigo \r\nes m\u00e1s dulce que ayer.\r\n\r\nTe alabar\u00e9 cada ma\u00f1ana \r\ny al atardecer tambi\u00e9n,\r\npues cada d\u00eda aqu\u00ed contigo \r\nes m\u00e1s dulce que ayer.\r\n\r\nQue honor es poder yo conocerte \r\ny ser amado por tu amor,\r\nque alegr\u00eda es cantarte y alabarte \r\ncon un nuevo coraz\u00f3n .\r\n\r\nDesde el amanecer \r\nhasta el anochecer.\r\n\r\nCada d\u00eda contigo \r\nes m\u00e1s dulce que ayer.\r\nCada d\u00eda contigo \r\nes m\u00e1s dulce que ayer.\r\n\r\nTe alabar\u00e9 cada ma\u00f1ana \r\ny al atardecer tambi\u00e9n,\r\npues cada d\u00eda aqu\u00ed contigo \r\nes m\u00e1s dulce que ayer .\r\n\r\nOh que grande es vivir si \r\nes vivir en la victoria que hay en ti \r\ny entregar cada d\u00eda todo el d\u00eda \r\nla canci\u00f3n que hay en m\u00ed.\r\n\r\nDesde el amanecer \r\nhasta el anochecer.\r\n\r\nQuiero estar cada d\u00eda contigo\r\nPorque hoy es m\u00e1s dulce que ayer .", 6120014], ["Esta es mi canci\u00f3n", "Generaciones", "Proclamar\u00e9 Tu Amor 2", "2017/10/29", "En mi coraz\u00f3n, hay una canci\u00f3n\r\nes la que canto hoy\r\nT\u00fa eres mi amigo, mi \u00fanico Dios\r\nanhelo estar contigo\r\n\r\nT\u00fa me cuidar\u00e1s y me guiar\u00e1s\r\na conocerte m\u00e1s\r\nT\u00fa eres mi Padre y yo soy tu hijo\r\nanhelo estar contigo\r\n\r\nCon mi voz yo cantare\r\ncon mis manos te alabare\r\nCon mis pies yo saltare\r\n\r\n//\u00c9sta es mi canci\u00f3n\r\nwo oh wo wo ooh//\r\n\u00c9sta es mi canci\u00f3n\r\n\r\nEres el amor de mi coraz\u00f3n\r\nte entrego lo que soy\r\nMi Salvador, mi Redentor\r\nno hay nadie como T\u00fa\r\n\r\nT\u00fa me cuidar\u00e1s y me guiar\u00e1s\r\na conocerte m\u00e1s\r\nT\u00fa eres mi Padre y yo soy tu hijo\r\nanhelo estar contigo\r\n\r\nCon mi voz yo cantare\r\ncon mis manos te alabare\r\nCon mis pies yo saltare\r\n\r\n//\u00c9sta es mi canci\u00f3n\r\nwo oh wo wo ooh//\r\n\u00c9sta es mi canci\u00f3n", 5126690397224960], ["Forever", "Hillsong", "Migthy To Save", "2017/10/29", "Te adoro mi Se\u00f1or,\r\nsusurro mi canci\u00f3n.\r\nDesde mi coraz\u00f3n\r\npara Ti, mi padre y Rey.\r\n\r\nPor siempre cantar\u00e9\r\npara alegrar tu d\u00eda Dios\r\ny por la eternidad\r\ncontigo estar\u00e9 mi Dios.\r\n\r\nCu\u00e1n grande abres tus brazos\r\nhoy y me das tu amor \r\ncu\u00e1n lejos ir\u00e1s,\r\n\r\nSi desviado estoy\r\ndir\u00edas que me amas y\r\nmostraste ese amor\r\nal morir por m\u00ed en la cruz.\r\n\r\n//Te adoro mi Se\u00f1or//\r\n//Te amo//\r\nPor siempre cantar\u00e9.\r\nContigo siempre estar\u00e9, estar\u00e9.", 5631383682678784], ["Salmo 84", "Danilo Montero", "Devoci\u00f3n", "2017/10/29", "Es mi delicia,\r\nestar en tu casa.\r\nEncuentro refugio,\r\nbajo tus alas.\r\n\r\nDichosos te alaban,\r\nlos que contemplan,\r\ntu gloria, tu gloria.\r\n\r\nAnhelo,\r\ndeseo,\r\nme muevo,\r\npor estar contigo.\r\n\r\nTe busco,\r\nhoy puedo,\r\npermanecer,\r\ntoda mi vida aqu\u00ed.\r\n\r\nBuscar un momento,\r\nde tu sonrisa.\r\nVale m\u00e1s que un tesoro,\r\nm\u00e1s que una vida.\r\n\r\nDichosos te alaban,\r\nlos que contemplan,\r\ntu gloria, tu gloria.\r\n\r\nAnhelo,\r\ndeseo,\r\nme muevo,\r\npor estar contigo.\r\n\r\nTe busco,\r\nhoy puedo,\r\npermanecer,\r\ntoda mi vida aqu\u00ed.\r\n\r\nDichoso el que tiene en Ti,\r\nsu fortaleza,\r\ny en medio de la aflicci\u00f3n,\r\nrenuevas sus fuerzas,\r\nen Ti.", 5728757302165504], ["En Los Montes En Los Valles", "Marcos Witt", "Dios Es Bueno", "2017/11/05", "Oh oooh oh ooh\r\nOh oooh oh ooh\r\n\r\nEn los montes, en los valles,\r\nExaltamos al que es digno de alabanza\r\nEn las costas de los mares,\r\nLevantamos un sonido de esperanza\r\n\r\nAclamamos, aclamamos\r\nHacemos o\u00edr la voz de su alabanza\r\nCon las manos en lo alto\r\nExaltamos al que reina para siempre\r\n\r\nOh oooh oh ooh\r\nOh oooh oh ooh\r\n\r\nVen vamos a adorar a nuestro se\u00f1or\r\nEs el gozo de toda naci\u00f3n \r\nDonde la tristeza es gozo\r\nEl llanto es alegr\u00eda \r\nVen vamos a adorar al gran Rey", 70014], ["De D\u00f3nde Vendr\u00e1 Mi Socorro", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2017/11/05", "\u00bfDe d\u00f3nde vendr\u00e1,\r\nmi socorro?\r\n\u00bfDe d\u00f3nde, llegar\u00e1?\r\n\r\nMi socorro viene de ti, Dios,\r\ncreador del cielo y la tierra.\r\nMi socorro viene de ti, Dios,\r\nmi pronto auxilio en la tormenta.\r\n\r\nEl sol no me fatigar\u00e1,\r\ntu mano siempre me cuidar\u00e1,\r\nmi entrada y mi salida, t\u00fa guardar\u00e1s,\r\ndesde ahora y para siempre,\r\nahora y para siempre.\r\n\r\n//Mi socorro viene de ti, Dios,\r\ncreador del cielo y la tierra.\r\nMi socorro viene de ti, Dios,\r\nmi pronto auxilio en la tormenta// \r\n\r\n\u00bfDe d\u00f3nde vendr\u00e1,\r\nmi socorro?\r\nMi socorro viene de ti.", 7140012], ["Confiar\u00e9", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2017/11/05", "Corro a ti, t\u00fa eres mi refugio,\r\nt\u00fa me guardas, eres mi escudo.\r\nSolo en ti yo vivo bien seguro,\r\na tu lado yo caminar\u00e9.\r\n\r\nConfiar\u00e9, t\u00fa eres mi esperanza,\r\ncreer\u00e9, me das de tu confianza,\r\ncantar\u00e9, t\u00fa eres mi victoria,\r\nte exaltar\u00e9 a ti sea la gloria,\r\nJes\u00fas.\r\n\r\nPaso a paso t\u00fa me fortaleces,\r\ncon tu amor t\u00fa siempre \r\nme sostienes.\r\nTengo paz, t\u00fa eres mi ayuda,\r\neres luz que mi vida alumbra.\r\n\r\nSolo a ti,\r\nmi confianza est\u00e1 en ti,\r\nmi sue\u00f1o,\r\ntu anhelo, mi eterno consuelo\u00a0.", 7170013], ["Yo te prometo", "Alexis Pe\u00f1a", "Yo te prometo", "2017/11/05", "Al oir tu coraz\u00f3n\r\ny sentir tu palpitar\r\ntan peque\u00f1o y fr\u00e1gil eres\r\n\r\nPara m\u00ed eres tan bello\r\ncomo las olas del mar\r\ncomo el murmullo del viento\r\n\r\nEs que no puedo entender\r\npor que Dios a m\u00ed te conf\u00edo\r\npara que cuidara de ti\r\n\r\nEres t\u00fa\r\nmi regalo de Dios\r\nmi tierra que fluye leche y miel\r\nla promesa de Dios para m\u00ed\r\n\u00a1Gracias se\u00f1or!\r\n\r\nYo te prometo que lo cuidare\r\ny un reflejo tuyo ser\u00e1\r\nguiar\u00e9 sus pasos\r\nle ense\u00f1ar\u00e9 a caminar\r\ny con todas sus fuerzas ahh ahh\r\na tu nombre adorar\r\n\r\nOhh Ohh\r\n\r\n...\r\n\r\nEres t\u00fa\r\nmi regalo de Dios\r\nmi tierra que fluye leche y miel\r\nla promesa de Dios para m\u00ed\r\n\u00a1Gracias se\u00f1or!\r\n\r\nYo te prometo que lo cuidare\r\ny un reflejo tuyo ser\u00e1\r\nguiar\u00e9 sus pasos\r\nle ense\u00f1ar\u00e9 a caminar\r\ny con todas sus fuerzas ahh ahh\r\na tu nombre adorar\r\n\r\nOhh Ohh\r\na tu nombre adorar ahh ahh ahh\r\na tu nombre adorar \r\n\r\nYo le ense\u00f1ar\u00e9 que\r\nSolo t\u00fa eres Dios\r\nSus pasos yo guiar\u00e9\r\nA caminar le ense\u00f1ar\u00e9\r\nHacia ti mi Dios\r\nEn tus manos lo pondr\u00e9\r\nOoh Uuh Ooh", 5191485481811968], ["Para Ti", "Varios", "Juan Luis Guerra", "2017/11/05", "Oh, se\u00f1or Jes\u00fas con tu grandeza,\r\nHiciste los cielos y la tierra, \r\nLos r\u00edos, los mares, las estrellas,\r\nEres verbo y tu palabra es fuerza, todo lo puedes\r\n\r\nPara ti no hay nada imposible, para ti\r\nPara ti no hay mal ni tormenta, para ti\r\n\r\nNo hay problemas, ni enfermedades, para ti\r\nPara ti no hay nada imposible, para ti\r\n\r\nA No\u00e9 sacaste de las aguas, \r\nA Daniel libraste de las fieras,\r\nA Mois\u00e9s abriste el mar rojo, \r\nY Sara dio a luz a los noventa, todo lo puedes\r\n\r\nPara ti no hay nada imposible, para ti \r\nPara ti no hay mal ni tormenta, para ti\r\n\r\nNo hay problemas, ni enfermedades, para ti\r\nPara ti no hay nada imposible, para ti \r\n\r\nHiciste llover man\u00e1 del cielo,\r\nPan y peces t\u00fa multiplicaste,\r\nEl buen l\u00e1zaro resucit\u00f3,\r\nY un milagro para m\u00ed yo quiero, todo lo puedes\r\n\r\nPara ti no hay nada imposible, para ti \r\nPara ti no hay mal ni tormenta, para ti \r\n\r\nNo hay problemas, ni enfermedades, para ti\r\nPara ti no hay nada imposible, para ti \r\n\r\nNada imposible\r\n\r\nNo hay problemas ni enfermedades, \r\nNo hay divorcio ni droga en la calle, \r\nYa no hay c\u00e1ncer ni sida ni males,\r\nNo hay tormenta ni calamidades y todo lo puedes\r\n\r\nNada imposible\r\n\r\nPero no hay problemas ni enfermedades, \r\nNo hay divorcio ni droga en las calles,\r\n\r\nYa no hay c\u00e1ncer ni sida ni males,\r\nNo hay tormenta ni calamidades y todo lo puedes\r\n\r\nPara ti no hay nada imposible, para ti \r\nPara ti no hay mal ni tormenta, para ti\r\n\r\nNo hay problemas, ni enfermedades, para ti\r\nPara ti no hay nada imposible, para ti \r\n\r\nNada imposible", 5679846214598656], ["Cantar\u00e9 De Tu Amor Por Siempre", "Generaciones", "Proclamar\u00e9 Tu Amor", "2017/11/12", "Sobre los montes, sobre el mar,\r\nel r\u00edo de tu amor vendr\u00e1,\r\nmi coraz\u00f3n recibir\u00e1 tu sanidad, tu libertad.\r\n\r\nMe gozo estar en la verdad,\r\nmis manos quiero hoy alzar \r\ny de tu amor, tu gran amor \r\nquiero cantar.\r\n\r\nCantar\u00e9 de tu amor por siempre.\r\n\r\nHoy mi coraz\u00f3n levanto,\r\neres bueno, Padre Santo, \r\na ti salvador yo canto, \r\nde tu gran amor.", 1050017], ["Grandes Cosas Ha Hecho", "Marcos Witt", "Sana Nuestra Tierra", "2017/11/12", "Hoy podemos so\u00f1ar,\r\nhoy podemos re\u00edr.\r\n\u00c9l llen\u00f3 nuestra boca \r\nde alabanza.\r\n\r\nLas naciones dir\u00e1n,\r\nquien es como su Dios.\r\n\u00c9l llen\u00f3 nuestras vidas de gozo y danza.\r\n\r\n//Grandes cosas ha hecho el Se\u00f1or, \r\ngrandes cosas ha hecho el Se\u00f1or, \r\nnos alegraremos en \u00e9l, \r\nnos alegraremos en \u00e9l// \r\n\r\nHoy los pueblos sabr\u00e1n,\r\nCristo es el Se\u00f1or,\r\nen su nombre se encuentra\r\nla paz y la vida.\r\n\r\nHoy queremos cantar,\r\ncon regocijo gritar. \r\n\u00c9l nos dio una canci\u00f3n \r\nde refugio y gracia.\r\n\r\n\r\n\r\n//Grandes cosas ha hecho el Se\u00f1or \r\ngrandes cosas ha hecho el Se\u00f1or \r\nnos alegraremos en \u00e9l, \r\nnos alegraremos en \u00e9l// \r\n\r\nIr\u00e9 plantando con regocijo, \r\nir\u00e9 sembrando semilla de amor,\r\nir\u00e9 cantando de tu belleza,\r\ngrandeza eterna en Cristo Jes\u00fas.\r\n\r\nGrandes cosas ha hecho el Se\u00f1or, \r\ngrandes cosas ha hecho el Se\u00f1or,\r\nnos alegraremos en \u00e9l, \r\nnos alegraremos en \u00e9l.\r\n", 5080013], ["Tu Amor es Real", "Hillsong Young & Free", "Youth Revival", "2017/11/12", "Vuelvo a despertar\r\nal tus ojos mirar,\r\nlate mi coraz\u00f3n,\r\njunto a ti.\r\n\r\nNada te contendr\u00e1,\r\nni el cielo ni el mar,\r\nnada podr\u00e1 frenar \r\ntu amor.\r\n\r\nTu amor es real,\r\nnunca me fallar\u00e1,\r\nno fallar\u00e1.\r\n\r\nY de mi comprensi\u00f3n\r\nse escapa tu amor,\r\ntu gran amor.\r\n\r\nTu amor es real,\r\ntu amor es real.\r\n\r\nEst\u00e1s aqu\u00ed siempre tan cerca,\r\nllenas de vida mi coraz\u00f3n,\r\nen ti Jes\u00fas yo soy libre,\r\ntu amor es real,\r\ntu amor es real.\r\n\r\nEn tu coraz\u00f3n \r\nme encuentro,\r\nme encuentro,\r\nno me dejar\u00e1s,\r\nsoy tuyo,\r\nsoy tuyo.", 5145057824866304], ["Por m\u00ed muri\u00f3", "Hillsong United", "Otros", "2017/11/12", "La sangre de Jes\u00fas\r\nme redimi\u00f3\r\nme perdon\u00f3 y\r\nlibertad me dio\r\n\r\nTu majestad est\u00e1\r\ndentro de m\u00ed\r\nPor siempre creo en Ti\r\npor siempre creo en Ti\r\n\r\nMe inundas\r\ncon justicia, con tu amor\r\ntu gracia cautiv\u00f3\r\nmi coraz\u00f3n\r\n\r\nTu esp\u00edritu me gu\u00eda\r\na la verdad\r\nTu amor no fallar\u00e1\r\ntu amor no fallar\u00e1\r\n\r\nPor amor Dios dio\r\nsu hijo \u00fanico Jes\u00fas\r\nPor m\u00ed muri\u00f3,\r\nme dio esperanza y salvaci\u00f3n.\r\n\r\nEn mi lugar\r\nsu vida entreg\u00f3 en la cruz\r\nMe am\u00f3, me am\u00f3, a\u00fan sin merecerlo", 5701569219657728], ["\u00bfC\u00f3mo Puedo Callar?", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2017/11/12", "\u00bfC\u00f3mo puedo callar cuando me amas tanto? \r\n\u00bfC\u00f3mo puedo callar cuando siento tu amor?\r\n\r\n//Tu amor me envuelve como un torbellino// \r\n\r\nEs una revoluci\u00f3n,\r\ndel coraz\u00f3n que quema \r\ny me envuelve para amarte yo tambien a Ti.\r\n \r\n\r\nEs una revoluci\u00f3n del coraz\u00f3n.\r\nHas cambiado mi desierto por \r\nrios de agua viva.\r\n\r\n\u00bfC\u00f3mo puedo callar cuando me amas tanto? \r\n\u00bfC\u00f3mo puedo callar cuando siento Tu amor?\r\n\r\n//Tu amor me envuelve como un torbellino// ", 5701751084679168], ["Es Jes\u00fas", "Danilo Montero", "Cantar\u00e9 De Tu Amor", "2017/11/19", "Aqu\u00e9l\r\nque nos am\u00f3, \r\ntestigo fiel, \r\nexaltar\u00e9.\r\n\r\nAl que es \r\nprincipio y fin, \r\nal gran \"Yo Soy\", \r\nadorar\u00e9,\r\n\r\nA Jes\u00fas, mi Se\u00f1or, \r\nresplandor de la gloria de Dios,\r\na Jes\u00fas mi Gran Rey, \r\nalabanza y honra dar\u00e9.\r\n\r\nSiempre te amar\u00e9,\r\nsiempre te adorar\u00e9,\r\nsiempre te cantar\u00e9,\r\nsiempre te exaltar\u00e9.", 4150003], ["Te Alabo", "Danilo Montero", "S\u00edgueme", "2017/11/19", "Es la bendici\u00f3n \r\ndel saber porque \r\nestoy aqu\u00ed,\r\ncreado fui por ti,\r\n para estar as\u00ed ante ti \r\n////Te alabo////\r\n\r\nSentido diste t\u00fa,\r\nen aquella cruz al amor, \r\nte quiero entregar \r\ntodo lo que soy, decirte que \r\n////Te amo//// \r\n\r\nT\u00fa eres grande, oh Dios\r\ncu\u00e1n infinito eres, \r\nalfa y omega t\u00fa,\r\neterno siempre t\u00fa.\r\n\r\n////Te exalto//// \r\n////Te alabo//// \r\n////Te adoro//// \r\n////Te amo////", 6120015], ["Eres Rey de los Cielos", "Marco Barrientos", "Ilumina", "2017/11/19", "Glorioso Salvador,\r\ndivino Redentor.\r\nMe postrar\u00e9 ante Ti.\r\n\r\nBendito Hijo de Dios,\r\nhermoso Rey de Si\u00f3n.\r\nTe adorar\u00e9\r\ny as\u00ed declar\u00e9.\r\n\r\nEres Rey de los cielos,\r\neterno Dios exaltado por siempre,\r\nJes\u00fas Se\u00f1or,\r\nTu gobiernas en toda la creaci\u00f3n,\r\noh, cordero inmolado eres Se\u00f1or.\r\n\r\nLas naciones enteras\r\nse postrar\u00e1n\r\ny Tu nombre por siempre bendecir\u00e1n.\r\n\r\nPor los siglos Tu gloria nos llenar\u00e1\r\ny veremos Tu fuerza y majestad.\r\n", 5750790484393984], ["Dios Es Poderoso", "Hillsong United", "Mi Roca", "2017/11/19", "Poderoso,\r\nnunca fallar\u00e1,\r\nomnipotente Dios.\r\n\r\nM\u00e1s de lo que busqu\u00e9,\r\nm\u00e1s de lo que ped\u00ed,\r\ngrande es nuestro Dios.\r\n\r\n\u00c9l triunf\u00f3,\r\na la muerte venci\u00f3,\r\nvivo est\u00e1 \r\nes poderoso. \r\n\r\nEn Jes\u00fas \r\nsoy vencedor,\r\nnuestro Dios \r\nes poderoso.\r\n\r\nDios me gu\u00eda,\r\n\u00c9l conmigo est\u00e1, \r\nun camino har\u00e1.\r\n\r\nM\u00e1s de lo que so\u00f1\u00e9,\r\nm\u00e1s de lo que esper\u00e9,\r\ngrande es nuestro Dios.\r\n \r\nEl triunf\u00f3,\r\na la muerte venci\u00f3,\r\nvivo est\u00e1 \r\nes poderoso. \r\n\r\nEn Jes\u00fas \r\nsoy vencedor,\r\nnuestro Dios \r\nes Poderoso.\r\n\r\nDios me gu\u00eda,\r\n\u00c9l conmigo est\u00e1. \r\nUn camino har\u00e1.\r\n\r\nM\u00e1s de lo que so\u00f1\u00e9,\r\nm\u00e1s de lo que esper\u00e9.\r\nGrande es nuestro Dios \r\n\r\nEl triunf\u00f3,\r\na la muerte venci\u00f3.\r\nVivo est\u00e1 \r\nes poderoso. \r\n\r\nEn Jes\u00fas \r\nsoy vencedor.\r\nNuestro Dios \r\nes Poderoso.\r\n\r\nDios me cuida.\r\n\u00c9l conmigo est\u00e1,\r\n\u00c9l nunca me deja,\r\n\u00c9l nunca me deja.\r\n\r\nDios me ama, \r\ncon eterno amor,\r\n\u00c9l nunca me falla, \r\n\u00c9l nunca me falla. \r\n\r\nEl triunf\u00f3,\r\na la muerte venci\u00f3,\r\nvivo est\u00e1 \r\nes poderoso. \r\n\r\nEn Jes\u00fas \r\nsoy vencedor,\r\nnuestro Dios \r\nes Poderoso.", 5756292874371072], ["Porque Para Siempre", "Danilo Montero", "Eres T\u00fa", "2017/11/26", "Cuando alabamos tu nombre se\u00f1or,\r\nnos sorprenden tus maravillas.\r\nAs\u00ed lo hizo Israel cuando sus enemigos le amenazaron.\r\n\r\nY al orar te escucharon decir,\r\nno teman es mi batalla.\r\nEn la ma\u00f1ana cantando con fe,\r\nles vencieron al declarar.\r\n\r\n//// Porque para  siempre\r\nes tu misericordia ////\r\n\r\nA ti clam\u00e9 en mi angustia Se\u00f1or\r\ny tu mano me extendiste.\r\n\r\nLlor\u00e9 en la noche, pero al despertar\r\ntu gracia me dio una sonrisa.\r\n\r\nEn ti estoy seguro,\r\npues tu brazo no se cansar\u00e1.\r\nPor tanto, yo te confesar\u00e9,\r\na las naciones declarar\u00e9. \r\n\r\n//// Porque para  siempre\r\nes tu misericordia ////\r\n\r\nEl que habita al abrigo de Dios,\r\nmorar\u00e1 bajo su sombra.\r\n\r\nEl es quien te sustentar\u00e1.\r\nTe dir\u00e9 eres mi esperanza,\r\ncastillo m\u00edo eres T\u00fa,\r\nMi Dios en quien confiar\u00e9.\r\n\r\n//// Porque para  siempre\r\nes tu misericordia ////\r\n\r\n", 2080010], ["Vivir\u00e9 Para Adorarte", "Marco Barrientos", "Es Por Tu Gracia", "2017/11/26", "Me acerco a ti,\r\noh, mi Jes\u00fas,\r\neres refugio y mi fortaleza.\r\n\r\nNo temer\u00e9,\r\nall\u00ed estar\u00e9,\r\nbajo tus alas\r\nespera mi alma.\r\n\r\nTan s\u00f3lo vivir\r\nconfiado en ti\r\ny poder habitar\r\nen tu santo lugar.\r\n\r\nEn tu presencia\r\npor siempre estar\r\ny contemplar\r\ntu dulce mirar.\r\n\r\nPorque no hay nadie en este mundo como t\u00fa,\r\nporque no hay un ser tan especial como Jes\u00fas.\r\n\r\nVivir\u00e9 para adorarte,\r\nvivir\u00e9 para exaltarte,\r\nvivir\u00e9 agradecido a Ti.\r\n\r\nTan s\u00f3lo a ti.", 8060013], ["Has Aumentado", "Danilo Montero", "Admirable", "2017/11/26", "Has aumentado,\r\n\u00a1Oh, Dios! tus maravillas,\r\nenumerarlas no puedo.\r\n\r\nSi yo anunciare y hablare de ellas,\r\nNo hay tiempo para terminar.\r\n\r\nHas aumentado,\r\n\u00a1Oh, Dios! tus maravillas,\r\ny ya no puedo contarlas.\r\n\r\nMisericordia me das d\u00eda tras d\u00eda.\r\nTu canto en mi boca estar\u00e1.\r\n\r\nGrandes son tus obras,\r\npoder\u00edo y majestad.\r\nTuyo es todo imperio,\r\ntoda gloria y potestad.\r\n\r\nGrande es tu dominio,\r\nel universo lleno,\r\nest\u00e1 de tu poder,\r\ngrande eres T\u00fa,", 8080012], ["Es Imposible", "Funky", "Indestructible", "2017/11/26", "Sin querer, me perd\u00ed por el mundo\r\ntermin\u00e9 dando tumbos\r\nsin rumbo, de aqu\u00ed para all\u00e1\r\nviviendo todo a mi manera.\r\n\r\nMe cre\u00ed\r\nmi propia mentira, diciendo \r\nque todo era risa que no me dol\u00eda \r\nque solo pod\u00eda y soy fuerte. \r\n\r\nMe encontr\u00e9, con tu amor\r\ny todo lo que pensaba \r\nque era yo, se acab\u00f3,\r\ntu luz alumbr\u00f3 mis penas\r\n\r\nMe encontr\u00e9 con tu amor \r\npagaste por mi condena,\r\ny ahora yo, no soy yo,\r\nesta vida es tuya entera.\r\n\r\nEs imposible,\r\nchocarse contra tu cruz \r\ny seguir siendo igual \r\nT\u00fa lo cambias todo, todo.\r\n\r\nEs imposible,\r\nencontrarse con tu amor \r\ny volver para atr\u00e1s,\r\nsi ah\u00ed empieza todo, todo.\r\n\r\nAhora yo\r\nno concibo mi vida sin vivir\r\npara darte alegr\u00eda \r\ny contarle, a la gente\r\nlo bueno que eres.\r\n\r\nEn ti tengo el amigo\r\nque siempre busqu\u00e9,\r\nmi vida es mejor\r\ndesde que te encontr\u00e9,\r\nno puedo cambiar lo que das,\r\npor riqueza y placeres\r\n\r\nOh oh oh, oh oh oh oh ooh \r\nt\u00fa lo cambias todo, todo.\r\nOh oh oh, oh oh oh oh ooh \r\nt\u00fa lo cambias todo, todo.\r\n\r\nEs imposible no cambiar,\r\nyo conoc\u00ed la verdad\r\ny entend\u00ed lo que hiciste\r\npor amor a m\u00ed.\r\n\r\nEs imposible continuar, caminar\r\nde la misma manera de ayer\r\ny alejado de ti.\r\n", 5185169329750016], ["Hermoso eres", "Marcos Witt", "Poderoso", "2017/11/26", "En mi coraz\u00f3n\r\nhay una canci\u00f3n,\r\nque demuestra mi pasi\u00f3n.\r\n\r\nPara mi Rey y mi Se\u00f1or,\r\npara aquel que me am\u00f3.\r\n\r\nHermoso eres\r\nmi Se\u00f1or,\r\nhermoso eres\r\nAmado m\u00edo.\r\n\r\nT\u00fa eres la fuente de mi vida \r\nY el anhelo de mi coraz\u00f3n.\r\n", 5686536431468544], ["Su Hijo Dio", "Hillsong United", "Unidos Permanecemos", "2017/12/03", "Cuando miro al mundo s\u00e9 que en ti\r\nel futuro seguro est\u00e1,\r\npodemos ver tu gran amor\r\nnos creaste a tu imagen.\r\n\r\nJes\u00fas vino a darnos salvaci\u00f3n,\r\nllev\u00f3 mi pecado y mi dolor,\r\nahora justo soy en \u00e9l.\r\n\r\nDios a su hijo dio,\r\nJes\u00fas mi redentor,\r\nme salv\u00f3, nuevo soy,\r\nvivir\u00e9 por \u00e9l.\r\n\r\nEn ti he encontrado libertad,\r\npues tu vida, diste por m\u00ed.\r\nEn tu palabra quiero andar,\r\nMi padre, tu luz brilla en m\u00ed.\r\n\r\nJes\u00fas vino a darnos salvaci\u00f3n,\r\nllev\u00f3 mi pecado y mi dolor,\r\nahora justo soy en \u00e9l.\r\n\r\nDios a su hijo dio,\r\nJes\u00fas mi redentor,\r\nme salv\u00f3, nuevo soy,\r\nvivir\u00e9 por \u00e9l.\r\n\r\nEn tu palabra andar\u00e9,\r\nen tu luz brillar\u00e9,\r\nsiempre te alabar\u00e9,\r\ncantaremos.", 80013], ["Canto De Tu Amor", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2017/12/03", "Es por tu amor,\r\nque hoy tengo tu perd\u00f3n. \r\nEs por tu amor\r\nque puedo descansar en Ti. \r\n\r\n\r\nPor tu poder que todo se estremece, \r\npuedo ver T\u00fa mano en m\u00ed. \r\n\r\nCanto de tu amor, \r\ncanto de tu poder, \r\ncanto de tu grandeza, \r\ncanto de tu hermosura. \r\n\r\n", 2110012], ["Amor Sin Condici\u00f3n", "Marco Barrientos", "Gozo En Tu Presencia", "2017/12/03", "De tal manera al mundo t\u00fa amaste,\r\nque hasta tu vida entregaste,\r\ntu costado abierto fue.\r\n\r\nY fueron esas gotas de tu sangre\r\nque mi coraz\u00f3n limpiaron\r\nme hiciste un nuevo ser.\r\n\r\nGracias, te doy gracias,\r\npor tu amor sin condici\u00f3n en esa cruz,\r\ngracias te doy gracias,\r\npor tu perd\u00f3n la salvaci\u00f3n en esa cruz.\r\n\r\n//Amor sin condici\u00f3n,\r\namor sin condici\u00f3n//", 7150011], ["Its Your Love", "Varios", "Planet Shackers", "2017/12/03", "Primero me amaste,\r\nmi vida miraste,\r\npor salvarme te diste en la cruz.\r\n\r\nD\u00f3nde estar\u00eda\r\nsin ti en mi vida,\r\npues yo s\u00e9 que todo lo tengo en ti.\r\n\r\nOh, t\u00fa me has perdonado,\r\noh, tu gracia me salv\u00f3,\r\noh, ahora yo soy libre,\r\noh.\r\n\r\nTu amor nunca se acabar\u00e1,\r\nnunca se acabar\u00e1 por m\u00ed, yeah,\r\ntu amor, un camino abri\u00f3\r\nnunca ser\u00e9 igual por siempre.\r\n\r\nEs tu amor...\r\n\r\nSe\u00f1or te agradezco\r\npor todo lo que has hecho\r\nporque veo que t\u00fa tienes el control\r\n\r\nOh, t\u00fa me has perdonado,\r\noh, tu gracia me salv\u00f3,\r\noh, ahora yo soy libre,\r\noh.\r\n\r\nTu amor nunca se acabar\u00e1,\r\nnunca se acabar\u00e1 por m\u00ed, yeah,\r\ntu amor, un camino abri\u00f3\r\nnunca ser\u00e9 igual por siempre.\r\n\r\nPude ver en m\u00ed cadenas romper,\r\nlibertad por mis venas correr,\r\ntengo victoria sobre la muerte\r\nlibre soy.", 5129208992890880], ["Eres T\u00fa Mi Navidad", "Coalo Zamorano", "Lleg\u00f3 Navidad", "2017/12/03", "Llego el momento,\r\nlas compras comenzaron ya\r\nEste es el tiempo,\r\nque todos esperan m\u00e1s, ha llegado navidad\r\n\r\nFamilias viajan,\r\nreuniones llenas de felicidad\r\nEste es el tiempo,\r\nque todos esperan m\u00e1s, ha llegado navidad.\r\n\r\nRegalos, fiestas, luces, nunca cambiaran\r\nCelebraciones, risas no reemplazar\u00e1n\r\nEl verdadero tiempo, de mi alegr\u00eda,\r\nJes\u00fas naci\u00f3 y esa es la verdad\r\n\r\nHay mucha gente,\r\nque bajo el \u00e1rbol regalos no tendr\u00e1\r\nPero est\u00e1n felices,\r\nJes\u00fas les da su gozo y paz,\r\nha llegado navidad\r\n\r\nY hay muchos otros,\r\nque en estas fechas solos estar\u00e1n\r\nMas no hay tristeza,\r\nJes\u00fas les da su gozo y paz,\r\nha llegado navidad\r\n\r\nRegalos, fiestas, luces, nunca cambiaran\r\nCelebraciones, risas no reemplazar\u00e1n\r\nEl verdadero tiempo, de mi alegr\u00eda,\r\nJes\u00fas naci\u00f3 y esa es la verdad\r\n\r\nEres t\u00fa mi navidad,\r\nmi raz\u00f3n de celebrar\r\nEres t\u00fa mi navidad y es la verdad\r\nEres t\u00fa mi navidad,\r\nmi raz\u00f3n de festejar\r\nEs el milagro de la navidad\r\n\r\nRegalos, fiestas, luces, nunca cambiaran\r\nCelebraciones, risas no reemplazar\u00e1n\r\nEl verdadero tiempo, de mi alegr\u00eda,\r\nJes\u00fas naci\u00f3 y esa es la verdad\r\n\r\nEs el milagro de esta blanca navidad,\r\nNaci\u00f3 en un pesebre para el mundo amar\r\nNunca lo olvidemos y siempre recordemos,\r\nJes\u00fas naci\u00f3 y esa es la verdad", 5697552888365056], ["T\u00fa Nos Creaste", "Jes\u00fas Adri\u00e1n Romero", "Te Dar\u00e9 Lo Mejor", "2017/12/10", "T\u00fa nos creaste con un prop\u00f3sito,\r\npara tu nombre glorificar\r\ny cada d\u00eda sobre la tierra,\r\nproclamaremos tu majestad.\r\n\r\nT\u00fa nos creaste para alabarte,\r\npara tu gloria manifestar \r\ny cada d\u00eda sobre la tierra,\r\nanunciaremos tu gran bondad.\r\n\r\nQueremos darte gloria y honor,\r\nqueremos darte la adoraci\u00f3n \r\nqueremos exaltarte por siempre.\r\n\r\nA tus pies rindo todo lo que tengo Se\u00f1or \r\ny mi devoci\u00f3n entera solo a Ti te la doy.\r\n\r\n//Por siempre y siempre//\r\n", 90012], ["Ahora Vivo Para Ti", "Varios", "Esperanza de Vida", "2017/12/10", "Nadie puede igualar,\r\nlo que hiciste t\u00fa por m\u00ed,\r\nhas cambiado mi dolor\r\npor tu amor.\r\n\r\nMe has dado libertad,\r\nvida eterna y mucho m\u00e1s,\r\nm\u00e1s de lo que pueda imaginar.\r\n\r\nMi Jes\u00fas, a d\u00f3nde ir\u00e9\r\nsi no est\u00e1s nada soy\r\npues tu amor\r\nme conquist\u00f3,\r\nsiempre te amar\u00e9.\r\n\r\nAhora vivo para ti,\r\neres todo lo que quiero,\r\nya no s\u00e9 estar sin ti,\r\nsiempre est\u00e1s conmigo mi Jes\u00fas.", 6110002], ["Fuego", "Marco Barrientos", "Viento M\u00e1s Fuego", "2017/12/10", " Echen agua en el altar,\r\n pongan agua una vez m\u00e1s,\r\n ver\u00e1n que nada detendr\u00e1, jam\u00e1s\r\n ver\u00e1n que nada impedir\u00e1, el...\r\n\r\nFuego que viene del cielo,\r\nfuego que Dios manda hoy,\r\nfuego que enciende naciones,\r\nfuego en nuestros corazones.\r\n\r\nTodo ojo le ver\u00e1,\r\nsu palabra cumplir\u00e1,\r\nver\u00e1n que nada detendr\u00e1, jam\u00e1s,\r\nver\u00e1n que nada impedir\u00e1, el...\r\n\r\n//Arde el fuego, arde el fuego,\r\narde el fuego ya////", 7120008], ["We Will Wait", "Varios", "Ron Kenoly", "2017/12/10", "Correr\u00e9 sin cansarme\r\ncaminar\u00e9 sin desmayar\r\nporque el Se\u00f1or est\u00e1 delante y\r\nsu gozo fuerza es.\r\n\r\nLevantar\u00e9 alas como \u00e1guila\r\nno flaquear\u00e9 ni caer\u00e9\r\nya estoy en su presencia\r\ny yo espero en el Se\u00f1or.\r\n\r\nS\u00ed, yo espero en el Se\u00f1or,\r\npues su presencia\r\nesta llena de amor\r\ny nuestras fuerzas\r\nnuevas ser\u00e1n,\r\nS\u00ed, yo espero en el Se\u00f1or.\r\n\r\n", 5724596284162048], ["\u00c9l Venci\u00f3", "Hillsong College", "No Other Name", "2017/12/10", "En pecado estaba yo\r\nen verg\u00fcenza y en dolor,\r\nsin descanso en mi interior,\r\nno encontraba direcci\u00f3n.\r\n\r\nEn sus hombros \u00e9l carg\u00f3\r\ntoda culpa y temor,\r\nobediente fue a la cruz\r\ny por m\u00ed muri\u00f3 Jes\u00fas,\r\ny por m\u00ed muri\u00f3 Jes\u00fas.\r\n\r\n\u00c9l venci\u00f3, \u00e9l venci\u00f3,\r\nlibertad me entreg\u00f3, \r\n\u00c9l venci\u00f3, \u00e9l venci\u00f3,\r\nCristo resucit\u00f3,\r\nCristo resucit\u00f3.\r\n\r\nSumergido en su amor,\r\nen gracia y su perd\u00f3n,\r\nlibre me levantar\u00e9,\r\nCristo en m\u00ed y yo en \u00e9l.", 5733052001026048], ["Te Doy Gloria", "Marco Barrientos", "Ilumina", "2017/12/23", "Cu\u00e1n hermoso eres Jes\u00fas,\r\nson tus palabras,\r\nes tu amor.\r\n\r\nCu\u00e1n glorioso eres Jes\u00fas,\r\nes tu poder,\r\nfue tu cruz.\r\n\r\nLa que me salv\u00f3,\r\nme rescat\u00f3,\r\nun momento ah\u00ed\r\nnos dio libertad.\r\n\r\n///Te doy gloria,\r\ngloria///\r\na ti Jes\u00fas.\r\n\r\nCon una corona de espinos\r\nte hiciste rey por siempre.", 2170002], ["Tu Mereces", "Hillsong United", "Otros", "2017/12/23", "Cu\u00e1n grande amor,\r\nnos demostr\u00f3,\r\npor m\u00ed muri\u00f3,\r\nsu vida ofreci\u00f3.\r\n\r\nLa cruz venci\u00f3,\r\nnos dio perd\u00f3n,\r\nvolvi\u00f3 a comprar,\r\npor m\u00ed la libertad.\r\n\r\nVida me dio,\r\nmis ojos abri\u00f3,\r\nsiempre le alabar\u00e9,\r\ntodo ofrecer\u00e9.\r\n\r\nVida me dio, \r\nmis ojos abri\u00f3,\r\npuedo ver su incomparable amor.\r\n\r\nTu luz por siempre\r\nbrillar\u00e1,\r\nDios de gloria\r\nreinar\u00e1s. \r\n\r\nS\u00ed, voy a cantar,\r\na ti Se\u00f1or,\r\ncon todo mi ser,\r\npor ti, yo vivo Dios. \r\n\r\nSolo en Jes\u00fas,\r\nhay salvaci\u00f3n,\r\nEterno Rey\r\ny victorioso Dios.\r\n\r\nTodo mi ser\r\nofrecer\u00e9,\r\nmi vida doy,\r\nte entrego lo que soy.\r\n\r\nSin ti la vida\r\nno me puedo imaginar, \r\nporque es por ti,\r\ntodo es por ti Dios.", 2300001], ["Rey De Majestad", "Hillsong", "Blessed", "2017/12/23", "Sabes que te amo,\r\nsabes que yo quiero\r\nconocerte m\u00e1s \r\nmucho m\u00e1s que ayer.\r\n\r\nMis palabras son reales,\r\ny no las invento.\r\nVivo para ti,\r\nyo me dedico a ti.\r\n\r\nRey de majestad,\r\ntengo un deseo,\r\nestar contigo mi se\u00f1or,\r\nestar contigo mi se\u00f1or.\r\n\r\nCristo eres el salvador de mi ser,\r\ny por siempre y siempre a ti,\r\nalabanzas dar\u00e9.", 5090014], ["Better Than Life", "Hillsong", "Hope", "2017/12/23", "El mejor tesoro eres t\u00fa,\r\nmejor que las voces de mis amigos,\r\nmejor que los sue\u00f1os de mi coraz\u00f3n,\r\npara empezar.\r\n\r\nMejor que cumplir todos mis antojos,\r\nmejor que llevar la vida que yo quiero,\r\nmejor que el amor que cualquiera da,\r\nes tu amor.\r\n\r\nMe sostienes hoy,\r\nen tus brazos,\r\nno me dejar\u00e1s.\r\n\r\nT\u00fa Se\u00f1or das brillo al sol,\r\ny a la luna en la noche,\r\nme das tu unci\u00f3n y tu amor,\r\nte doy mi coraz\u00f3n, porque...\r\n\r\nNo dejo de enamorarme de ti,\r\nno dejar\u00e9 de enamorarme de ti.", 7160008], ["Ha Nacido el Rey", "Hillsong United", "Otros", "2017/12/23", "Nace un salvador\r\ndel cielo.\r\nEn un pesebre \u00c9l\r\nfue dado.\r\n\r\nLuz a la humanidad\r\ny al mundo paz.\r\nLa tierra celebrar\u00e1\r\nes Navidad.\r\n\r\nAlza tu voz y canta al Se\u00f1or,\r\nes Navidad.\r\nNace el Rey al\u00e9grate hoy,\r\nes Navidad.\r\nGozo hay en \u00e9l,\r\nes Navidad.\r\nGloria para \u00e9l Rey,\r\nes Navidad.\r\n\r\nSu esperanza y paz\r\n\u00e9l nos dar\u00e1\r\nLa tierra celebrar\u00e1\r\nes Navidad, es Navidad.\r\n\r\n", 5652720409116672], ["Para Exaltarte", "Hillsong United", "Con Todo", "2018/01/07", "A\u00fan siendo inocente\r\nen esa cruz\r\nte diste por amor,\r\nlibertad me entregaste.\r\n\r\nBorraste mi pasado,\r\nvolv\u00ed a nacer,\r\nme diste salvaci\u00f3n,\r\na la muerte tu amor venci\u00f3.\r\n\r\nVivo \r\npara exaltarte Jes\u00fas.\r\n\r\nCristo t\u00fa\r\ndiste lo que nadie pudo dar,\r\nno importa m\u00e1s lo que dir\u00e1n\r\nlibre soy...\r\n\r\nEl mundo est\u00e1\r\ncambiando,\r\npuedo escuchar\r\nla gente despertar,\r\ntu esperanza encuentran.\r\n\r\nDejando atr\u00e1s \r\nlo viejo,\r\nme acerco a ti,\r\nvenga tu reino Dios,\r\nte ofrezco mi adoraci\u00f3n.\r\n \r\n\r\n\r\nMirando a lo alto,\r\na una voz \r\nclamamos juntos.\r\n\r\nNuestra pasi\u00f3n \r\nservirte,\r\nrendirte Dios,\r\nhonor y gloria.\r\n\r\nMirando a lo alto,\r\na una voz clamamos juntos.\r\n\r\nNuestra pasi\u00f3n \r\nservirte\r\na ti Se\u00f1or.", 4050013], ["El Que Lav\u00f3 Mis Pies", "Danilo Montero", "Fortaleza", "2018/01/07", "Con toda gloria y toda majestad\r\ndise\u00f1ador del universo\r\ndesde su trono eterno nos miro\r\ny vino aqu\u00ed como cordero.\r\n\r\nEntre nosotros quiso caminar\r\nbuscando al m\u00e1s necesitado,\r\nhasta a un leproso pudo abrazar\r\nllevo mi herida en su costado.\r\n\r\nEl que lav\u00f3 mis pies,\r\nsiendo rey en su mesa me dio de comer,\r\nme hizo caminar sobre el mar.\r\nel \u00fanico que quiero adorar.\r\n\r\nCon alto precio \u00e9l nos valor\u00f3,\r\nnos dio su vida y su cansancio.\r\nEl hizo al d\u00e9bil fuerte en su poder\r\ny vio en el pobre un heredero.\r\n\r\nEl que lav\u00f3 mis pies,\r\nsiendo rey en su mesa me dio de comer,\r\nme hizo caminar sobre el mar,\r\nel \u00fanico que quiero adorar.\r\nEs Jes\u00fas mi rey el que mi victoria es\r\ny sobre todo.\r\n\r\nEl que lav\u00f3 mis pies,\r\nsiendo rey en su mesa me dio de comer,\r\nme hizo caminar sobre el mar,\r\nel \u00fanico que quiero adorar.\r\n\r\nYo quiero adorar, yo quiero adorarte.\r\n\u00a1Si Jes\u00fas!\r\n\u00a1Yo quiero adorar, yo quiero adorar! \r\nte quiero adorar.", 5070017], ["Te Proclamamos Rey", "Danilo Montero", "Eres T\u00fa", "2018/01/07", "Hoy quiero proclamar,\r\ntu gloria y majestad.\r\nCon fuerza anunciar que t\u00fa eres\r\nreal.\r\n\r\nM\u00eda es tu libertad,\r\ntu palabra es imposible de\r\ncomparar.\r\n\r\nRoca inconmovible,\r\npoderoso gigante,\r\nt\u00fa gobiernas en todo lugar.\r\n\r\nHoy te proclamamos rey,\r\nque tu reino y tu ley,\r\nsean para siempre en\r\ncielo, tierra y mar.\r\n\r\nTodo ojo te ver\u00e1\r\ny a voces cantar\u00e1n,\r\nque el verdadero amor y Padre Eterno,\r\nsolo lo eres t\u00fa.\r\n\r\nSolo t\u00fa, solo t\u00fa,\r\nSe\u00f1or eres t\u00fa.\r\n\r\nSolo lo eres t\u00fa.\r\n\r\n", 8070010], ["Nada Es Imposible", "Marco Barrientos", "Ilumina", "2018/01/07", "Por ti, todo lo puedo,\r\ntodo es posible\r\ny la fuerza t\u00fa me das\r\nnada es imposible.\r\n\r\nPor ti, los ojos se abren\r\ncadenas son rotas\r\ny yo vivir\u00e9 por fe\r\nnada es imposible.\r\n\r\nNo vivir\u00e9 por lo que veo,\r\nno vivir\u00e9 por lo que siento,\r\nyo s\u00e9 que aqu\u00ed conmigo est\u00e1s,\r\nyo s\u00e9 que t\u00fa eres grande Dios.\r\n\r\nCreo en ti, creo en ti,\r\ncreo en ti, creo en ti \r\nCristo.", 5677751478517760], ["Hosanna", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2018/01/07", "//Hosanna, en las alturas,\r\nexaltad a nuestro rey,\r\nHosanna// \r\n\r\nSe exaltado, exaltado, \r\nse exaltado \r\n//Cristo hoy \r\nse exaltado, exaltado,\r\nse exaltado// \r\n\r\n///Exaltad a nuestro rey/// \r\nHosanna\r\n\r\nHosanna, en las alturas,\r\nexaltad a nuestro rey,\r\nHosanna.\r\n\r\n", 5751832013963264], ["Tell The World", "Hillsong Kids", "Tell The World", "2018/01/13", "No quiero estar aqu\u00ed para cantar,\r\nluego tu nombre olvidar.\r\nEstoy aqu\u00ed por una raz\u00f3n,\r\nPorque no hay nada como mi Dios.\r\n\r\nLo \u00fanico que deseo eres t\u00fa, \r\nTodo lo que anhelo eres t\u00fa .\r\n\r\nDile al mundo vive Jes\u00fas, \r\nDile al Mundo,\r\nDile al mundo.\r\n\r\nDile al mundo el murio por ti,\r\nDile al mundo el vive otra vez.\r\n\r\nYa no soy yo, \r\nEs cristo en mi,\r\nPor su verdad soy libre al fin.\r\n\r\nDios puede hacer un mundo mejor,\r\npor su gracia y por su amor.\r\n\r\nVamos vamos,\r\nDile al mundo de Jes\u00fas.\r\n\r\n\r\n", 5080010], ["Trust And Obey", "Hillsong Kids", "Follow You", "2018/01/13", "De todo lo que puedo hacer por ti,\r\nde todo lo que puedo dar,\r\nnada es mejor, Se\u00f1or,\r\nque obedecer.\r\n\r\nDe todo lo que puedo ser por ti,\r\nde todo lo que puedo orar,\r\nCristo conf\u00edo en ti y obedecer\u00e9.\r\n\r\n///Y te seguir\u00e9,\r\ndonde gu\u00edes ir\u00e9///\r\nCristo\r\n\r\nCristo te agrada ver mi fe\r\ny el obedecer tu ley.\r\n\r\n", 6120016], ["Cristo T\u00fa Me Has Amado", "Varios", "\u00cdngrid Rosario", "2018/01/13", "Cristo, T\u00fa me has amado,\r\nCristo, nunca  de Ti me apartar\u00e9,\r\ndel pecado, T\u00fa me has rescatado,\r\nmis pies pusiste en la roca  \r\ny yo s\u00e9 que\r\n\r\nTe amo, por siempre\r\naunque el mundo alrededor \r\npueda cambiar,\r\nT\u00fa eres, mi salvador,\r\nyo te adorar\u00e9 por la etern\u00eddad.\r\n\r\nCristo, T\u00fa me has amado.\r\n\r\n\r\n\r\n", 7140008], ["Break Free", "Hillsong United", "Otros", "2018/01/13", "No s\u00e9 si puedes hoy creer \r\nlo que vas a escuchar,\r\nque hay un amor que te da vida \r\ny nunca fallar\u00e1.\r\n\r\n//Yo soy libre, yo soy libre,\r\nvoy a bailar en su amor //\r\n\r\nQui\u00e9n lo dir\u00eda que Dios \r\na Jes\u00fas por m\u00ed envi\u00f3 \r\ndando su vida en la cruz \r\npara mostrar su amor.\r\n\r\n//Yo soy libre, yo soy libre,\r\nvoy a bailar en su amor //\r\nSu amor es eterno.\r\n\r\nEn ti est\u00e1 la verdad \r\nno lo puedo negar,\r\nDios por siempre,\r\nyo voy a bailar,  voy a bailar,\r\nte alabo.\r\n\r\nAhora es el tiempo \r\nde tomar nuestra libertad \r\npara tu gloria \r\nnuestras vidas vamos a entregar.\r\n\r\n//Yo soy libre, yo soy libre, \r\nvoy a bailar en su amor //\r\nSu amor es eterno.\r\n\r\nPermanezco en tu luz,\r\nvida eterna eres T\u00fa,\r\nen todo tiempo, yo voy a bailar,\r\nvoy a bailar, te alabo.\r\n\r\nCon todo mi ser yo te seguir\u00e9, \r\nseguir\u00e9 tu voluntad, \r\nyo te seguir\u00e9, seguir\u00e9.\r\n\r\nPues tu palabra es verdad,\r\ntu amor me da libertad,\r\nvoy a bailar.\r\n\r\n//Yo soy libre, yo soy libre,\r\nvoy a bailar yo soy libre//\r\n\r\nYo soy libre, yo soy libre,\r\nvoy a bailar, yo soy libre.\r\nYo soy libre, yo soy libre \r\nvoy a bailar en su amor \r\nsu amor es eterno\r\n\r\nEn ti est\u00e1 la verdad \r\nNo lo puedo negar \r\nDios por siempre,\r\nyo voy a bailar, voy a bailar,\r\nte alabo.", 5644406560391168], ["Sin L\u00edmites", "Varios", "Planet Shackers", "2018/01/13", "Le digo adi\u00f3s\r\na las limitaciones.\r\nLe digo hola\r\nal Dios de la creaci\u00f3n.\r\n\r\nNo hay imposibles con Dios.\r\n\r\nSin limites,\r\ntodo lo puedes Dios Ohh Ohh.\r\nSin limites\r\nno hay nada que no puedas hacer.\r\n\r\nEres grande,\r\neres fuerte,\r\npoderoso eres Dios,\r\nsin limites, sin limites\r\n\r\nDios T\u00fa eres grande,\r\neres grandioso,\r\neres m\u00e1s fuerte\r\nque nadie m\u00e1s.", 5743257380192256], ["Eres Mi Pasi\u00f3n", "Coalo Zamorano", "Eres Mi Pasi\u00f3n", "2018/01/21", "Mi amor, y mi canci\u00f3n,\r\nmi coraz\u00f3n pertenece a ti, Se\u00f1or.\r\nTodo lo que yo soy\r\nes tuyo.\r\n\r\nMi fe y devoci\u00f3n,\r\nmi esperanza siempre\r\nestar\u00e1 en ti, oh Dios.\r\nTodo lo que yo soy\r\nest\u00e1 en ti.\r\n\r\nT\u00fa llenas cada rinc\u00f3n en mi ser,\r\neres mi pasi\u00f3n.\r\n\r\nComo lluvia al desierto,\r\ncomo agua al sediento,\r\nCristo, t\u00fa sacias mi coraz\u00f3n.\r\n\r\nComo el hijo va a encontrarse\r\ncon los brazos de su padre,\r\nCristo, hoy vengo a ti,\r\nmi Se\u00f1or.\r\n\r\nHoy yo vengo a Ti\r\nT\u00fa eres mi fuente de vida\r\nHoy yo vengo a Ti\r\nJes\u00fas, por que T\u00fa eres mi pasi\u00f3n", 70012], ["Del Cielo", "Marco Barrientos", "Viento M\u00e1s Fuego", "2018/01/21", "Si me amas,\r\nguarda mi palabra.\r\nNo se turbe,\r\ntu coraz\u00f3n cree en m\u00ed.\r\n\r\nSoy el camino,\r\nverdad y vida para ti. \r\nMi paz te dejo,\r\nconsolador te enviar\u00e9.\r\n\r\nMi esp\u00edritu\r\nen ti derramar\u00e9.\r\nY en tus hijos\r\nvisiones yo pondr\u00e9.\r\n\r\nDel cielo,\r\nviento recio que sopl\u00f3.\r\nLlenando,\r\ntodo mi ser con tu amor.\r\n\r\nTu sangre,\r\nmi pecado consumi\u00f3\r\ny hoy puedo cantar.\r\n\r\nMi espiritu derramar\u00e9\r\nsobre tus hijos lo pondr\u00e9.", 4040014], ["Eres Escudo", "Varios", "Marcos Vidal", "2018/01/21", "Tu Se\u00f1or,\r\neres escudo alrededor de m\u00ed,\r\neres escudo alrededor de m\u00ed.\r\n\r\nQuien levanta mi cabeza,\r\nes mi gloria y mi fuerza,\r\nsolo T\u00fa, eres escudo alrededor. \r\n\r\nQuien prospera mi camino,\r\nquien sostiene mi destino,\r\nsolo T\u00fa, eres escudo Se\u00f1or.", 4050016], ["En \u00c9l Estoy Seguro", "Jes\u00fas Adri\u00e1n Romero", "Con Manos Vac\u00edas", "2018/01/21", "Con sus alas me cubrir\u00e1,\r\nmi esperanza en \u00e9l est\u00e1.\r\n\r\nMis caminos son protegidos\r\nen \u00e9l encuentro seguridad,\r\nporque conf\u00edo en mi Dios y mi Rey.\r\n\r\nComo guerrero que cubre mi ser\r\nme liberar\u00e1 del lazo cazador,\r\n\u00e9l es mi escudo y mi salvaci\u00f3n.\r\n\r\nEn \u00e9l estoy seguro \r\nyo confiado estar\u00e9,\r\ndebajo de sus alas all\u00ed morar\u00e9.\r\n\r\nMi refugio es \u00e9l estar\u00e9 yo de pie,\r\nporque conf\u00edo en mi Dios y mi Rey.\r\n\r\nCaer\u00e1n a mi lado mil\r\ny diez mil a mi diestra,\r\nmas a m\u00ed no llegar\u00e1 \r\n\u00e9l es mi escudo y mi fuerza.\r\n\r\nEn \u00e9l estoy seguro.", 5100016], ["Cu\u00e1nto Amo Tu Ley", "Danilo Montero", "Cantar\u00e9 De Tu Amor", "2018/01/21", "Cuanto amo tu ley,\r\nmi gozo es tu palabra,\r\nl\u00e1mpara es a mis pies\r\ny lumbrera a mi caminar.\r\n\r\nGuardame en tu ley\r\nsust\u00e9ntame en tu palabra\r\ny siempre te alabar\u00e9\r\ncon rectitud de coraz\u00f3n.\r\n\r\nCristo, tu palabra me alienta \r\nCristo, tu verdad me sustenta\r\nCristo, guiam\u00e9 en tu ley \r\ny perfecto mi camino ser\u00e1.", 8060009], ["Vida M\u00eda", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2018/01/28", "Es tiempo hoy de dar\r\nalabanzas al que vive\r\nes tiempo de entregar\r\nnuestra adoraci\u00f3n al Rey\r\n\r\nPorque infinito es\r\nsu amor para sus hijos\r\nporque su fidelidad\r\npor siempre es \r\n\r\nVida m\u00eda hoy bendice\r\nal que es justo y soberano\r\nvida m\u00eda ven y rinde\r\nhoy todo tu ser al Rey\r\n\r\nVida m\u00eda no te olvides\r\nque en Jes\u00fas tenemos vida\r\nen abundancia nos ha\r\ndado el Rey, vida m\u00eda", 2090013], ["Te Alabar\u00e9 Mi Buen Jes\u00fas", "Danilo Montero", "Admirable", "2018/01/28", "Eres T\u00fa la \u00fanica raz\u00f3n\r\nde mi adoraci\u00f3n, oh Jes\u00fas.\r\nEres T\u00fa la esperanza que\r\nanhel\u00e9 tener, oh Jes\u00fas.\r\n\r\nConf\u00edo en Ti me has ayudado,\r\ntu salvaci\u00f3n me has regalado.\r\nHoy hay gozo en mi coraz\u00f3n\r\ncon mi canto te alabar\u00e9.\r\n\r\n//Te alabar\u00e9, te glorificar\u00e9,\r\nte alabar\u00e9 mi buen Jes\u00fas//\r\n\r\nEn todo tiempo te alabar\u00e9.\nEn todo tiempo te adorar\u00e9.\r\n\r\n", 3060001], ["Por Qui\u00e9n Eres T\u00fa", "Hillsong", "Migthy To Save", "2018/01/28", "Aqu\u00ed estoy en tu presencia,\r\npensando en lo bueno que eres t\u00fa.\r\nEspero en ti, mi se\u00f1or\r\nanhelo escuchar tu dulce voz.\r\n\r\nSanto, justo,\r\nfiel hasta el final.\r\nSanas, salvas,\r\nmi amigo y redentor.\r\n\r\n////Te alabo por quien eres t\u00fa////\r\nJes\u00fas\r\n\r\nSeguro estoy,\r\nfuerte en ti soy,\r\ntu amor es fiel\r\nsiempre.", 5090013], ["Santo", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2018/01/28", "Por los siglos eres Dios \r\nla creaci\u00f3n te adora hoy,\r\ncada tribu y naci\u00f3n,\r\ncantar\u00e1n en altavoz.\r\n\r\nSanto, Santo, Santo.\r\n\r\n//Eres T\u00fa,\r\nRey eterno soberano\r\neres luz //\r\nEres T\u00fa,\r\nT\u00fa eres Santo.\r\n\r\nManos altas hoy a ti,\r\nlevantamos con amor.\r\nLibres para adorar,\r\nhoy venimos a cantar.\r\n\r\nSanto, Santo, Santo.\r\n\r\n//Eres t\u00fa,\r\nRey eterno soberano\r\neres luz//\r\nEres t\u00fa,\r\nt\u00fa eres Santo.\r\n\r\nSanto, Santo, Santo.", 5629652273987584], ["S\u00f3lo T\u00fa Eres Mi Dios", "Marco Barrientos", "Ilumina", "2018/01/28", "Mi coraz\u00f3n late por ti\r\ny ahora tengo vida en m\u00ed,\r\noh, oh, oh, precioso Jes\u00fas.\r\n\r\nToda mi vida est\u00e1 en ti,\r\ny t\u00fa eres todo mi existir,\r\noh, oh, oh, precioso Jes\u00fas.\r\n\r\nEres el autor\r\nde vida y de salvaci\u00f3n\r\ny mi devoci\u00f3n\r\nser\u00e1 conocer tu amor.\r\n\r\nPorque t\u00fa, solo t\u00fa, eres mi Dios.\r\nPorque t\u00fa, solo t\u00fa, eres mi Dios.\r\n\r\nUo oh oh oh oh oh oh oh oh \r\n\r\n//Eres el autor de vida y de salvaci\u00f3n \r\ny mi devoci\u00f3n ser\u00e1 conocer tu amor// \r\n\r\n//Porque t\u00fa, solo t\u00fa, eres mi Dios// \r\n\r\nMi Dios, solo tu Jes\u00fas, eres mi Dios.", 5647791397273600], ["Lo Hiciste Por M\u00ed", "Marco Barrientos", "Ilumina", "2018/02/04", "En la cruz,\r\nlo diste todo,\r\nte entregaste por m\u00ed.\r\n\r\nEl poder,\r\nde tu sangre,\r\nrompi\u00f3 mi esclavitud.\r\n\r\nTengo vida, tengo paz.\r\n\r\nNo me olvidar\u00e9 lo que hiciste por m\u00ed. \r\n\u00a1\u00a1Me Amaste!!\r\nYo proclamar\u00e9 tu gran bondad Jes\u00fas. \r\n\u00a1\u00a1Me Salvaste!!\r\n\r\nRedentor,\r\nPr\u00edncipe de paz,\r\nel autor de mi salvaci\u00f3n. \r\n\r\nTengo vida, tengo paz.", 6340004], ["Canta Al Se\u00f1or", "Varios", "Don Moen", "2018/02/04", "Mi Cristo, mi Rey \r\nnadie es como t\u00fa \r\ntoda mi vida \r\nquiero exaltar,\r\nlas maravillas de tu amor.\r\n\r\nConsuelo refugio,\r\ntorre de fuerza y poder,\r\ntodo mi ser, lo que yo soy \r\nnunca deje de adorar.\r\n\r\nCante al Se\u00f1or toda la creaci\u00f3n,\r\nhonra, poder, majestad sea al rey,\r\nmontes caer\u00e1n y el mar rugir\u00e1 \r\nal sonar de su nombre.\r\n\r\nCanto con gozo al mirar tu poder \r\npor siempre yo te amar\u00e9 y dir\u00e9 \r\nincomparables promesas me das, Se\u00f1or.\r\n", 7170012], ["Hay Poder", "Coalo Zamorano", "M\u00e1s Fuerte Que Nunca", "2018/02/04", "Somos hijos perdonados\r\nRescatados de la muerte\r\nRedimidos, aceptados\r\nNuestro due\u00f1o es el m\u00e1s fuerte\r\n\r\nEn el mundo tendremos aflicci\u00f3n\r\nM\u00e1s Cristo al mundo venci\u00f3\r\n\r\nHay poder en su sangre divina\r\nEn la fuente de vida\r\nHay poder en su sangre gloriosa\r\nEn la cruz victoriosa\r\nHay poder\r\n\r\nVidas nuevas en victoria\r\nHoy caminamos sin derrota\r\nLibres somos por su sangre\r\nY las cadenas ya est\u00e1n rotas\r\n\r\nEn el mundo tendremos aflicci\u00f3n\r\nM\u00e1s Cristo al mundo venci\u00f3\r\n\r\nHay poder en su sangre divina\r\nEn la fuente de vida\r\nHay poder en su sangre gloriosa\r\nEn la cruz victoriosa\r\nHay poder\r\n\r\n//En el mundo tendremos aflicci\u00f3n\r\nM\u00e1s Cristo al mundo venci\u00f3//\r\n\r\n//Hay poder en su sangre divina\r\nEn la fuente de vida\r\nHay poder en su sangre gloriosa\r\nEn la cruz victoriosa//\r\nHay poder\r\nHay poder\r\n\r\n", 5639274879778816], ["Aqu\u00ed Estoy", "Hillsong United", "Unidos Permanecemos", "2018/02/04", "T\u00fa eres el principio,\r\ntuya es la eternidad,\r\nllamaste el mundo a existencia,\r\nme acerco a Ti.\r\n\r\nMoriste por mis fracasos,\r\nllevaste mi culpa en la cruz,\r\ncargaste en tus hombros mi carga,\r\nme acerco a ti.\r\n\r\n\u00bfQu\u00e9 puedo hacer, qu\u00e9 puedo decir?\r\nTe ofrezco mi coraz\u00f3n completamente a Ti.\r\n\r\nEn tu salvaci\u00f3n camino,\r\ntu esp\u00edritu vive en m\u00ed,\r\ndeclara en tus promesas,\r\nme acerco a Ti.\r\n\r\nAqu\u00ed estoy, con manos alzadas vengo,\r\npues t\u00fa todo lo diste por m\u00ed.\r\nAqu\u00ed estoy, mi alma a Ti entrego,\r\ntuyo soy, Se\u00f1or.", 5681777339269120], ["Hosanna", "Marco Barrientos", "Ilumina", "2018/02/04", "Levantamos un clamor\r\npor sanidad y redenci\u00f3n\r\nMu\u00e9stranos lo que T\u00fa ves\r\nlos secretos de tu coraz\u00f3n.\r\n\r\nUn pueblo unido pide hoy\r\ntu libertad y salvaci\u00f3n\r\n\u00c1rmanos con tu valor\r\nlo que deseamos es revoluci\u00f3n.\r\n\r\nQue el cielo se parta en dos, in\u00fandanos\r\nen el desierto broten r\u00edos, vida sopla hoy\r\n\r\nHossana al Rey de Salvaci\u00f3n\r\nHossana al Dios Alt\u00edsimo\r\nHossana, Jesucristo, Jesucristo es Rey\r\n\r\nHossana Hossana Hossana al rey", 5712088936742912], ["Siempre Estar\u00e1s A Mi Lado", "Danilo Montero", "Tu Amor", "2018/02/11", "Siempre estar\u00e1s a mi lado\r\ntodo tu amor me cubrir\u00e1.\r\n\r\nMientras yo, tome de tu mano,\r\nseguro yo voy a estar.\r\n\r\nGuia mis caminos\r\ncorrige mis pasos,\r\nno quiero fallarte,\r\nSe\u00f1or Jes\u00fas.\r\n\r\nYo voy alabarte\r\nmientras tenga vida\r\ny cuando se acabe por la eternidad.\r\n", 3100009], ["Lean On You", "Hillsong Kids", "Tell The World", "2018/02/11", "Vivo un nuevo d\u00eda,\r\ntu gracia es nueva cada d\u00eda,\r\nespero que Tu Luz me gu\u00ede.\r\n\r\nSolo t\u00fa eres digno,\r\nm\u00e1s grande que mis problemas,\r\nmi esperanza est\u00e1\r\nen ti.\r\n\r\nAqu\u00ed estoy yo y me entrego,\r\ndesespero por ti mi Dios.\r\nPorque quiero ver tu reino\r\ngobernando en m\u00ed.\r\n\r\nY oh Dios todo lo que quieras yo,\r\nlo entrego, lo entrego,\r\nconfiando\r\nque todo lo tengo en ti.\r\n\r\nY oh Dios todo lo que me pidas,\r\nyo quiero hacerlo,\r\nsi fallo tu gracia me sostendr\u00e1,\r\nsolo descanso en ti.\r\n\r\nSolo descanso en Ti,\r\nsolo en Ti Dios.\r\n\r\nSolo descanso en ti,\nen ti Dios.\r\nSolo descanso en ti,\nsolo en ti Dios.\r\n\r\n", 5080001], ["T\u00fa Eres Real", "Danilo Montero", "Admirable", "2018/02/11", "Te alabo,\r\nmi vida depende de ti.\r\n\r\nTodo mi ser,\r\nte pertenece a ti,\r\nhas sido mi refugio en mi caminar.\r\n\r\nTe adoro,\r\nmi coraz\u00f3n se postra ante ti.\r\n\r\nToda mi vida,\r\nse perfecciona en ti,\r\nhas sido mi refugio en mi caminar.\r\n\r\nT\u00fa eres real en mi vida,\r\nt\u00fa eres real en mi coraz\u00f3n,\r\namor a cada instante,\r\namor inagotable para m\u00ed.", 6130003], ["Digo S\u00ed", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2018/02/11", "Eres rey de mi coraz\u00f3n,\r\ndue\u00f1o eres de mi canci\u00f3n,\r\nsoy esclavo de tu amor,\r\ntuyo soy.\r\n\r\nDe ti nunca me soltar\u00e9 \r\ny a tu lado yo vivir\u00e9,\r\nsolo quiero agradarte a ti\r\ncon todo mi ser.\r\n\r\nMe rindo a ti,\r\nJes\u00fas, soy tuyo,\r\nmi coraz\u00f3n \r\nvivir\u00e1 por ti.\r\n\r\nDigo s\u00ed\r\na tu voluntad.\r\nDigo s\u00ed\r\na tu palpitar.\r\n\r\nDigo s\u00ed\r\na tu direcci\u00f3n.\r\nDigo s\u00ed\r\nal o\u00edr tu voz.\r\n\r\nDigo s\u00ed\r\na tu voluntad.\r\nDigo s\u00ed\r\na tu palpitar.\r\n\r\nDigo s\u00ed\r\na tu direcci\u00f3n.\r\nDigo s\u00ed\r\nal o\u00edr tu voz,\r\ns\u00ed, se\u00f1or.\r\n\r\nMi confianza\r\nest\u00e1 puesta en ti,\r\nen cada paso\r\nt\u00fa est\u00e1s ah\u00ed.\r\n\r\nAutor y consumador\r\nde mi fe\r\neres para m\u00ed.\r\n\r\nS\u00f3lo en ti \r\npuedo descansar,\r\nnada me robar\u00e1 la paz,\r\nmi mirada est\u00e1 fija en ti, \r\nno se desviar\u00e1.\r\n\r\nMe rindo a ti,\r\nJes\u00fas, soy tuyo,\r\nmi coraz\u00f3n \r\nvivir\u00e1 por ti.\r\n\r\nDigo s\u00ed\r\na tu voluntad.\r\nDigo s\u00ed\r\na tu palpitar.\r\n\r\nDigo s\u00ed\r\na tu direcci\u00f3n.\r\nDigo s\u00ed\r\nal o\u00edr tu voz.\r\n\r\nDigo s\u00ed\r\na tu voluntad.\r\nDigo s\u00ed\r\na tu palpitar.\r\n\r\nDigo s\u00ed\r\na tu direcci\u00f3n.\r\nDigo s\u00ed\r\nal o\u00edr tu voz,\r\ns\u00ed, se\u00f1or.\r\n\r\n///Me rindo a Ti \r\nyo digo s\u00ed///\r\nSe\u00f1or.", 7150012], ["Este es el D\u00eda", "Varios", "Planet Shackers", "2018/02/11", "Este es el d\u00eda que\r\nhizo nuestro Se\u00f1or,\r\nme alegrar\u00e9,\r\neste es el d\u00eda que\r\nhizo nuestro Se\u00f1or tan fiel.\r\n\r\nEste es el d\u00eda que\r\nhizo nuestro Se\u00f1or\r\npromesas nos di\u00f3,\r\neste es el d\u00eda que\r\nhizo nuestro Se\u00f1or tan fiel.\r\n\r\nHay un canto muy especial\r\nde alabanza en mi ser\r\nen mi coraz\u00f3n,\r\nes sobrenatural.\r\n\r\nY yo cantar\u00e9\r\n//Bueno es Dios//\r\nEn todo tiempo yo\r\n//Alabar\u00e9//\r\n\r\nEste es el d\u00eda que\r\nhizo nuestro Se\u00f1or\r\ny yo alabar\u00e9\r\nyo me alegrar\u00e9.", 5674823384563712], ["Me Has Mostrado El Camino", "Marco Barrientos", "Gozo En Tu Presencia", "2018/02/18", "Veo tu rostro Se\u00f1or,\r\nafirmas mi caminar.\r\nTu brazo me sustent\u00f3,\r\ncuando pens\u00e9 desmayar.\r\n\r\nMe has mostrado el camino,\r\nllenas de gozo mi ser.\r\nCon tu presencia me das vida.  \r\n\r\nEn tu presencia,\r\nme llenas de gozo,\r\nme has mostrado el camino.", 70010], ["Me Am\u00f3", "Marco Barrientos", "Viento M\u00e1s Fuego", "2018/02/18", "Al que me am\u00f3,\r\nqui\u00e9n su vida dio\r\nen la cruz,\r\nmi herida, \u00c9l san\u00f3.\r\n\r\nJes\u00fas, Jes\u00fas,\r\nen tu nombre hay redenci\u00f3n,\r\nJes\u00fas, Jes\u00fas\r\n\r\nGloria y honra al cordero,\r\nalabanzas a mi Rey.\r\nSanto y digno,\r\nfuerte y grande,\r\nvictorioso Se\u00f1or.\r\n\r\n", 6100008], ["Cantamos Aleluya", "Marco Barrientos", "Transformados", "2018/02/18", "Por tus obras,\r\npor tu bien,\r\npor tu amor y tu poder,\r\nporque t\u00fa nunca cambias.\r\n\r\nTu grandeza, tu gloria,\r\ntu bondad nos alcanza, \r\nporque nadie es como t\u00fa, \r\nt\u00fa eres rey.\r\n\r\n//Cantamos aleluya, aleluya,\r\ncantamos aleluya,\r\nal Rey// \r\n\r\nAl Rey,\r\nque venci\u00f3 a la muerte, \r\npor los siglos reina,\r\nsea la gloria\r\npor siempre.\r\n\r\nAl Rey,\r\nque extendi\u00f3 su mano,\r\npara darnos vida,\r\nsea la gloria por siempre. \r\n\r\n//Cantamos aleluya, aleluya,\r\ncantamos aleluya,\r\nal Rey// \r\n", 5713144022302720], ["Eres M\u00e1s", "Coalo Zamorano", "Mi Confianza Est\u00e1 En Ti", "2018/02/18", "Tocaste al ciego y al enfermo,\r\nal turbado diste paz.\r\n\r\nAl desahuciado esperanza,\r\nle diste vida y libertad.\r\n\r\nSobre el mar t\u00fa caminaste.\r\nLas tormentas se detienen\r\nal sonido de t\u00fa voz.\r\n\r\nEres m\u00e1s que un profeta,\r\neres m\u00e1s que una canci\u00f3n,\r\neres m\u00e1s que una historia,\r\nllena de emoci\u00f3n.\r\n\r\nM\u00e1s grande que mil universos.\r\nT\u00fa brillas m\u00e1s que el mismo sol.\r\nEres t\u00fa quien dio su vida,\r\nsolo por amor.", 5724160613416960], ["\u00a1Oh Jes\u00fas!", "Marcos Witt", "\u00a1Alabadle!", "2018/02/18", "Se\u00f1or mi escudo y mi fuerza T\u00fa has sido,\r\nrefugio en contra de mis enemigos.\r\nSe\u00f1or, tu verdad me ha protegido,\r\ntoda mi confianza en Ti he vertido.\r\n\r\n\u00a1Oh Jes\u00fas! tu sangre preciosa me ha lavado.\r\n\u00a1Oh Jes\u00fas! por tu gracia, yo he sido perdonado.\r\n\r\n\u00a1Oh Jes\u00fas! tu victoria me ha dado la vida eterna.\r\n\u00a1Oh Jes\u00fas! en Ti mi vida est\u00e1 segura Jes\u00fas!\r\n\r\nLa vida que ahora vivo en la carne\r\nla vivo en la fe en el Hijo de Dios\r\nel cual me am\u00f3 y por m\u00ed se ha entregado\r\npara vivir libre del pecado.", 5737979670691840]]